var book = {
	"name": "၂ စၫမုၫအ့လၭ",
	"numChapters": 24,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> စစီလူၫၥံၫအလးခဲၫ့နီၪ ဆၧမၩအၥၭလၧစဒၫဝံၭဂဲၫ ထဲၩ့ထဲၩ့လၧအမၩၥံၫၦအၫမလ့ၭဖိၪတၭ, စဒၫဝံၭအီၪ",
			"2": "<sup>2</sup> ထးဝ့ၫလၧဇံလၭနံၫနံၩတၭ,- လၧၥၧၫ့နံၩလနံၩနီၪ, ယိခွါ,ဆၧမၩအၥၭ လၧၦလဂၩဂဲၫလၧစစီလူၫအၥုၭ မုအကျၩအီၪလၧအဆဲၫ့ယၬ, ဒဲဂၪ့ခိၪအမုၬအီၪဝ့ၫ လၧအခိၪဎွံၪလီၩ့တၭ, ဂဲၫဝ့ၫလၧစဒၫဝံၭ အအီၪတၭ, ဆၧမၩအၥၭလၧအထိၪထံၩဖါလၩ့အၥၭ လၧဂၪ့ခိၪ",
			"3": "<sup>3</sup> တၭ,ထွံၩလၩ့ဝ့ၫလီၫ.- စဒၫဝံၭစံၭအဝ့ၫ, နဂဲၫအထံၭ ခီၫခီၫလဲၪ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယစဲၪ့ထၪ့ဖီၩ့ဖျ့ၭလၧ",
			"4": "<sup>4</sup> အံၫစရ့လၭအၥုၭမုၥုၪ့တဲၩအကျၩလီၫ.- တၭစဒၫဝံၭ စံၭဝ့ၫ,ဆၧမၩအၥၭဘဲၫၥ့ၪလဲၪ. လီၩဘၪလါယၧၩနး ထံၪဘီၪ.တၭအဝ့ၫစံၭဆၧၫ့ဝ့ၫ, ၦခမျၧးစဲၪ့ဖျိၭယူၭလၧ ဆၧဒုၭၥုၭအဖၧၩ့, ဒဲၦခမျၧးအၪဂၩလၩ့ထံၩဖါယူၭဆ့ တၭ,ၥံၫယူၭတၭ, စစီလူၫဒဲစစၪ့နၥၧၫ့ၥံၫဆ့ယူၭ.",
			"5": "<sup>5</sup> တၭစဒၫဝံၭစံၭၦဖိၪၥၪခွၫ လၧအလီၩဘၪအဝ့ၫနီၪ, စစီလူၫဒဲအဖိၪခွၫစစၪ့နၥၧၫ့ၥံၫယူၭနီၪ, မွဲနၥ့ၪယၫဘဲၫ",
			"6": "<sup>6</sup> ၥ့ၪလဲၪ.- တၭၦဖိၪၥၪခွၫလၧအလီၩဘၪအဝ့ၫ, စံၭဝ့ၫ ဒၪ,ဘၪလၧယအီၪလၧခိၪလီၩ့ဂံၫလဘိအၫတၭ, ယိခွါ, စစီလူၫဒိၭနဲၩ့အၥၭလၧအဖၩ့လီၫ. တၭယိခွါ,လဲၪ့ၥုၭ,",
			"7": "<sup>7</sup> ဒဲၦကၥ့ၪၥုၭဖိၪလဖၪလီၩ့ဆီးချႃၭန့အဝ့ၫလီၫ.- တၭ ထီးအယိဆၧလၧအလးခဲၫ့နီၪ, ဒၪဘၪယၧၩတၭ,ကိၭ",
			"8": "<sup>8</sup> န့ယၧၩနီၪ,ယစံၭဆၧၫ့ဆၧ, ယိခွါ,ယၧၩလီၫ.- တၭအ ဝ့ၫဒၪစံၭယၧၩ, နမွဲပလၫလဂၩလဲၪ. တၭယစံၭဆၧၫ့",
			"9": "<sup>9</sup> အဝ့ၫ, ယမွဲၦအၫမလ့ၭဖိၪလဂၩလီၫ.- တၭစံၭဒီၭ ယၧၩ,ဆၧၫ့ထုၪ့လါလၧယလီၩ့တၭ, မၩၥံၫယၧၩဆံၭ, အဂဲးဘဲၫယီၩဆၧခိဆၧဝီၩဘၪယၧၩနၭမၬလီၫ. အဂဲး ဘဲၫယီၩယၥၭထၧၫ့ဖျိၪ့ယၫအီၪဒံၭ လၧယဖၧၩ့လီၫ.",
			"10": "<sup>10</sup> အခိးမွဲယဆၧၫ့ထုၪ့ လၧအလီၩ့တၭ, ယမၩၥံၫအဝ့ၫ လီၫ.အဂဲးဘဲၫယီၩ ယၥ့ၪယၫတၡါလၧအလၩ့ထံၩဖါ အလးခဲၫ့နီၪမၧၫ့ၥ့ၪအ့ၬ. တၭယမၩန့အၥရဖူၩ, လၧ အအီၪဝ့ၫလၧအခိၪဎွံၪ, ဒဲထဲၫ့ဎွံၪအီၪလၧအစူၪလီၩ့ တၭ,ယဂဲၫဆိၬဆၧနီၪ လၧယကဆါအအီၪထီးယီၩ လီၫ.",
			"11": "<sup>11</sup> ထီးနီၪလဖၧၫ့စဒၫဝံၭ, ဖီၪ့အကီၩ့အၥိၭတၭၡၫ့ဝ့ၫ, ဒဲၦၡၩလၧအအီၪလၧအစူၪဖၧၩ့ထီးအလူၬ မၩဝ့ၫဘဲၫ",
			"12": "<sup>12</sup> နီၪၥိၭလီၫ.- အဝ့ၫၥံၪဒဲၩလၩ့အၥၭနၫၡါတၭဂၪ့ဝ့ၫ, ဒဲ ဒုၪဆၧအၪ့ဆၧအီၩထီၩ့လၩ့လၧ မုဂၪလၩ့လၧစစီလူၫ အကၠီၩ့,ဒဲလၧအဖိၪခွၫစစၪ့နၥၧၫ့အကၠီၩ့, ဒဲလၧယဟိ ဝၩအၡၩခမျၧးအကၠီၩ့, ဒဲလၧအံၫစရ့လၭအၡၩဂံၪ့ဖိၪ အကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪလၩ့ထံၩဖါဝ့ၫလၧ နၭလီၫ.",
			"13": "<sup>13</sup> တၭစဒၫဝံၭစံၭ ၦဖိၪၥၪခွၫ လၧအလီၩဘၪအဝ့ၫနီၪ, မွဲနအီၪအထံၭခီၫခီၫလဲၪ. တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ,ယ မွဲၦလခီၫဘၩ့မုးဖိၪ အဖိၪခွၫ, ၦအၫမလ့ၭဖိၪလီၫ.",
			"14": "<sup>14</sup> တၭစဒၫဝံၭစံၭအဝ့ၫ, နယၩ့ထၪ့နစူၪမၩဂၭဂီၩ့ၦလၧ အမွဲယဟိဝၩအၡၩဒိၭဂုၪအၥၭနီၪ, မွဲနၥၭမဲၪအ့ၬဧၪ.",
			"15": "<sup>15</sup> စဒၫဝံၭကိၭန့ၦလဂၩ လၧၦဖိၪၥၪခွၫလဖၪအကျၩတၭ, စံၭဝ့ၫၥုၭဘူၭနၥၭ ဖ့ၬခွံၬအဝ့ၫနီၪဆံၭ. တၭအဝ့ၫဖ့ၬ",
			"16": "<sup>16</sup> ခွံၬဝ့ၫထီးအၥံၫလီၫ.- တၭစဒၫဝံၭစံၭဝ့ၫ, နၥွံၪအီၪလၧ နခိၪဒၪနဝ့ၫအလီၩ့လီၫ. အဂဲးဘဲၫယီၩနနိၭထိးအၥၭ ထၫ့ဒုၪဒၩနနၫ့ဆါတၭ, စံၭဝ့ၫ, ယမၩၥံၫခွံၬယဟိဝၩ အၡၩဒိၭဂုၪအၥၭယူၭ.",
			"17": "<sup>17</sup> တၭစဒၫဝံၭမၩဆၧၥၭအုၭအထၭခိၪ လၧစစီလူၫဒဲ အဖိၪခွၫစစၪ့နၥၧၫ့အကၠီၩ့နီၪလီၫ.",
			"18": "<sup>18</sup> (တၭမၪလူၬဆၧၥီၪ့လိၪ ၦယုဒၫဖိၪလၧချံၪ ဎအထၭ ခိၪၭလီၫ. ယိခွါ, ဆၧကွ့ၭအၥၭ လၧလံၬ ယၫၡၧၫအ ဖၧၩ့လီၫ.)",
			"19": "<sup>19</sup> အံၫစရ့လၭအဆၧဎံၫဆၧလၩဧ့, နၥံၫလၧနလးထၪ့ ထီၫ, ၦအဆီၪ့လၩ့ထံၩဖါဝ့ၫဘဲၫၥ့ၪလဲၪၬ",
			"20": "<sup>20</sup> လီၩဘၪဝ့ၫလၧဂၫၥၭအဖၧၩ့လဂ့ၩ. ဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ဆၧ လၧအၭၡကလၧၫ့ အဖၧၩ့ၥၭ လဖၪလဂ့ၩ. ၦဖလံၡၫဖိၪ အဖိၪမုၪမိၥၭထိၬဘၪခိၬး ၦလဒိၭဘၪ ဆၧကူၭတရံၭအဖိၪမုၪ မိၥုၪ့ဎွံၫၥၭယီၫ ဘၪခိၬလီၫ.",
			"21": "<sup>21</sup> ဂံၫလဘိအၫအခိၪလီၩ့ၥံၪဧ့, ဆၩ့ထံၫမွဲဂ့ၩ, ဆၧဆၧၩ့မွဲဂ့ၩ, ဂၪ့ခိၪအဝၩ့လဖၪအီၪ လၧဆၧၥၪဆိၫမွဲဂ့ၩ, မွဲအထီးအီၪ လၧနၥံၪအလီၩ့ လဂ့ၩ. မွဲဆၧခွံၬၡိၭ ၦအဆီၪ့အထၩ့ဖံၭ လဘံၪ့ထီးနီၪအဂဲး, စစီလူၫအထၩ့ဖံၭနီၪ ဘၪဆၧဂုၪဝ့ၫလၧၥိၪအ့ၬ.",
			"22": "<sup>22</sup> လၧၦဘၪဆၧမၩၥံၫဝ့ၫအၥွံၪ, လၧၦအဆီၪ့အၥိၪနီၪ, စစၪ့နၥၧၫ့အချံၪကၠၪထဲၩ့အၥၭအ့ၬ. ဒဲစစီလူၫအနၭဂဲၫထဲၩ့ပျီၩဘၪအ့ၬ.",
			"23": "<sup>23</sup> တၭစစီလူၫဒဲစစၪ့နၥၧၫ့, မွဲၦလၧဆၧအဲၪဝ့ၫ, ဒဲၦယိဝ့ၫမုၬ လၧအမၧၫ့ဒံၭတၭ, လၧအၥံၫနီၪလၩ့ဖၭဘၪဝ့ၫအ့ၬ. အဝ့ၫၥံၪချဲၫ့နဲၪ့ဒံၭလံၬ ကျီၫ့ကျီၫ့ၥံၪ, အဂဲးအဘၭဆီၪ့နဲၪ့ဆၬလၥၧၫ့ဒံၭလီၫ.",
			"24": "<sup>24</sup> အံၫစရ့လၭအဖိၪမုၪၥံၪဧ့, ဂၪ့လၧစစီလူၫအကၠီၩ့ၦ လၧအဒုၭၥိၭနၥံၪလၧဆၧဝီၩ, ဒဲဆၧကယၧၩ့ကယီၫ, ၦလၧအကယၧၩ့ကယီၫ နၥံၪဒုၭကီၩ့ ဒုၭၥိၭနၥံၪလၧ ထီၫ့ၥံၪလွ့ၫၥံၪ,",
			"25": "<sup>25</sup> ၦလၧအဆီၪ့လဖၪနီၪ လၩ့ထံၩဖါလၧဆၧဒုၭၥုၭအ ကျၩဘဲၫၥ့ၪလဲၪၬ စစၪ့နၥၧၫ့ဧ့, နဘၪဆၧမၩၥံၫနၧၩလၧနလးထၪ့ထီၫ!",
			"26": "<sup>26</sup> ဆၧၡၪ့ဘၪယၧၩ လၧနကၠီၩ့, ယထၧၫ့ဖုဝဲစစၪ့န ၥၧၫ့ဧ့, နမွဲဆၧမုၬလၩလၧယဂးမုၬမုၬလ့ၬး နအဲၪယၧၩယီၩလၩ့လၭမၬကၨ, ဒိၪနဲၪ့ၦမုၪအဆၧအဲၪဒံၭလီၫ.",
			"27": "<sup>27</sup> ၦအဆီၪ့လၩ့ထံၩဖါဘဲၫၥ့ၪလဲၪ! တၭဆၧဒုၭၥုၭအစူၪဝဲၩဂၭဂီၩ့ဘဲၫၥ့ၪလဲၪ!"
		},
		"2": {
			"1": "<sup>1</sup> ဆၧလဖၪနီၪအလးခဲၫ့ ဆၧမၩအၥၭလၧစဒၫဝံၭအၪ့ စၪ့ဆၧလၧယဟိဝၩတၭ, စံၭဝ့ၫဒၪ, ယမိဘၪလ့ၩထၪ့ လၧယုဒၫအဒိၩ့လဖျိၪ့ဖျိၪ့ဆ့ဧၪး တၭယဟိဝၩစံၭအ ဝ့ၫ,လ့ၩထၪ့ဘီၪ. တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ယမိဘၪလ့ၩ ထၪ့ခီၫခီၫလဲၪ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, လၧဟံဘြၧၫ့နီၪ",
			"2": "<sup>2</sup> လီၫ.- တၭစဒၫဝံၭလ့ၩထၪ့ထီးနီၪ, လၧအမၫနံၫဂၩဆ့, ၦယ့ၭစရ့လၭဖိၪ နးအဟံၫ့နိၫအၫ့, ဒဲၦကၫမလ့ၭဖိၪစ",
			"3": "<sup>3</sup> နၫဘလၭအမၫနးအၭဘဂၫလၭလီၫ.- တၭစဒၫဝံၭလ့ၩ ကိၭန့ၦအီၪလၧအၥိၭလဖၪ, လဂၩလၧအၡၩဂံၪ့ဖိၪ, လဂၩလၧအၡၩဂံၪ့ဖိၪဆုၬဆုၬတၭ, အဝ့ၫၥံၪအီၪဝ့ၫ",
			"4": "<sup>4</sup> လၧဟံဘြၧၫ့အဒိၩ့လဖၪအဖၧၩ့လီၫ.- ယုဒၫအၡၩဂဲၫ ဝ့ၫတၭ,ဂုၪစဒၫဝံၭထီးနီၪလၧအမိကဲၪစဎွၩ လၧယုဒၫ အၡၩဂံၪ့ဖိၪၥံၪအဖၫ့ခိၪလီၫ. တၭၦလီၩဘၪ စဒၫဝံၭ လၧၦယ့ဘ့ၭဂံလအၭဖိၪခုၪ့လၩ့ဘၧၩ့ခွံၬ စစီလူၫလီၫ.",
			"5": "<sup>5</sup> တၭစဒၫဝံၭအၪ့မၧၫ့ အၥီၫ့ၥံၪလ့ၩလၧယ့ဘ့ၭဂံလ အၭအၡၩၥံၪအအီၪတၭ, စံၭအဝ့ၫၥံၪ, မွဲနၥံၪဘၪဆၧ ဆိၪဂ့ၩ လၧယဟိဝၩဆံၭ. အဂဲးဘဲၫယီၩ နၥံၪမၩခိး မၩတၩနၥံၪအကဆါစစီလူၫတၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ",
			"6": "<sup>6</sup> လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ, မွဲယဟိဝၩမၩနၥံၪလၧဆၧအ ခိးအတၩ, ဒဲဆၧမွဲဆၧတီၩနီၪဆံၭ. တၭယဝ့ၫဒၪယီၩ ယမိမၩနၥံၪလၧဆၧဂ့ၩဆ့ လၧဆၧအခိးအတၩယီၩ အကၠီၩ့လီၫ. မွဲလၧနၥံၪမၩဆၧနီၪလမံၩ့ အဂဲးလီၫ.",
			"7": "<sup>7</sup> တၭဘိၩ့နဲၪ့ယီၩ မွဲနၥံၪအစူၪဆီၪ့ထၪ့, ဒဲနၥံၪအၥၭဎွံၫ ထၪ့ဆံၭ. အဂဲးဘဲၫယီၩနၥံၪအကဆါ စစီလူၫၥံၫယူၭ. ယုဒၫအၡၩဂံၪ့ဖိၪဂုၪယၧၩ လၧစဎွၩ လၧအဝ့ၫၥံၪအ ဖၫ့ခိၪလီၫ.",
			"8": "<sup>8</sup> တၭစစီလူၫ အၥုၭမုအခိၪ စနၧၫအဖိၪခွၫစအၭဘ နၧၫမၩန့စစီလူၫအဖိၪခွၫ စအံၭၡဘိၡ့ၭတၭ, ဂဲၫဆိၬ",
			"9": "<sup>9</sup> ဝ့ၫလၧမၫဟနၫအံၫ့နီၪလီၫ.- တၭအီၪက့ၪဝ့ၫလၧစဎွၩ လၧဂံလအၭအဖၫ့ခိၪ, ဒဲလၧၦအၭရှုၫဖိၪ အဖၫ့ခိၪ,ဒဲ လၧယ့ၭစရ့လၭအဖၫ့ခိၪ, ဒဲလၧအံဖြံၫ့အဖၫ့ခိၪဒဲလၧ ဘံၪ့ယမံၫ့အဖၫ့ခိၪ, ဒဲလၧအံၫစရ့လၭထီးအလူၬအဖၫ့",
			"10": "<sup>10</sup> ခိၪလီၫ.- တၭစစီလူၫအဖိၪခွၫစအံၭၡဘိၡ့ၭလၧအကဲၪ ၥၫ့အံၫစရ့လၭအစဎွၩနီၪ အၥၭအီၪအနံၪ့လံဆံၫတၭ ကဲၪစဎွၩနံၫနံၪ့လီၫ. အ့ၪမွဲယုဒၫအၡၩဂံၪ့ဖိၪ ဖိၬစဒၫ",
			"11": "<sup>11</sup> ဝံၭအခဲၫ့လီၫ.- တၭမုနံၩလဖၪ လၧစဒၫဝံၭကဲၪစဎွၩ လၧဟံဘြၧၫ့အဖၧၩ့ လၧယုဒၫအဂံၪ့ဖိၪအဖၫ့ခိၪနီၪမွဲ နွ့ၫနံၪ့ဒဲလၩဎူၫဘံၪ့လီၫ.",
			"12": "<sup>12</sup> တၭစနၧၫအဖိၪခွၫစအၭဘနၧၫ, ဒဲစစီလူၫအဖိၪခွၫ စအံၭၡဘိၡ့ၭအခ့ၫအၡၩၥံၪ စဲၪ့ထၪ့ခွံၬ လၧမၫဟနၫ",
			"13": "<sup>13</sup> အံၫ့နီၪထီၩ့လၧဂံဘအၧၫ့လီၫ.- စဇ့ၫရုၫအဲအၫ အဖိၪ ခွၫစယိအၭဒဲစဒၫဝံၭအခ့ၫအၡၩလဖၪ စဲၪ့ထၪ့တၭဘၪ ခီၩ့လိၬအၥၭလၧကမၫဂံဘအၧၫ့အနဲၩ့တၭ, ဆၧၫ့နၩ့ ဝ့ၫ,ၦလဒီၪ့လၧကမၫအလခီၫ, ဒဲအလဒီၪ့နီၪလၧကမၫ",
			"14": "<sup>14</sup> လခီၫဒၪလီၫ.- စအၭဘနၧၫစံၭစယိအၭ, မွဲၦဖိၪၥၪခွၫ ဂဲထုၪ့တၭ, ကွ့ၩလၧပမ့ၬယၫဘီၪ. တၭစယိအၭစံၭဝ့ၫ",
			"15": "<sup>15</sup> ဒၪ,မွဲအဂဲထုၪ့ဒၪဝ့ၫဘီၪ.- ထီးနီၪလဖၧၫ့ဂဲထုၪ့တၭခၫ့ ဂၬဝ့ၫဘဲၫဆၧဝံထၪ့နၬထၪ့အၥိၭ, ၦဘံၪ့ယမံၫ့ဖိၪလၧ အဘၪဆဲၫ့ စစီလူၫအဖိၪခွၫ စအံၭၡဘိၡ့ၭလဆံၫနံၫ",
			"16": "<sup>16</sup> ဂၩ,ဒဲစဒၫဝံၭအခ့ၫအၡၩ လဆံၫနံၫဂၩလီၫ. တၭအ ဝ့ၫၥံၪဖီၪ့န့လဂၩ အဆီၫဒၪဝ့ၫ အခိၪဎွံၪဆုၬဆုၬတၭ, ဆ့ၭအနၭလၧအဆီၫဒၪဝ့ၫအဂုၬဖၩတၭ, အဝ့ၫၥံၪလၩ့ ထံၩဖါဝ့ၫလစီၪ့ဎးလီၫ. တၭဆၧလၧအလးနီၪၦကိၭ ဝ့ၫလၧဟ့လကၭဟၭဇရံၫ့ လၧအအီၪဝ့ၫလၧဂံဘအၧၫ့",
			"17": "<sup>17</sup> အဖၧၩ့လီၫ.- ဆၧဒုၭၥုၭဆီၪ့ဆီၪ့လ့ၬ လၧမုလနံၩနီၪ တၭ,စအၭဘနၧၫ ဒဲအံၫစရ့လၭအၡၩစၪဝ့ၫလၧစဒၫ ဝံၭအခ့ၫအၡၩအမ့ၬယၫလီၫ.",
			"18": "<sup>18</sup> တၭနးဇ့ၭရုၫအဲအၫ အဖိၪခွၫစယိအၭ, ဒဲစအၭဘ ၡဲၫ,ဒဲစအၫစဟ့လၭၥၧၫ့ဂၩအီၪထီးနီၪလီၫ. တၭစအၫ စဟ့လၭနီၪ မွဲၦလၧအခၪ့ဎွံၫ ဘဲၫခ့ၫဘၩ့မံၩ့အခၪ့အ ၥိၭနီၪလီၫ.",
			"19": "<sup>19</sup> တၭစအၫစဟ့လၭနီၪ လီၩ့ဆီးစအၭဘနၧၫတၭ, လ့ၩဆၧလၧအလီၩ့စအၭဘနၧၫ အဘိၩ့ဘၭနီၪလၧစူၪ ထွ့ၪမွဲဂ့ၩ, စူၪစ့ၪမွဲဂ့ၩ, ကၠၪအၥၭအ့ၬ.",
			"20": "<sup>20</sup> စအၭဘနၧၫယိထဲၩ့အလးခဲၫ့တၭ, စံၭဝ့ၫဒၪ, နမွဲ စအၫစဟ့လၭနီၪဧၪ, တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယၧၩလီၫ.",
			"21": "<sup>21</sup> စအၭဘနၧၫစံၭဝ့ၫ, လၧနစူၪထွ့ၪမွဲဂ့ၩ, လၧနစူၪစ့ၪမွဲ ဂ့ၩ,ကၠၪနၥၭတၭ, ဖီၪ့န့ၦဖိၪၥၪခွၫလဂၩဂၩတၭ, မၩ န့အစူၪဝဲၩဆံၭ, မွဲလါနၫ့ စအၫစဟ့လၭလီၩ့ဖိၬအခဲၫ့",
			"22": "<sup>22</sup> နီၪကၠၪအၥၭအ့ၬ.- တၭစအၭဘနၧၫစံၭဒီၭစအၫစဟ့ လၭနီၪ,ကၠၪခွံၬနၥၭလၧနဖိၬယခဲၫ့ဆံၭ, ယမိဘၪဖ့ၬ ထံၩဖါလၩ့နၧၩလၧဂၪ့ခိၪနီၪ, မွဲဘၪလဲၪ. အ့ၪမွဲဘဲၫနီၪ တၭ,ယမိထိးယိယမ့ၬလၧနထၧၫ့ဖုဝဲ စယိအၭဘဲၫၥ့ၪ",
			"23": "<sup>23</sup> လဲၪ.- အ့ၪမွဲလကၠၪခွံၬဘၪအၥၭနီၪတၭ, စအၭဘနၧၫ ဆ့ၭဝ့ၫလၧဖၩ့ဘီၩ့အထိၭနၫ လၧအဂူၭဖိၫ့ ထီးဖၩ့ဖျီၫ့ ထၪ့လၧအချိၫ့ခိၪတၭ, လၩ့ထံၩဖါဝ့ၫထီးနီၪတၭ, ၥံၫ ဝ့ၫထီးအလး လစီၪ့နီၪလီၫ. တၭထီးဒၪ ၦလၧအဂဲၫ လၧအလးထီးစအၫစဟ့လၭ လၩ့ထံၩဖါၥံၫဝ့ၫနီၪ,ဆၧ",
			"24": "<sup>24</sup> မၩအၥၭလၧအအီၪပထုၬဝ့ၫလီၫ.- စယိအၭဒဲစအၭ ဘၡဲၫလီၩ့ဆီးစအၭဘနၧၫဆ့တၭ, ထီးအထီၩ့လၧဆၧ စီၩ့ခိၪအၫမၫလၧအအီၪဝ့ၫ လၧဂဲအၫ အမ့ၬယၫလၧ ၡါမုနၧၫ့ဖၫ ဂံဘအၧၫ့အဖၧၩ့ၥၭနီၪတၭ, မုလၩ့နုၬဝ့ၫ လီၫ.",
			"25": "<sup>25</sup> ၦဘံၪ့ယမံၫ့ဖိၪအီၪကိၩ့အီၪကီၪ့ လၧစအၭဘနၧၫ အလးခဲၫ့တၭ, ကဲၪထၪ့ၥုၭလဒီၪ့တၭ, ဆၧၫ့ထုၪ့လၧ",
			"26": "<sup>26</sup> ဆၧစီၩ့ခိၪအဒၩ့ခိၪလီၫ.- ထီးနီၪလဖၧၫ့စအၭဘနၧၫကိၭ ထၪ့လၧစယိအၭတၭ, စံၭဝ့ၫဒၪ,နၭၥံၪဖၩ့ၥံၪမိဘၪအၪ့ ဆၧလထံၪဎးလဘီၩ့ဎးဆ့ဧၪ, လၧခဲၫ့ထုၬနီၪ မိကဲၪ ထၪ့ဆၧခိဆၧဝီၩ နၥ့ၪယၫအ့ၬဧၪ. အခိးမွဲနမိမၪလူၬ ၦခမျၧးဘဲၫၥိၭအမိဂဲၫထဲၩ့ထဲၩ့ လၧအလီၩ့ဖိၬအထၧၫ့",
			"27": "<sup>27</sup> ဖုဝဲအခဲၫ့နီၪဆံၭယံၬခိၬလဲၪ.- စယိအၭစံၭဝ့ၫဒၪ,ယွၩ မၧၫ့ဝ့ၫ,နအ့ၪလချဲၩ့ထၪ့ဘၪဆၧတၭ, မွဲတၡါလၧဂီၩ လခီၫနီၪ,ၦခမျၧးထဲၩ့ထဲၩ့ယူၭ လၧအလီၩ့ဖိၬအထၧၫ့",
			"28": "<sup>28</sup> ဖုဝဲအခဲၫ့ကိၭဂၩဒ့ၭလီၫ.- အခိးမွဲ စယိအၭ အူၪခွ့ၩ တၭ,ၦခမျၧးအီၪထီတၭ, လီၩ့ဆီးလၧၩ့အံၫစရ့လၭ အ့ၬ, ဒုၭလၧၩ့ၥုၭဆ့အ့ၬ.",
			"29": "<sup>29</sup> တၭစအၭဘနၧၫ, ဒဲအၡၩၥံၪလ့ၩဆၧၥၫ့နၩချီၩ့လၧ ဆၧပျၩ့ဖၧၩ့နီၪတၭ, ခၫ့ဂၬယီၫဒၫ့, ဒဲလ့ၩခၫ့ဂၬဘံၭၥၧၫ့",
			"30": "<sup>30</sup> တၭ,လ့ၩထီၩ့လၧမၫဟနၫအံၫ့နီၪလီၫ.- တၭစယိအၭ ဂဲၫထဲၩ့ထဲၩ့လၧအလီၩ့ဖိၬ စအၭဘနၧၫအခဲၫ့, ထီးအ ဒုၭအီၪကီၪ့ၦခမျၧးထီးအလူၬနီၪတၭ, စဒၫဝံၭအခ့ၫအ",
			"31": "<sup>31</sup> ၡၩလဆံၫခွံၫဂၩ, ဒဲစအၫစဟ့လၭအီၪအ့ၬ.- အ့ၪမွဲစဒၫ ဝံၭအခ့ၫအၡၩဖ့ၬခွံၬယူၭ ၦလၧဘံၪ့ယမံၫ့, ဒဲစအၭဘ",
			"32": "<sup>32</sup> နၧၫအၡၩတၭ, ၦၥၧၫ့ယၩဎူၫဆံၫၥံၫဝ့ၫလီၫ.- အဝ့ၫၥံၪ မၩန့ထၪ့စအၫစဟ့လၭတၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧ အဖါအၥွၪခိၪဖၧၩ့ လၧအအီၪဝ့ၫလၧဘ့ၭၥလံဟံၫ့အ ဖၧၩ့နီၪလီၫ. တၭစယိအၭ ဒဲအၡၩၥံၪလ့ၩဆၧၥၫ့နၩ ချီၩ့တၭ,ထီၩ့ဝ့ၫလၧဟံဘြၧၫ့လၧမုဆဲၪ့ထၪ့နီၪလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> တၭဆၧဒုၭလိၬအၥၭလၧ စစီလူၫအၡၩဂံၪ့ဖိၪ, ဒဲ စဒၫဝံၭအၡၩဂံၪ့ဖိၪ အီၪဝ့ၫယံၬမၬလီၫ. တၭစဒၫဝံၭဆီၪ့ ထၪ့ဒံၩ့ယံၬဒံၩ့ဆီၪ့ထၪ့, အ့ၪမွဲစစီလူၫအၡၩဂံၪ့ဖိၪလၩ့ ဆါဒံၩ့ယံၬဒံၩ့လၩ့ဆါဝ့ၫလီၫ.",
			"2": "<sup>2</sup> တၭစဒၫဝံၭထၪ့ဖိၪအဖိၪခွၫၥံၪ လၧဟံဘြၧၫ့အဖၧၩ့ လီၫ. အဖိၪဝဲၡါအမံၩ့မွဲ စအၫမနၧၫ့, ၦယ့ၭစရ့လၭ",
			"3": "<sup>3</sup> ဖိၪနးအဟံၫ့နိၫအၫ့အဖိၪလီၫ.-တၭနံၫဂၩလဂၩနီၪမွဲစ ခံလအၭ, ၦကၫမလ့ၭဖိၪ စနၫဘလၭအမၫနးအၭ ဘဂၫလၭအဖိၪလီၫ. တၭၥၧၫ့ဂၩလဂၩနီၪမွဲစအၭဘစလၧၫ့, ဂ့ၭၡၧၫအစဎွၩစတၫလမ့ၫအဖိၪမုၪ နးမၫအခၫအဖိၪ",
			"4": "<sup>4</sup> ခွၫလီၫ.- တၭလံဂၩလဂၩ နီၪမွဲစအၭဒနဲၫယၫ, နးဟၭ ဂံၭအဖိၪခွၫလီၫ. တၭယဲဂၩလဂၩနီၪမွဲစၡ့ၭဖတဲအၫ,",
			"5": "<sup>5</sup> နးအဘဲတလၭအဖိၪခွၫလီၫ.- တၭဎူၫဂၩလဂၩနီၪ စအံၭၥြံၫအၫ့စဒၫဝံၭအမၫ နးအ့ၭလၫအဖိၪလီၫ. တၭစဒၫဝံၭထၪ့ဖိၪအဝ့ၫၥံၪနီၪ လၧဟံဘြၧၫ့အဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> တၭလၧစစီလူၫအၡၩဂံၪ့ဖိၪ ဒဲစဒၫဝံၭအၡၩဂံၪ့ဖိၪ ဒုၭလိၬအၥၭအဘိၩ့ဘၭနီၪ, ဆၧမၩအၥၭ လၧစအၭ ဘနၧၫ,အီၪက့ၪဆီၪ့အၥၭလၧစစီလူၫအဂံၪ့အဂးလီၫ.",
			"7": "<sup>7</sup> တၭစစီလူၫအၥံၪမၫအီၪလဂၩ စအဲယၫအဖိၪမုၪတၭ, အမံၩ့မွဲနးရံၭဇဖၫလီၫ. တၭစအံၭၡဘိၡ့ၭ စံၭစအၭ ဘနၧၫ,နလ့ၩနုၬလၧ ယဖါအၥံၪမၫလဂၩအအီၪနီၪ,မွဲ",
			"8": "<sup>8</sup> ဘၪလဲၪ.- ထီးနီၪလဖၧၫ့ စအၭဘနၧၫအၥၭထၪ့ဒိၪမၬ လၧစအံၭၡဘိၡ့ၭအဆၧချဲၩ့အကၠီၩ့တၭ, စံၭဝ့ၫဒၪ, ယဝ့ၫဒၪယီၩၦလၧအထၫ့ဒၩယုဒၫတၭ, မၩဆၧအခိး အတၩလၧနဖါစစီလူၫအၡၩဂံၪ့ဖိၪ, ဒဲအထၧၫ့ဖုဝဲ,ဒဲ အထံၩအၥိၭ လၧမုဆၫလနံၩယီၩတၭ, လဖ့ၪလၫ့ခွံၬ ဘၪနၧၩလၧစဒၫဝံၭအစူၪဖၧၩ့နီၪ, ယမွဲထွံၪအခိၪဎွံၪ တၭ,နအီၪက့ၪဆၧမၪလၧယလီၩ့, လၧၦမုၪယီၩအဂဲး",
			"9": "<sup>9</sup> အကၠီၪ့လၧမုဆၫလနံၩယီၩဧၪ.- ယအ့ၪလမၩဘၪ စဒၫဝံၭဘဲၫယဟိဝၩဆိၪလၩ့အၥၭလၧအဝ့ၫအၥိၭတၭ, မွဲယွၩမၩစအၭဘနၧၫ ဘဲၫနီၪအၥိၭ,ဒဲအၪနဲၪ့အနီၪ",
			"10": "<sup>10</sup> ဆံၭ.- မိၥုၭခွံၬဘၩ့ၥံၪမုးၥံၪ လၧစစီလူၫအၡၩဂံၪ့ဖိၪ တၭ,မိအီၪက့ၪထၪ့စဒၫဝံၭအလးဆီၩ့ဆီ လၧအံၫစရ့ လၭအဖၫ့ခိၪ, ဒဲလၧယုဒၫအဖၫ့ခိၪ, လၧဒၫ့ဖိးလၧဘံ",
			"11": "<sup>11</sup> အၧၫၡံဘၫလီၫ.- မွဲစအံၭၡဘိၡ့ၭၥၭမဲၪ စအၭဘနၧၫ, အကၠီၩ့တၭ, ချဲၩ့ဆၧၫ့ဝ့ၫလၧဆၧချဲၩ့ၥ့ၪနးထံၪအ့ၬ.",
			"12": "<sup>12</sup> စအၭဘနၧၫ့အၪ့မၧၫ့ အၥီၫ့ၥံၪလ့ၩ လၧစဒၫဝံၭအ အီၪလၧအဂးတၭ, စံၭဝ့ၫဒၪ, ထံၫၥံၪခးၥံၪနီၪ, မွဲအမွဲပ လၫအဆၧလဲၪ,တၭစံၭ, အုၩ့လၩ့ဆၧလၧယၧၩတၭ, ယိခွါ,ယစူၪမိအီၪလၧနၥိၭ, ဘဲၫၥိၭအံၫစရ့လၭထီးအ",
			"13": "<sup>13</sup> လူၬမိဂဲၫလၧနအီၪလီၫ.- တၭစဒၫဝံၭစံၭဝ့ၫ, ဂ့ၩယူၭ, ယမိအုၩ့လၩ့ဆၧလၧနၧၩလီၫ. မွဲလါနၫ့ယမိအၪ့ကံၩ့ ဆၧလၧနၧၩလမံၩ့, ဘဲၫၦစံၭဆၧအၥိၭ, ထီးနဂဲၫဒၪဘၪ ယမ့ၬတၭ, နအ့ၪလဂဲၫဆိၬဘၪစစီလူၫအဖိၪမုၪနးမဲခၫ",
			"14": "<sup>14</sup> လၭတၭ, နမိဒၪဘၪယမ့ၬအ့ၬ.- စဒၫဝံၭအၪ့မၧၫ့အၥီၫ့ ၥံၪလၧစစီလူၫအဖိၪခွၫ စအံၭၡဘိၡ့ၭအအီၪတၭ, စံၭ ဝ့ၫဒၪ,ဖ့ၪလၫ့ယမၫနးမဲခၫလၭ လၧယန့ဘၪဝ့ၫလၧၦဖ",
			"15": "<sup>15</sup> လံၡၫဖိၪအဆၧခိၪဖံၭ လယၩအဂးနီၪဆံၭ.- တၭစ အံၭၡဘိၡ့ၭအၪ့မၧၫ့လၩ့ဆၧ, ဒဲမၩန့ခွံၬဝ့ၫလၧအဝၩ",
			"16": "<sup>16</sup> စလၫအံၭအဖိၪခွၫ စဖၫလတအ့လၭနီၪလီၫ.- အဝၩ လ့ၩဖိၬအခဲၫ့တၭ, ဂၪ့ဝ့ၫလၧအလးခဲၫ့နီၪထီၩ့ လၧဘ ဟုရံၫ့လီၫ. စအၭဘနၧၫစံၭဝ့ၫ, စဲၪ့, ထဲၩ့ထဲၩ့ဘီၪး တၭ အဝ့ၫဒၪထဲၩ့ထဲၩ့ဝ့ၫလီၫ.",
			"17": "<sup>17</sup> စအၭဘနၧၫချဲၩ့ဆၧလၧၦအံၫစရ့လၭ အၡၩၥုၪ့က့ၭ ၥၭၡါလဖၪတၭ,စံၭဝ့ၫဒၪ, လၧထံၭလၧမီခိၬနၥံၪအၪ့ ဎၬအီၪက့ၪစဒၫဝံၭ လၧစဎွၩလၧနၥံၪအဖၫ့ခိၪလီၫ.",
			"18": "<sup>18</sup> တၭဘိၩ့နဲၪ့ယီၩမၩဘီၪ, အဂဲးဘဲၫယီၩ ယဟိဝၩချဲၩ့ ဆၧလၧစဒၫဝံၭအဂဲးအကၠီၪ့တၭ, စံၭဝ့ၫဒၪ,လၧယၡၩ စဒၫဝံၭအကၠီၩ့ယမိမၩဖီၩ့မၩဖျ့ၭ ယၡၩခမျၧးအံၫစရ့ လၭလၧၦဖလံၡၫဖိၪအစူၪဖၧၩ့, ဒဲလၧအဒုၪအဒၩထီး",
			"19": "<sup>19</sup> အလူၬအစူၪဖၧၩ့လီၫ.- တၭစအၭဘနၧၫ ချဲၩ့ဆၧလၧ ဘံၪ့ယမံၫ့အနါဖၧၩ့ဆ့တၭ, စအၭဘနၧၫလ့ၩချဲၩ့ဆၧ လၧစဒၫဝံၭအနါဖၧၩ့ဆ့ လၧဟံဘြၧၫ့အဖၧၩ့လၧကယဲ ဆၧအဂ့ၩလၧအံၫစရ့လၭအမ့ၬယၫ, ဒဲလၧကယဲဆၧ အဂ့ၩလၧဘံၪ့ယမံၫ့အဂံၪ့ ထၧၫ့ဖျိၪ့ယၫ အမ့ၬယၫ",
			"20": "<sup>20</sup> လီၫ.- အခိးမွဲစအၭဘနၧၫ ဂဲၫလၧစဒၫဝံၭအအီၪလၧ ဟံဘြၧၫ့အဖၧၩ့တၭ, ၦၡၩအီၪလၧအၥိၭနံၫဆံၫလီၫ. တၭစဒၫဝံၭ, မၩဆၧအၪ့ဆၧအီၩလၧစအၭဘနၧၫ, ဒဲ",
			"21": "<sup>21</sup> လၧၦၡၩအီၪလၧအၥိၭလဖၪအဂးလီၫ.- စအၭဘနၧၫ စံၭစဒၫဝံၭ, ယမိဂဲထုၪ့လ့ၩဆၧတၭ, ဒုၭအီၪကိၩ့အီၪ ကီၪ့အံၫစရ့လၭ ထီးအလူၬလၧစဎွၩ ကဆါအအီၪ, ဘဲၫၥိၭအမိအုၩ့လၩ့ဆၧလၧနၧၩ, ဒဲဘဲၫၥိၭနမိပၧၩ့က ယဲဆၧလၧအဘၪနၥၭ လၧဆၧထီးအလူၬလီၫ. တၭစ ဒၫဝံၭဖျါခွံၬ စအၭဘနၧၫတၭ, အဝ့ၫဒၪလ့ၩဝ့ၫမုၬမုၬ လီၫ.",
			"22": "<sup>22</sup> တၭယိခွါ,စဒၫဝံၭအခ့ၫအၡၩ, စယိအၭဂဲၫထဲၩ့ လၧၥုၭလဒီၪ့အအီၪတၭ, ဂဲၫထဲၩ့ဆိၬဆၧအၪ့ဂူၬန့ဝ့ၫ အၪအၪလ့ၬလီၫ. တၭစအၭဘနၧၫအီၪလၧစဒၫဝံၭအၥိၭ လၧဟံဘြၧၫ့အဖၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩ ဆၧဖျါခွံၬ",
			"23": "<sup>23</sup> ယူၭအဝ့ၫဒၪတၭ, စဲၪ့ထၪ့ခွံၬယူၭမုၬမုၬယူၭ.- စယိအၭ ဒဲအၥုၭမုထီးအလူၬ လၧအအီၪလၧအစူၪဖၧၩ့နီၪဂဲၫ ဝ့ၫတၭ,ၦလီၩဘၪစယိအၭတၭ, စံၭဝ့ၫဒၪ, စနၧၫအဖိၪ ခွၫစအၭဘနၧၫဂဲၫလၧစဎွၩအအီၪတၭ, အဝ့ၫဒၪဖျါခွံၬ",
			"24": "<sup>24</sup> အဝ့ၫတၭ, မွဲအထဲၩ့ယူၭမုၬမုၬယူၭ.- ထီးနီၪလဖၧၫ့ စယိအၭဂဲၫလၧစဎွၩအအီၪတၭ, စံၭဝ့ၫဒၪ, နမၩဆၧနီၪ လမံၩ့လဲၪး ယိခွါ,စအၭဘနၧၫဂဲၫလၧနအီၪတၭ, နဖျါ",
			"25": "<sup>25</sup> ခွံၬအဝ့ၫတၭ, စဲၪ့ထၪ့ခွံၬယူၭနီၪ, မွဲဘၪလဲၪ.- နၥ့ၪယၫ စနၧၫအဖိၪခွၫ စအၭဘနၧၫ, လၧအဂဲၫအၪ့လီၫန့နၧၩ, ဘဲၫၥိၭအမိၥ့ၪယၫနလ့ၩထၪ့ ဒဲနဂဲၫနုၬဘဲၫၥိၭအမိၥ့ၪ ယၫကယဲဆၧလၧနမၩဆၧထီးအလူၬလီၫ.",
			"26": "<sup>26</sup> ထီးစယိအၭစဲၪ့ထၪ့ခွံၬလၧစဒၫဝံၭအအီၪတၭ, အၪ့ မၧၫ့အၥီၫ့ၥံၪလ့ၩဆီးစအၭဘနၧၫနီၪ, ဒဲၥိၫ့ခွံၬဒီၭအဝ့ၫ လၧထံၫဖၧၩ့စဲရၫလီၫ. အ့ၪမွဲစဒၫဝံၭ ၥ့ၪယၫဝ့ၫအ့ၬ.",
			"27": "<sup>27</sup> ထီးစအၭဘနၧၫဂဲၫထဲၩ့ထီၩ့ လၧဟံဘြၧၫ့နီၪတၭ, စ ယိအၭကိၭန့ဝ့ၫလၧဆၧနဲၩ့ထံၭ လၧတရၫ့နဲၩ့ဘဲၫၥိၭ အမိချဲၩ့ဆၧလၧအဝ့ၫလၧဆၧကဒုၩတၭ, ဆ့ၭဝ့ၫလၧ အဂူၭဖိၫ့နီၪတၭ, ၥံၫဝ့ၫလၧစယိအၭ အထၧၫ့ဖုဝဲစအၫစ ဟ့လၭအၥွံၪအကၠီၩ့လီၫ.",
			"28": "<sup>28</sup> လၧခဲၫ့ထဲၩ့ထီးစဒၫဝံၭနါဂၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ,ယ ဝ့ၫဒၪယီၩ, ဒဲယဘၩ့ယမုးဖီၩ့ဖျ့ၭလၧ စနၧၫအဖိၪခွၫစ အၭဘနၧၫအၥွံၪလၧ ယဟိဝၩအမ့ၬယၫလၩ့ဆိၩလၩ့",
			"29": "<sup>29</sup> ကၠၪလီၫ.- မွဲအအီၪလၧစယိအၭအခိၪ, ဒဲလၧအဖါအ ၡၩဂံၪ့ဖိၪထီးအလူၬ အခိၪအလီၩ့ဆံၭ. တၭၦလၧအ အီၪလၧအၥွံၪထၪ့မွဲဂ့ၩ, ၦလၧအခံၫထူၭ ဆၫအၧၩ့မွဲ ဂ့ၩ,ၦလၧအဒိၭနဲၩ့အၥၭ လၧအနိၪထိၭမွဲဂ့ၩ, ၦလၧ အလၩ့ထံၩဖါလၧနၭအဖၫ့ခိၪမွဲဂ့ၩ, ၦလၧအမိန့ဘၪအ ၥၭလၧကိၪမွဲဂ့ၩ, မွဲအထီးလၩ့ထူၬခွံၬ လၧစယိအၭအ",
			"30": "<sup>30</sup> ဂံၪ့ဖၧၩ့လဂ့ၩ.- စယိအၭဒဲအထၧၫ့ဖုဝဲစအၭဘၡဲၫမၩ ၥံၫစအၭဘနၧၫ, မွဲလၧအဝ့ၫဒၪမၩၥံၫယူၭ အဝ့ၫၥံၪအ ထၧၫ့ဖုဝဲစအၫစဟ့လၭလၧဂံဘအၧၫ့, လၧဆၧဒုၭၥုၭ အဖၧၩ့အကၠီၩ့နီၪလီၫ.",
			"31": "<sup>31</sup> တၭစဒၫဝံၭစံၭစယိအၭ, ဒဲၦခမျၧးထီးအလူၬလၧ အအီၪလၧအစူၪဖၧၩ့, ၡၫ့နၥံၪအကီၩ့အၥိၭတၭ, ခဲးထူၬ နၥံၪအၥၭလၧရၧၬဆၧကဲၩ့ယၬတၭ, ဂၪ့လၧစအၭဘ နၧၫအဂးနီၪဆံၭ, စဒၫဝံၭအနၫ့ဆါဒၪဝ့ၫ လ့ၩၥိၫ့လၧ",
			"32": "<sup>32</sup> အၥွၪခိၪလီၫ.- အဝ့ၫၥံၪခုၪ့လၩ့ဘၧၩ့ခွံၬ စအၭဘနၧၫ လၧဟံဘြၧၫ့အဖၧၩ့တၭ, စဎွၩကိၭၡၭထၪ့အလူတၭ, ဂၪ့ဝ့ၫထီးစအၭဘနၧၫအၥွၪခိၪနဲၩ့တၭ, ၦခမျၧးထီးအ",
			"33": "<sup>33</sup> လူၬဂၪ့ဝ့ၫလီၫ.- တၭစဎွၩဂၪ့ဆၧယၧၩ့ဆၧလၧစအၭ ဘနၧၫအနဲၩ့ထံၭတၭ, စံၭဝ့ၫဒၪ, စအၭဘနၧၫၥံၫဝ့ၫဘဲၫ",
			"34": "<sup>34</sup> ၦအၧၩ့ဖိၪၥံၫဝ့ၫအၥိၭနီၪဆ့ဧၪ.- နစူၪဘၪစၧၩ့ထၬအ ၥၭအ့ၬ.နခၪ့အီၪလၧၥိၭထၬ အဖၧၩ့အ့ၬ. ဘဲၫၦလၩ့ ထံၩဖါလၧၦအၧၩ့အမ့ၬယၫအၥိၭနီၪ, နလၩ့ထံၩဖါန ဝ့ၫလီၫ. တၭၦခမျၧးဂၪ့ဝ့ၫလၧအကၠီၩ့ကိၭဂၩဒ့ၭလီၫ.",
			"35": "<sup>35</sup> လၧအမွဲဒံၭမုဆၫလခီၫအဘိၩ့ဘၭနီၪ, ၦထီးအလူၬ ဂဲၫအၪ့မၧၫ့စဒၫဝံၭအၪ့ဆၧလီၫ. တၭစဒၫဝံၭဆိၪလၩ့ အၥၭတၭ,စံၭဝ့ၫဒၪ, မုလချႃၭလၩ့နုၬဒံၭဘၪတၭ, ကိၪ မွဲဂ့ၩ,ဆၧအၪ့ဂူၫဂၩမွဲဂ့ၩ, ယအ့ၪထဲးယိတၭ,မွဲယွၩ",
			"36": "<sup>36</sup> မၩယၧၩဘဲၫနီၪ ဒဲအၪနဲၪ့အနီၪဆံၭ.- တၭၦခမျၧးထီး အလူၬ,ထီးနဲၪ့ဝ့ၫဒဲဂ့ၩဝ့ၫ လၧအဝ့ၫၥံၪအမ့ၬယၫဘဲၫ ကယဲဆၧလၧစဎွၩမၩဝ့ၫလမံၩ့လါလါနီၪ, ဂ့ၩလၧၦခ မျၧးထီးအလူၬလဖၪအမ့ၬယၫလီၫ.",
			"37": "<sup>37</sup> တၭၦခမျၧးထီးအလူၬ, ဒဲအံၫစရ့လၭထီးအလူၬၥ့ၪ ယၫဝ့ၫလၧမုလနံၩနီၪ လၧဆၧမၩၥံၫစနၧၫအဖိၪခွၫ စအၭဘနၧၫနီၪ ဂဲၫဝ့ၫဒၪလၧစဎွၩအ့ၬ.",
			"38": "<sup>38</sup> တၭစဎွၩစံၭအခ့ၫအၡၩလဖၪ, ၦအခိၪဒဲၦအဒိၪလ ဂၩလၩ့ထံၩဖါဝ့ၫ လၧအံၫစရ့လၭအဖၧၩ့ လၧမုဆၫလ",
			"39": "<sup>39</sup> နံၩယီၩ,မွဲနၥံၪၥ့ၪယၫအ့ၬဧၪ.- ယကဲၪစဎွၩလၧဆၧဂုၪဝ့ၫ လါနၫ့တၭ, ယဂဲးဆါယဘၭဆါလၧမုဆၫလနံၩယီၩ တၭ,ၦလဖၪယီၩ, နးဇ့ၫရုၫအဲအၫအဖိၪခွၫလဖၪဆီၪ့ နဲၪ့ယၧၩဒံၭလီၫ. ယဟိဝၩမိဖ့ၪကၪၦမၩဆၧအၧၩ့ဘဲၫ အဆၧအၧၩ့ဆၧၥၫ့အၥိၭနီၪလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ထီးစစီလူၫအဖိၪခွၫနါဂၧၫ့ဝ့ၫ လၧစအၭဘနၧၫၥံၫဝ့ၫ လၧဟံဘြၧၫ့အဖၧၩ့တၭ, အစူၪလၩ့ဆါဝ့ၫတၭ, ၦအံၫ",
			"2": "<sup>2</sup> စရ့လၭဖိၪထီးအလူၬအၥုၪ့ခိအၥၭဝီၩလီၫ.- တၭစစီ လူၫအဖိၪခွၫအီၪလၧၦၡၩနံၫဂၩ လၧအမွဲၦအဒီၪ့လဖၪ အခိၪ, လဂၩအမံၩ့မွဲစဘၫအနၫတၭ, အဝ့ၫလဂၩအ မံၩ့မွဲစရ့ခၭ, စရံမၧၫ့အဖိၪခွၫလဖၪ ၦဘအံရီၭဖိၪ,လၧ",
			"3": "<sup>3</sup> ဘံၪ့ယမံၫ့အဒီၪ့ဖိၪအကျၩလီၫ.- (အဂဲးဘဲၫယီၩ ၦဝံ ထၪ့ဘအံရီၭလၧဘံၪ့ယမံၫ့အဂးဆ့လီၫ. တၭၦဘအံ ရီၭဖိၪစဲၪ့ဖျိၭဝ့ၫလၧဂံၭတံၫ့တၭ, ကဲၪထၪ့ၦမွံၩထီးနီၪ ခီးမုဆၫလနံၩယီၩလီၫ.)",
			"4": "<sup>4</sup> တၭစစီလူၫအဖိၪခွၫ, စစၪ့နၥၧၫ့အဖိၪခွၫ လၧအခၪ့ ဂၭဂီၩ့အီၪဝ့ၫလဂၩလီၫ. လၧအၥၭအီၪယဲနံၪ့အခၫ နီၪ,ဆၧပရၧၫ့ဂဲၫလၧယ့ၭစရ့လၭ လၧစစီလူၫဒဲစစၪ့န ၥၧၫ့အဂဲးတၭၦယိဖိၪၥၪနီၪ မၩန့အဝ့ၫဒၪတၭ, စဲၪ့ဖျိၭ ဝ့ၫးလၧၦမုၪစဲၪ့ဝ့ၫချဲၫ့ချဲၫ့အဘိၩ့ဘၭနီၪ, ဆၧမၩအ ၥၭလၧအဝ့ၫဒၪလၩ့ထံၩဖါဝ့ၫတၭ, အခၪ့ဂၭဂီၩ့ဝ့ၫ လီၫ.တၭအမံၩ့မွဲစမံၫဖံၭဘၡ့ၭလီၫ.",
			"5": "<sup>5</sup> တၭၦဘအံရီၭဖိၪစရံမၧၫ့အဖိၪခွၫ စရ့ခၭဒဲစဘၫအ နၫလ့ၩဝ့ၫတၭ, လၧဆၧခိထၪ့အထီနီၪ ဂဲၫထီၩ့ဝ့ၫလၧ စအံၭၡဘိၡ့ၭအဂံၪ့လၧအမံၫနၩ့အီၪ လၧလးမံၫခိၪလၧ",
			"6": "<sup>6</sup> မုထုၪ့နီၪလီၫ.- အဝ့ၫၥံၪလ့ၩနုၬဝ့ၫထီးနီၪ လၧဂံၪ့အ ၥၭကျၩဘဲၫအမိလ့ၩဆိၬ ဘုၪကၠိၩ့အၥိၭတၭ, ဆ့ၭဝ့ၫ လၧအဂူၭဖိၫ့တၭ, စရ့ခၭ,ဒဲအထၧၫ့ဖုဝဲ, စဘၫအနၫစဲၪ့",
			"7": "<sup>7</sup> ဖီၩ့ဖျ့ၭဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩထီးအဝ့ၫၥံၪနုၬလၧဂံၪ့ ဖၧၩ့နီၪ,အဝ့ၫလဂၩ မံၫနၩ့လၧလးမံၫခိၪလၧအဒူၭဖၧၩ့ နီၪတၭ,အဝ့ၫၥံၪဖ့ၬဝ့ၫနီၪ, မၩၥံၫဝ့ၫတၭ, ဖ့ၬထ့ၬဝ့ၫအ ခိၬတၭ,မၩန့အခိၪဎွံၪနီၪ, စဲၪ့ထၪ့ခွံၬဝ့ၫလ့ၩလၧဆၧ",
			"8": "<sup>8</sup> ပျၩ့ဖၧၩ့ၥၫ့နၩချီၩ့လီၫ.- အဝ့ၫၥံၪဂဲၫဆိၬ စအံၭၡဘိၡ့ၭ အခိၪဎွံၪလၧစဒၫဝံၭအအီၪ လၧဟံဘြၧၫ့အဖၧၩ့တၭ, စံၭစဎွၩ,ယိခွါ, နဒုၪနဒၩစစီလူၫအဖိၪခွၫလၧအအၪ့ ဎၬနၥၭမၧၫ့ စအံၭၡဘိၡ့ၭအခိၪဎွံၪတၭ, မုဆၫလနံၩ ယီၩယဟိဝၩမၩဆၧၫ့ဆၧအၧၩ့ လၧစစီလူၫဒဲအချံၫအ ၥၪလၧစဎွၩယကဆါအဂးလီၫ.",
			"9": "<sup>9</sup> စဒၫဝံၭချဲၩ့ဆၧၫ့ၦဘအံရီၭဖိၪစရံမၧၫ့ အဖိၪခွၫစရ့ ခၭဒဲအထၧၫ့ဖုဝဲစဘၫအနၫတၭ, စံၭအဝ့ၫၥံၪ, ယဟိဝၩ မၧၫ့ဝ့ၫလၧအဎွ့ၩန့ထဲၩ့ယၥၭ လၧကယဲဆၧအၧၩ့အ",
			"10": "<sup>10</sup> ဖၧၩ့နီၪ,- လၧၦလဂၩလီၩဘၪယၧၩတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,စစီလူၫၥံၫယူၭ, ဆီၫ့မီၪ့ဝ့ၫလၧအဂဲၫၥိၫ့ဆၧပရၧၫ့ ဂ့ၩနီၪ,ယဖီၪ့ထၬအဝ့ၫတၭ, မၩၥံၫဝ့ၫလၧဇံၭလၭအ ဖၧၩ့,အဝ့ၫနီၪဆီၫ့မီၪ့ယမိဖ့ၪလၫ့အဝ့ၫ လၧအလံၩ့အ",
			"11": "<sup>11</sup> လဲၫလၧအဆၧပရၧၫ့အဂးလီၫ.- ထီးၦအအၧၩ့မၩၥံၫ ၦအတီၩလၧအဂံၪ့ဒၪဝ့ၫလၧအလးမံၫအဖၧၩ့နီၪတၭ, ယမိမၩနၭနဲၪ့ အနီၪဆံၭအၪလဲၪ. ယမိအၪ့ဎၬအၥွံၪ နီၪလၧနၥံၪအစူၪဖၧၩ့ ဒဲမၩန့ခွံၬနၥံၪ လၧဂၪ့ခိၪချိၫ့မွဲ",
			"12": "<sup>12</sup> အ့ၬဧၪ.- စဒၫဝံၭမၪလူၬၦဖိၪၥၪခွၫလဖၪတၭ, အဝ့ၫ ၥံၪမၩၥံၫဝ့ၫတၭ, ဖ့ၬထ့ၬခွံၬဝ့ၫအစူၪအခၪ့တၭ, ဒုၭ လၩ့ဆဲၩဝ့ၫလၧကမၫ အဖၫ့ခိၪ လၧဟံဘြၧၫ့အဖၧၩ့ လီၫ.အ့ၪမွဲအဝ့ၫၥံၪမၩန့ စအံၭၡဘိၡ့ၭအခိၪဎွံၪတၭ, ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫလၧ စအၭဘနၧၫအၥွၪခိၪဖၧၩ့လၧ ဟံဘြၧၫ့အဖၧၩ့နီၪလီၫ."
		},
		"5": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့အံၫစရ့လၭအဒီၪ့လဖၪ ထီးအလူၬဂဲၫ လၧစဒၫဝံၭအအီၪ, လၧဟံဘြၧၫ့တၭ, ချဲၩ့ဆၧစံၭဝ့ၫ",
			"2": "<sup>2</sup> ဒၪ,ယိခွါ,ပမွဲနဎွံၪဒဲနယၪလီၫ.- လၧထံၭလၧမီခိၬစစီ လူၫကဲၪစဎွၩလၧပဖၫ့ခိၪနီၪ, နမွဲၦလၧအလ့ၩၥိၫ့ထၪ့, ဒဲဂဲၫၥိၫ့နုၬအံၫစရ့လၭတၭ, ယဟိဝၩစံၭနၧၩ,နမိဘၪ ယိထဲၩ့ခွါထဲၩ့ယၡၩခမျၧးအံၫစရ့လၭတၭ, နမိကဲၪ",
			"3": "<sup>3</sup> ထၪ့အံၫစရ့လၭအခိၪလီၫ.- အံၫစရ့လၭအၡၩၥုၪ့က့ၭ ၥၭၡါထီးအလူၬ ဂဲၫလၧစဎွၩအအီၪ လၧဟံဘြၧၫ့အ ဖၧၩ့တၭ, စဎွၩဒၫဝံၭအုၩ့လၩ့ဆၧလၧအဝ့ၫၥံၪလၧဟံ ဘြၧၫ့အဖၧၩ့လၧယဟိဝၩအမ့ၬယၫတၭ, အဝ့ၫၥံၪဂုၪ",
			"4": "<sup>4</sup> စဒၫဝံၭလၧစဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪလီၫ.- လၧ စဒၫဝံၭကဲၪထၪ့ၥၫ့စဎွၩနီၪ အၥၭအီၪအနံၪ့ၥၧၫ့ဆံၫ",
			"5": "<sup>5</sup> တၭ,ကဲၪထၪ့စဎွၩအနံၪ့လံဆံၫလီၫ.- လၧဟံဘြၧၫ့အ ဖၧၩ့အဝ့ၫဒၪကဲၪစဎွၩလၧယုဒၫအဖၫ့ခိၪ နွ့ၫနံၪ့ဒဲလၩ ဎူၫဘံၪ့တၭ, လၧယရုစလံၫ့အဖၧၩ့ အဝ့ၫဒၪကဲၪစဎွၩ လၧယုဒၫဒဲလၧအံၫစရ့လၭထီးအလူၬ အဖၫ့ခိၪၥၧၫ့ ဆံၫၥၧၫ့နံၪ့လီၫ.",
			"6": "<sup>6</sup> စဎွၩဒဲအၡၩၥံၪလ့ၩထီၩ့လၧယရုစလံၫ့, လၧၦယ့ ဘုၫဖိၪ, ၦခးဖိၪအအီၪတၭ, အဝ့ၫၥံၪချဲၩ့ဆၧလၧစဒၫ ဝံၭတၭ,စံၭဝ့ၫဒၪ, နအ့ၪလဆိၬထၪ့ခွံၬဘၪၦမ့ၬဘျီၪ,ဒဲ ၦအခၪ့ဂၭဂီၩ့တၭ, နဂဲၫနုၬဘၪထီးယီၩအ့ၬ, (ဆီၫ့မီၪ့",
			"7": "<sup>7</sup> ဝ့ၫလၧစဒၫဝံၭဂဲၫနုၬထီးနီၪၥ့ၪအ့ၬ.- မွဲလါနၫ့တၭစဒၫ ဝံၭမၩန့ဇံအိၫ့အထိၬလီၫ. အနီၪမွဲစဒၫဝံၭအဒိၩ့လီၫ.)",
			"8": "<sup>8</sup> စဒၫဝံၭစံၭဝ့ၫလၧမုလနံၩနီၪ, ထီးဒၪၦလဂၩဂၩလၧ အထၪ့ဝ့ၫလၧထံၫကၠီၪ့တၭ, ဖ့ၬခွံၬၦယ့ဘုၫဖိၪ, ဒဲၦအ ခၪ့ဂၭဂီၩ့, ဒဲၦအမ့ၬဘျီၪလၧစဒၫဝံၭၥၭဂဲၫ့ဝ့ၫနီၪ, မွဲအ မိကဲၪထၪ့ဆၧအခိၪလီၫ. အဂဲးဘဲၫယီၩ ၦစံၭဝ့ၫလၧၦ မ့ၬဘျီၪ, ဒဲၦအခၪ့ဂၭဂီၩ့လဖၪနီၪ ဂဲၫနုၬဘၪလၧဂံၪ့ဖၧၩ့ အ့ၬ.",
			"9": "<sup>9</sup> စဒၫဝံၭအီၪဝ့ၫလၧထိၬဖၧၩ့တၭ, ဖျိၬဝ့ၫအမံၩ့လၧစ ဒၫဝံၭအဒိၩ့လီၫ. စဒၫဝံၭၥုၪ့ထၪ့ဝၬဖီၩ့ဆၧ လၧမံလိၫ, ဒဲလၧအဖၧၩ့လခီၫလီၫ.",
			"10": "<sup>10</sup> တၭစဒၫဝံၭလ့ၩဆၧ,ဒဲဒိၪထၪ့တၭ, ယဟိဝၩဆၧၥုၭ မုခမျၧးအယွၩအီၪလၧအၥိၭလီၫ.",
			"11": "<sup>11</sup> တဲအၫအစဎွၩစဟဲရၫ့ အၪ့မၧၫ့လၩ့အၥီၫ့ၥံၪလၧစ ဒၫဝံၭအအီၪတၭ, ဖ့ၪယုၥံၪ့ၡိၫအ့ရ့ၭလဖၪ, ၦလဲၬၥမါ ၥံၪ,ဒဲၦပၠၫ့ၥမါၥံၪတၭ, အဝ့ၫၥံၪမၩထၪ့စဒၫဝံၭအဂံၪ့",
			"12": "<sup>12</sup> လဖျိၪ့လီၫ.- တၭစဒၫဝံၭၥ့ၪယၫဝ့ၫလၧယဟိဝၩအီၪ က့ၪဂုးအီၪက့ၪခၧၫ့အဝ့ၫ လၧစဎွၩလၧအံၫစရ့လၭအ ဖၫ့ခိၪ,ဒဲလၧအအီၪက့ၪထၪ့ထီၫ အဘၩ့အမုးလၧအ ၡၩခမျၧးအံၫစရ့လၭအကၠီၩ့လီၫ.",
			"13": "<sup>13</sup> လၧအဂဲၫထၪ့လၧဟံဘြၧၫ့အလးခဲၫ့နီၪ စဒၫဝံၭမၩ န့အၪထၪ့အၥံၪမၫ, ဒဲအမၫလဖၪ လၧယရုစလံၫ့အ ဖၧၩ့တၭ,ဖိၪမုၪၥံၪ, ဒဲဖိၪခွၫၥံၪ, အီၪဖျဲၪဒံၭလၧစဒၫဝံၭ",
			"14": "<sup>14</sup> အဂးလီၫ.- တၭၦလၧအအီၪဖျဲၪ လၧအဂးလၧယရုစ လံၫ့အဖၧၩ့လဖၪအမံၩ့မွဲဘဲၫယီၩ, စၡၫ့မုၫအၫဒဲစၡိ",
			"15": "<sup>15</sup> ဘၭ,ဒဲစနၫၥၫ့,ဒဲစစီလမၧၫ့,- စအံၭဘဟၫနီၪဆ့, ဒဲစ",
			"16": "<sup>16</sup> အ့ၭလရှုအၫ,ဒဲစနံဖ့ၭ, ဒဲစယၫဖဲအၫ,- ဒဲစအံၫလံၭၡ မၫ,ဒဲစအံၫလဲအဒၫ, ဒဲစအံၫလံၭဖလ့ၭလီၫ.",
			"17": "<sup>17</sup> အ့ၪမွဲထီးၦဖလံၡၫဖိၪနါဂၧၫ့ဝ့ၫ လၧၦဂုၪစဒၫဝံၭလၧ စဎွၩလၧအံၫစရ့လၭအဖၫ့ခိၪတၭ, ၦဖလံၡၫဖိၪထီး အလူၬဂဲၫအၪ့ဎၬစဒၫဝံၭတၭ, စဒၫဝံၭနါဂၧၫ့ဝ့ၫတၭ,",
			"18": "<sup>18</sup> လ့ၩထၪ့ဝ့ၫလၧထိၬဖၧၩ့လီၫ.- ၦဖလံၡၫဖိၪဂဲၫဆ့တၭ, အီၪပၩလၩ့အၥၭ လၧခိၪလီၩ့ဆူၭရ့ၭဖအံၫ့အဖၧၩ့",
			"19": "<sup>19</sup> လီၫ.- စဒၫဝံၭအၪ့စၪ့ဆၧလၧယဟိဝၩတၭ, စံၭဝ့ၫဒၪ, ယမိဘၪလ့ၩထၪ့လၧၦဖလံၡၫဖိၪအအီၪနီၪဧၪ. နမိဖ့ၪ လၫ့ခွံၬအဝ့ၫၥံၪလၧယစူၪဖၧၩ့ဆ့ဧၪ. တၭယဟိဝၩစံၭ စဒၫဝံၭလ့ၩထၪ့ဆံၭ. အဂဲးဘဲၫယီၩယမိဖ့ၪလၫ့ခွံၬတ",
			"20": "<sup>20</sup> ၡါၦဖလံၡၫဖိၪလၧနစူၪဖၧၩ့လီၫ.- စဒၫဝံၭဂဲၫဝ့ၫလၧ ဘၫအလၭပ့ရဇံၫ့တၭ, စဒၫဝံၭဖ့ၬခွံၬအဝ့ၫၥံၪထီးနီၪ တၭ,စံၭဝ့ၫဒၪ, ယဟိဝၩဘုၪ့ဖိးဆၧလၧယမ့ၬယၫလၧ အဒုၪအဒၩအဖၫ့ခိၪ, ဘဲၫထံၫဘုၪ့ဖိးဆၧအၥိၭနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭဆၧအလးနီၪ ဖျိၬဝ့ၫအမံၩ့ဘၫအ",
			"21": "<sup>21</sup> လၭပံရဇံၫ့လီၫ.- အဝ့ၫၥံၪစဲၪ့ဒၪခွံၬ အဆၧဂၩ့လဖၪ ထီးနီၪတၭ, စဒၫဝံၭဒဲအၡၩလဖၪနီၪ ဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪလီၫ.",
			"22": "<sup>22</sup> ၦဖလံၡၫဖိၪဂဲၫထၪ့ဒီၭလဖၧၫ့တၭ, အီၪပၩလၩ့အ",
			"23": "<sup>23</sup> ၥၭလၧခိၪလီၩ့ဆူၭ ရ့ၭဖအံၫ့အဖၧၩ့လီၫ.- ထီးစဒၫဝံၭ အၪ့စၪ့ယဟိဝၩတၭ, အဝ့ၫဒၪစံၭ, နလ့ၩထၪ့ဘၪအ့ၬ. လ့ၩဎဲၪ့လၧအဝ့ၫၥံၪအချိၫ့လခီၫတၭ, ဂဲၫထၪ့လၧအဝ့ၫ",
			"24": "<sup>24</sup> ၥံၪအဖၫ့ခိၪဆဲၫဎၩ့လၧၥံၪ့ထိဆၪလဖၪနီၪဆံၭ.- တၭ ဆၧမိမၩအၥၭထီးနနါဂၧၫ့ဆၧအၥီၫ လၧၥံၪ့ထိဆၪၥံၪ အခံၫနီၪတၭ, နမိဘၪထိၪဂဲၩနၥၭလီၫ. အဂဲးဘဲၫယီၩ ထီးနီၪလဖၧၫ့ယဟိဝၩမိလ့ၩဆၧ လၧနမ့ၬယၫဘဲၫၥိၭ",
			"25": "<sup>25</sup> အမိဖ့ၬခွံၬၦဖလံၡၫ အၥုၭမုခမျၧးနီၪလီၫ.- တၭစဒၫ ဝံၭမၩဝ့ၫဘဲၫယဟိဝၩ မၪလူၬဝ့ၫအၥိၭနီၪတၭ, ဖ့ၬခွံၬ ၦဖလံၡၫဖိၪ လၧဂံဘၫ ဖိးလၧနဂဲၫနုၬ လၧဂၫဇၧၫနီၪ လီၫ."
		},
		"6": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭဒုၭအီၪကိၩ့အီၪကီၪ့ ၦလၧအရွံန့ဝ့ၫလၧ ၦအံၫစရ့လၭဖိၪအကျၩထီးအလူၬ, ၦၥၧၫ့လၬလီၫ.",
			"2": "<sup>2</sup> စဒၫဝံၭဂဲထုၪ့, ဒဲၦခမျၧးထီးအလူၬ လၧအအီၪလၧအ ၥိၭနီၪစဲၪ့ထၪ့ခွံၬ လၧဘၫအလ့ၫဘၪဆဲၫ့လၧယုဒၫဘဲၫ ၥိၭအမိဂဲၫထဲၩ့ဆိၬ ယွၩအတလၫ လၧဆၧဖျိၬ အမံၩ့ လၧဆၧၥုၭမုခမျၧးအယဟိဝၩ အမံၩ့လၧအအီၪဝ့ၫထီး",
			"3": "<sup>3</sup> ခ့ၫရူၬၥံၪအဘိၩ့ဆၧၩ့နီၪလီၫ.- တၭအဝ့ၫၥံၪအီၪက့ၪ တလၫလၧလဲၪ့အၥၫ့လခိၪအဖၫ့ခိၪတၭ, ဂဲၫဆိၬန့ခွံၬ ဝ့ၫလၧစအဘံနဒၭအဂံၪ့ လၧအအီၪဝ့ၫ လၧဂံၭဘအၫ အဖၧၩ့လီၫ. စအဘံနဒၭအဖိၪခွၫၥံၪ, စအၧၭဇၫဒဲစအ ဟဲအိၫ,နၫ့လဲၪ့အၥၫ့နီၪလီၫ.",
			"4": "<sup>4</sup> အဝ့ၫၥံၪဂဲၫဆိၬန့ခွံၬဝ့ၫ လၧစအဘံနဒၭအဂံၪ့လၧအ အီၪဝ့ၫထီးဂံၭဘအၫနီၪၥိၫ့ယွၩအတလၫတၭ, စအဟဲ",
			"5": "<sup>5</sup> အိၫလ့ၩဝ့ၫလၧတလၫအမ့ၬယၫလီၫ.- တၭစဒၫဝံၭဒဲ အံၫစရ့လၭအဂံၪ့ဖိၪထီးအလူၬနီၪ ဒံၩ့ဆၧ,ဒိၪဆၧအၪ မံၩ့လၧဆၧမၩကဲၪထၪ့ဝ့ၫလၧၥံၪ့ၡိၫ, နါဒံၩ့ၥံၪ, ၥၫ့ထီး ၥံၪ,ဒဲဒိၩ့,ဒဲခဲၫ, ဒဲစံၩ့စံၩ့လီၫ.",
			"6": "<sup>6</sup> ထီးအဝ့ၫၥံၪဂဲၫဝ့ၫထီၩ့ လၧစနၫခၧၫ့ အခရဲးဖၧၩ့ တၭ,စအၧၭဇၫယူၬစိၩအစူၪလၧယွၩ အတလၫတၭ,",
			"7": "<sup>7</sup> ဖီၪ့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩချီၥံၪမၩဂဲၩဝ့ၫဒၪလီၫ.- ယ ဟိဝၩအၥၭထၪ့ခဲၩထၪ့ဘၪ စအၧၭဇၫတၭ,ယွၩဖ့ၬခွံၬ ဝ့ၫလၧအဆၧမၩအကၠီၩ့တၭ, ၥံၫဝ့ၫလၧယွၩအတလၫ",
			"8": "<sup>8</sup> အနဲၩ့ထံၭလီၫ.- တၭယဟိဝၩဘုၪ့ဖျီၫ့ဆၧလၧစအၧၭ ဇၫအလီၩ့တၭ, စဒၫဝံၭအၥၭထၪ့တၭ, ကိၭဆၧအလး နီၪအမံၩ့လၧပ့ရ့ၭအၧၭဇၫ ထီးမုဆၫလနံၩယီၩလီၫ.",
			"9": "<sup>9</sup> စဒၫဝံၭၥၭမဲၪယဟိဝၩ လၧမုလနံၩနီၪတၭ,စံၭဝ့ၫ ဒၪ,ယဟိဝၩအတလၫနီၪ မိဂဲၫထီၩ့လၧယအီၪဘဲၫၥ့ၪ",
			"10": "<sup>10</sup> လဲၪ.- အခိးမွဲစဒၫဝံၭ မိဂဲၫထဲၩ့န့ဘၪအၥၭလၧယဟိ ဝၩအတလၫ ထီၩ့လၧအဝ့ၫဒၪ အအီၪလၧစဒၫဝံၭအ ဒိၩ့ဖၧၩ့နီၪအ့ၬ. တၭစဒၫဝံၭဆိၬခွံၬဝ့ၫ ထီၩ့လၧၦဂံၭ",
			"11": "<sup>11</sup> တဲၭဖိၪစအိၫဘဒံဒၧၫ့ အဂံၪ့ဖၧၩ့လီၫ.- တၭယဟိဝၩ အတလၫအီၪဝ့ၫလၧၦဂံၭတဲၭဖိၪ စအိၫဘဒံဒၧၫ့အဂံၪ့ ဖၧၩ့နီၪလၩၥၧၫ့ဘံၪ့လီၫ. တၭယဟိဝၩဆိၪဂ့ၩ စအိၫ ဘဒံဒၧၫ့ဒဲအၡၩဂံၪ့ဖိၪထီးအလူၬလီၫ.",
			"12": "<sup>12</sup> ၦဒုၭနဲၪစဎွၩဒၫဝံၭတၭ, စံၭဝ့ၫဒၪ, ယဟိဝၩဆိၪဂ့ၩ စအိၫဘဒံဒၧၫ့အၡၩဂံၪ့ဖိၪ လၧကယဲဆၧဘၪဆဲၫ့လၧ အဝ့ၫလၧယွၩ အတလၫအကၠီၩ့လီၫ. တၭစဒၫဝံၭလ့ၩ ဆၧတၭ, ဂဲၫထဲၩ့ဆိၬခွံၬယွၩအတလၫ လၧစအိၫဘဒံ ဒၧၫ့အဂံၪ့ဖၧၩ့တၭ ထီၩ့လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့ အီၪလၧ",
			"13": "<sup>13</sup> ဆၧၥုၪ့ထိၬၥၭထိၬလီၫ.- ထီးၦလၧအဆိၬယဟိဝၩအ တလၫခၫထၪ့ဎူၫခၫတၭ, ဆၧမၩအၥၭလၧအလုထၪ့",
			"14": "<sup>14</sup> ချီဖၫ,ဒဲဆၧအဘီၪ့လဖၪလီၫ.- စဒၫဝံၭဂဲထုၪ့လံလၧ ယဟိဝၩအမ့ၬယၫ လၧအဂဲးအဘၭ ထီးအလူၬတၭ, စဒၫဝံၭခဲးထူၬအၥၭ လၧအ့ဖိၭဘွၩဖျ့ၫလံၬကံၭလီၫ.",
			"15": "<sup>15</sup> တၭစဒၫဝံၭဒဲအံၫစရ့လၭ အၡၩဂံၪ့ဖိၪထီးအလူၬဂဲၫ ဆိၬယဟိဝၩအတလၫ လၧဆၧကိၭၡၭထၪ့, ဒဲခွ့ၩအ ၥီၫလီၫ.",
			"16": "<sup>16</sup> ယဟိဝၩအတလၫဂဲၫနုၬ လၧစဒၫဝံၭအဒိၩ့ဖၧၩ့ တၭ,စစီလူၫအဖိၪမုၪ နးမဲၫခၫလၭ ယိဆၧလၧဆၧဖိး တၭ,ဒၪဘၪစဒၫဝံၭစဲၪ့, ဒဲဂဲထုၪ့လံ လၧယဟိဝၩအမ့ၬ ယၫတၭ,အီၪက့ၪၥၭလိၪဝ့ၫ လၧအၥၭဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> ၦဂဲၫဆိၬယဟိဝၩအတလၫတၭ, အီၪက့ၪလၩ့ဝ့ၫ လၧအလးဒၪဝ့ၫလၧတဲၩလၧ စဒၫဝံၭၥုၪ့ဝ့ၫလၧအဂးအ ၥၭကျၩလီၫ. တၭစဒၫဝံၭလုထၪ့ဆၧလုမ့ၪ, ဒဲဆၧလု မၩဘၪလိၬအိၭလိၬဆၧလၧ ယဟိဝၩအမ့ၬယၫလီၫ.",
			"18": "<sup>18</sup> ထီးစဒၫဝံၭလုထၪ့ဆၧလုမ့ၪ ဒဲဆၧလုမၩဘၪလိၬအိၭ လိၬဂီၩ့တၭ, ဆိၪဂ့ၩၦၡၩၥံၪလၧၥုၭမုခမျၧး အယဟိ",
			"19": "<sup>19</sup> ဝၩအမံၩ့လီၫ.- တၭအၪ့နၩ့ဖၭဖ့ၪလၫ့ ၦခမျၧးထီးအ လူၬ,ၦအံၫစရ့လၭအၡၩခမျၧးထီးအလူၬ လၧၦမုၪ ဂ့ၩ,ၦခွၫဂ့ၩ, လဂၩကိၪလဘံၪ့, ဒဲဆၧယၪဂ့ၩလလီၪ့, ဒဲစဘံၭၥၪ အကိၪပၪပဲၪလဘံၪ့ လၧၦကိၭဂၩဒ့ၭဆုၬ ဆုၬလီၫ. တၭၦခမျၧးထီးအလူၬ ထဲၩ့ထဲၩ့လဂၩလၧ အဂံၪ့ဒၪဝ့ၫကိၭဂၩဒ့ၭလီၫ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့ စဒၫဝံၭဂဲၫထဲၩ့ဆိၪဂ့ၩ အၡၩဂံၪ့ဖိၪ လီၫ.တၭစစီလူၫအဖိၪမုၪနးမဲၫခၫလၭ ဂဲၫအၪ့ဂၬစဒၫ ဝံၭတၭ,စံၭဝ့ၫဒၪ, အံၫစရ့လၭအစဎွၩလၧအဘဲၪ့လၩ့ ခွံၬအကီၩ့အၥိၭလၧအခ့ၫအၡၩ အဎီးမုၪၥံၪအမ့ၬယၫ ဘဲၫၦဂၭဂီၩ့ဖိၪလဂၩဘဲၪ့လၩ့ခွံၬ အကီၩ့အၥိၭအီၪဖျီၪ ဝ့ၫအၥိၭနီၪ, အလၩအဖၩ့လၧမုဆၫလနံၩယီၩ, မွဲအ ဆံၭဒိၪလဲၪၬ",
			"21": "<sup>21</sup> စဒၫဝံၭစံၭနးမဲၫခၫလၭနီၪ, မွဲလၧယဟိဝၩအမ့ၬယၫ, လၧအရွံန့ယၧၩလၧနဖါအမ့ၬယၫ, ဒဲလၧအဂံၪ့ဖိၪထီး အလူၬအမ့ၬယၫ, ဘဲၫၥိၭအမိအီၪက့ၪယၧၩလၧယဟိ ဝၩအခ့ၫအၡၩခမျၧးအဖၫ့ခိၪ လၧအံၫစရ့လၭအဖၫ့ ခိၪလီၫ. အခိးမွဲဘဲၫနီၪတၭ, ယမိကွ့ၩလၧယဟိဝၩအ",
			"22": "<sup>22</sup> မ့ၬယၫလီၫ.- တၭယမိမၩဂၭဂီၩ့ယနၫ့ဆါနၭနဲၪ့အနီၪ တၭ,ယမိဆၪ့လၩ့ယၥၭ လၧယမ့ၬယၫဒၪယဝ့ၫ,ဒဲယ ဎီးမုၪလဖၪလၧနချဲၩ့ဆၧလၧ အဂဲးအကၠီၪ့နီၪ,အဝ့ၫ",
			"23": "<sup>23</sup> ၥံၪမိမၩလၩဖၩ့ယၧၩလီၫ.- အခိးမွဲစစီလူၫအဖိၪမုၪ နးမဲၫခၫလၭလအီၪဖျဲၪန့ဘၪအဖိၪ ထီးမုနံၩလၧအၥံၫ ဝ့ၫလီၫ."
		},
		"7": {
			"1": "<sup>1</sup> စဎွၩဆၧၫ့နၩ့ လၧအဂံၪ့ဖၧၩ့တၭ, ယဟိဝၩဒုၭအီၪ ပွံၭအဝ့ၫလၧအဒုၪအဒၩ အီၪဝၬဖီၩ့ဝ့ၫ ထီးအလူၬ",
			"2": "<sup>2</sup> တၭး- ဆၧမၩအၥၭလၧစဎွၩစံၭမီၪစနၫၥၫ့, ယိခွါဘီၪ, ယအီၪလၧဂံၪ့ၥံၪ့ၡိၫအ့ရၭအဖၧၩ့, အ့ၪမွဲယဟိဝၩအ",
			"3": "<sup>3</sup> တလၫအီၪဝ့ၫလၧကလကၫၥံၪအဖၧၩ့လခီၫလီၫ.- တၭ စနၫၥၫ့စံၭစဎွၩ, လ့ၩဘီၪ, မၩကယဲဆၧလၧအအီၪဝ့ၫ လၧနၥၭခံဖၧၩ့ဆံၭ. အဂဲးဘဲၫယီၩ ယဟိဝၩအီၪလၧ နၥိၭလီၫ.",
			"4": "<sup>4</sup> လၧမုလနၩနီၪဆၧမၩအၥၭ လၧယဟိဝၩအလူလၩ့",
			"5": "<sup>5</sup> ဘၪစနၫၥၫ့တၭ,စံၭဝ့ၫဒၪ,- လ့ၩလီၩဘၪယခ့ၫယၡၩ စဒၫဝံၭ,ယဟိဝၩစံၭဝ့ၫဘဲၫယီၩ, နမိၥုၪ့ယဂံၪ့လၧယမိ",
			"6": "<sup>6</sup> အီၪလၧအဖၧၩ့ဆ့ဧၪ.- ခီၫလၧမုနံၩလၧယဒုၭဂဲၫထၪ့ ၦအံၫစရ့လၭဖိၪလၧအံဇံၭအဖၧၩ့ ထီၩ့လၩ့လၧမုဆၫ လနံၩယီၩ ယအီၪဘၪဒံၭလၧဂံၪ့ဖၧၩ့အ့ၬ. အ့ၪမွဲယ လ့ၩဆၧလၧတဲၩဖၧၩ့ ဒဲလၧတဲၩဆံၫ့ဎံၪ အဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> လၧကယဲဆၧအလးထီးယလ့ၩဆၧ လၧအံၫစရ့လၭဖိၪ ထီးအလူၬအၥိၭနီၪ, ယချဲၩ့ဆၧလၧအံၫစရ့လၭအၡၩ စ့ၩရၫ့ဆၧလဖၪ, လၧယမၪလူၬယိထဲၩ့ခွါထဲၩ့ယၡၩ ခမျၧးအံၫစရ့လၭတၭ, စံၭ,နၥံၪလၥုၪ့ထၪ့န့ဘၪယၧၩ",
			"8": "<sup>8</sup> လၧဂံၪ့ၥံၪ့ၡိၫအ့ရ့ၭနီၪ, မွဲဘၪလဲၪနီၪဆ့ဧၪ.- တၭဘိၩ့ နဲၪ့ယီၩနမိဘၪစံၭ, ယခ့ၫယၡၩစဒၫဝံၭဘဲၫယီၩ, ဆၧ ၥုၭမုခမျၧးအယဟိဝၩ စံၭဘဲၫယီၩ, ယမၩန့ထၪ့ခွံၬ နၧၩလၧၥိၪအဖီၩ့ထီးနဖိၬၥိၪအခဲၫ့, ဘဲၫၥိၭနမိကဲၪထၪ့ ဆၧအခိၪလၧယၡၩခမျၧးအဖၫ့ခိၪ, လၧအံၫစရ့လၭအ",
			"9": "<sup>9</sup> ဖၫ့ခိၪလီၫ.- တၭထီးနလ့ၩဆၧလစီၪ့လါလါနီၪယအီၪ လၧနၥိၭတၭ, ယဖ့ၬထ့ၬခွံၬနဒုၪနဒၩ ထီးအလူၬလၧ နမ့ၬယၫတၭ, ယအီၪက့ၪယူၭနမံၩ့လၧဆၧအဒိၪ, ဘဲၫ",
			"10": "<sup>10</sup> ၦအဒိၪလၧဂၪ့ခိၪချိၫ့အမံၩ့အၥိၭယူၭ.- ယအီၪက့ၪ ယူၭဆၧအလးလၧယၡၩခမျၧး အံၫစရ့လၭအဂးယူၭ တၭ,ယၥုၪ့လၩ့ယူၭဝ့ၫဘဲၫၥိၭ အမိအီၪလၧအလးဒၪ ဝ့ၫတၭ, စဲၪ့လၧၩ့အ့ၬ, တၭၦအၧၩ့ဖိၪမိမၩၡၪ့မၩနၭ",
			"11": "<sup>11</sup> ဘၪလၧၩ့အဝ့ၫၥံၪဘဲၫလၧ အခၪ့ထံၭအၥိၭအ့ၬ.- တၭ လၧမုလနံၩလၧယမၪလူၬ ၦစ့ၩရၫ့ဆၧလၧယၡၩခမျၧး အံၫစရ့လၭအဖၫ့ခိၪ, ဒဲဒုၭအီၪပွံၭနၧၩ လၧနဒုၪနဒၩ ထီးအလူၬယူၭတၭ, ယဟိဝၩစံၭနၧၩလၧအမိၥုၪ့န့နၧၩ",
			"12": "<sup>12</sup> လၧဂံၪ့နးဖျိၪ့လီၫ.- တၭထီးမုနံၩဎွ့ၩထၪ့နီၪ, နမိမံၫလၧ နဖါလဖၪအၥိၭတၭ, ယမိအီၪက့ၪထၪ့နချံၫနၥၪလၧန လးခဲၫ့နီၪ, လၧအမိဂဲၫထၪ့လၧနဂူၭဖိၫ့ဖၧၩ့တၭ, ယမိ",
			"13": "<sup>13</sup> ဒုၭအီၪဂုးအီၪခၧၫ့အဘၩ့အမုးနီၪလီၫ.- အဝ့ၫဒၪလဂၩ နီၪမိၥုၪ့ဂံၪ့နးဖျိၪ့လၧယမံၩ့အဂးတၭ, ယမိဒုၭအီၪဂုး ခၧၫ့အဘၩ့အမုးအလးဆီၩ့ဆီ လၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"14": "<sup>14</sup> တၭယမိကဲၪထၪ့အဖါတၭ, အဝ့ၫဒၪနီၪမိကဲၪထၪ့ယဖိၪ ခွၫလီၫ. အ့ၪမၩဆၧဒဲၩဘၭတၭ, ယမိအၪ့ၥီၪ့ဝ့ၫလၧ ၦၡၩအနိၪဖျ့ၪ, ဒဲလၧၦၡၩအဖိၪအဆၧထးလဖၪလီၫ.",
			"15": "<sup>15</sup> မွဲလါနၫ့တၭ, ယဆၧယၫ့ၥုၪ့ယၫ့ၥၭစဲၪ့ဒၪအဝ့ၫ, ဘဲၫ ယမၩန့ထၪ့ထဲၩ့ဝ့ၫလၧစစီလူၫ, ၦလၧယခွံၬၡိၭလၧန",
			"16": "<sup>16</sup> မ့ၬယၫအၥိၭနီၪအ့ၬ.- တၭနဂံၪ့ဒဲနဘၩ့နမုးမိအီၪဂုး အီၪခၧၫ့အဆိၩအကၠၪ လၧနမ့ၬယၫတၭ, နလးဆီၩ့ဆီ",
			"17": "<sup>17</sup> မိအီၪဂုးအီၪခၧၫ့အဆိၩဆိၩအကၠၪကၠၪလီၫ.- တၭဘဲၫ ဆၧချဲၩ့ထီးအလူၬအၥိၭနီၪ, ဒဲဘဲၫကယဲဆၧဒၪလၧ ယၫလခီၫအၥိၭနီၪ, စနၫၥၫ့ချဲၩ့ဆၧလၧစဒၫဝံၭဘဲၫနီၪ အၥိၭလီၫ.",
			"18": "<sup>18</sup> စဎွၩဒၫဝံၭလ့ၩနုၬတၭ, ဆၧၫ့နၩ့လၧယဟိဝၩအမ့ၬ ယၫတၭစံၭဝ့ၫဒၪ, ယဟိဝၩဧ့, လၧနၥိၫ့ယူၭယၧၩခီး ဘိၩ့နဲၪ့ယီၩယမွဲပလၫလဂၩလဲၪ. ဒဲယဂံၪ့မွဲဆၧနီၪလ",
			"19": "<sup>19</sup> မံၩ့လဲၪ.- တၭနချဲၩ့ဝဲၩယူၭဆၧနီၪလၧနခ့ၫနၡၩအဂံၪ့ အဂဲးအကၠီၪ့စူၩယၫလခီၫ ယံၬယံၬနီၪ, မွဲဆၧအဆံၭ လမံၩ့လၧနမ့ၬယၫဧၪ, ယဟိဝၩယွၩဧ့, အယီၩမွဲၦၡၩ",
			"20": "<sup>20</sup> အထူၫအရူၫဆ့ဧၪ, ယဟိဝၩယွၩဧ့,- တၭစဒၫဝံၭမိစံၭ ဒံၭနၧၩလၧဆၧနီၪလမံၩ့လဲၪ. အဂဲးဘဲၫယီၩနဝ့ၫဒၪ,ယ",
			"21": "<sup>21</sup> ဟိဝၩယွၩဧ့,နၥ့ၪယၫနခ့ၫနၡၩလီၫ.- လၧနလူနထၫအ ကၠီၩ့,ဒဲဘဲၫနၥၭဒၪနဝ့ၫအၥိၭနီၪ နမၩယူၭဆၧအဒိၪလ",
			"22": "<sup>22</sup> ဖၪယီၩဘဲၫၥိၭနခ့ၫနၡၩမိၥ့ၪယၫဆၧလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ,နမွဲဆၧဒိၪ, ယဟိဝၩယွၩဧ့, ဘဲၫနၧၩအၥိၭ အီၪအ့ၬ. တၭဘဲၫကယဲဆၧလၧပနါဂၧၫ့လၧပနါအၥိၭ",
			"23": "<sup>23</sup> နီၪအ့ၪလမွဲဘၪနၧၩယွၩအီၪအ့ၬ.- တၭၦလဆၨၩလၧ ဂၪ့ခိၪချိၫ့လၩ့ဂၬနၡၩခမျၧး, အံၫစရ့လၭလၧယွၩလ့ၩ ဎွ့ၩန့ထဲၩ့လၧအၡၩလဆၨၩ လၧအဂးဒၪဝ့ၫ, ဘဲၫၥိၭ အမိမၩကဲၪထၪ့အမံၩ့တၭ, ဘဲၫၥိၭအမိမၩဆၧအဒိၪ လဖၪ,ဒဲဆၧၥၭမဲၪအလးလဖၪလၧအဝ့ၫၥံၪအဂး, လၧ နခးအဂး,လၧနၡၩခမျၧးအမ့ၬယၫ လၧနဎွ့ၩန့ထဲၩ့လၧ နဂးလၧအံဇံၭ, လၧၦဆၨၩလဖၪ, ဒဲအဝ့ၫၥံၪအယွၩ",
			"24": "<sup>24</sup> လဖၪနီၪမွဲဆၧနီၪလဆၨၩလဲၪ.- အဂဲးဘဲၫယီၩနအီၪ က့ၪဂုးအီၪက့ၪခၧၫ့ယူၭ နၡၩခမျၧးအံၫစရ့လၭလၧန ဂးၦၡၩလဆၨၩအဆိၩဆိၩအကၠၪကၠၪ လၧနဂးတၭ, နဝ့ၫဒၪယဟိဝၩဧ့, နကဲၪထၪ့ယူၭအဝ့ၫၥံၪအယွၩယူၭ.",
			"25": "<sup>25</sup> တၭဘိၩ့နဲၪ့ယီၩယဟိဝၩယွၩဧ့, ဆၧချဲၩ့လၧနချဲၩ့ဆၧ လၧနခ့ၫနၡၩအဂဲးအကၠီၪ့ ဒဲလၧအဂံၪ့အဂဲးအကၠီၪ့နီၪ, မၩဂုးမၩခၧၫ့အဝ့ၫလၩ့ဆိၩလၩ့ကၠၪတၭ, မၩဆၧဘဲၫန",
			"26": "<sup>26</sup> ချဲၩ့ယူၭအၥိၭနီၪဆံၭ.- တၭမွဲဆၧအီၪက့ၪဒိၪနမံၩ့အ ဆိၩအကၠၪ,စံၭဝ့ၫ, ဆၧၥုၭမုခမျၧးအယဟိဝၩ, မွဲအံၫ စရ့လၭအယွၩတၭ, မွဲနခ့ၫနၡၩစဒၫဝံၭ အဂံၪ့အီၪဂုး",
			"27": "<sup>27</sup> အီၪခၧၫ့လၧနမ့ၬယၫဆံၭ.- အဂဲးဘဲၫယီၩနဝ့ၫဒၪဆၧ ၥုၭမုခမျၧးအယဟိဝၩ အံၫစရ့လၭအယွၩဧ့, နနဲၪဖျီၪ ဆၧလၧနခ့ၫနၡၩအနါဖၧၩ့တၭ, နစံၭယမိၥုၪ့န့နၧၩလၧ ဂံၪ့လဖျိၪ့လီၫ. မၩအၥၭဘဲၫနီၪတၭ, နခ့ၫနၡၩဒၪန့ဆၧ လၧအၥၭခံဖၧၩ့ဘဲၫၥိၭ အမိဘၩဆိၪဖၪဆၧဘၩဆိၪဖၪ ယီၩလၧနၧၩလီၫ.",
			"28": "<sup>28</sup> ဘိၩ့နဲၪ့ယီၩ,ယဟိဝၩယွၩဧ့, နမွဲယွၩလဂၩနီၪတၭ, နလူမွဲဆၧအမွဲအတီၩတၭ, နစံၭဝဲၩဆၧဂ့ၩယီၩလၧန",
			"29": "<sup>29</sup> ခ့ၫနၡၩလီၫ.- တၭဘိၩ့နဲၪ့ယီၩမွဲအဘၪနၥၭတၭဆိၪ ဂ့ၩလါနခ့ၫနၡၩအဂံၪ့ ဘဲၫၥိၭအမိအီၪဝ့ၫလၧနမ့ၬယၫ အဆိၩအကၠၪဆံၭ. အဂဲးဘဲၫယီၩ နဝ့ၫဒၪယဟိဝၩ ယွၩဧ့,နချဲၩ့ယူၭဆၧယူၭတၭ, မွဲနခ့ၫနၡၩ အဂံၪ့ဘၪ ဆၧဆိၪဂ့ၩ, လၧနဆၧဆိၪဂ့ၩလၩ့ဆိၩလၩ့ကၠၪဆံၭ."
		},
		"8": {
			"1": "<sup>1</sup> လၧဆၧနီၪအလးခဲၫ့ဆၧမၩအၥၭ လၧစဒၫဝံၭဖ့ၬခွံၬ ၦဖလံၡၫဖိၪတၭ, မၩစၪအဝ့ၫၥံၪတၭ, စဒၫဝံၭမၩန့ခွံၬ မံၥ့ၭအၫမၫလၧၦဖလံၡၫဖိၪအစူၪဖၧၩ့လီၫ.",
			"2": "<sup>2</sup> အဝ့ၫဒၪဖ့ၬမိအၭတၭ, ထိၪအဝ့ၫၥံၪလၧဖျံၩလဘီၩ့ တၭ,မၩလၩ့ထံၩဖါအဝ့ၫၥံၪ လၧဂၪ့ခိၪ, ထိၪဝ့ၫလၧ ဖျံၩနံၫဘီၩ့ဒၪလ့ၬဘဲၫၥိၭအမိမၩၥံၫဝ့ၫ, ဒဲလၧဖျံၩထၧၫ့ ဘီၩ့ယၫဘဲၫၥိၭအမိဒုၭမၧၫ့ဒံၭဝ့ၫလီၫ. ၦမိအၭဖိၪကဲၪ ထၪ့စဒၫဝံၭအခ့ၫအၡၩ ဒဲဖ့ၪလၫ့အခီၫ့လီၫ.",
			"3": "<sup>3</sup> တၭလၧဇိဘၫအစဎွၩစရ့ဟီၭအဖိၪခွၫ စဟၫဒၭအံ ဇၧၫနီၪ,စဒၫဝံၭဖ့ၬခွံၬ လၧအလ့ၩမၩန့ထဲၩ့ အခးနဲၩ့",
			"4": "<sup>4</sup> ထံၭလၧထံၫမိၡါယုၫဖ့တံၫအနဲၩ့ထံၭလီၫ.- တၭစဒၫ ဝံၭမၩန့ခွံၬအဝ့ၫဒၪအလဲၪ့ၥုၭလထီၫ့, ဒဲၦကၥ့ၪၥုၭဖိၪ နွ့ၫယၩ,ဒဲၦခၪ့ၥုၭဖိၪနံၫလၬတၭ, စဒၫဝံၭဖ့ၬထ့ၬခွံၬ လဲၪ့ၥုၭအကၥ့ၪအခၪ့ထီၪ့ထီးအလူၬ, မွဲလါနၫ့အီၪက့ၪ",
			"5": "<sup>5</sup> လၩ့ထးလဲၪ့ၥုၭလယၩလၧအဂးဒၪဝ့ၫလီၫ.- ထီးၦစံ ရအၫဖိၪလၧဒမၭစကၧၭ ဂဲၫမၩဆၧၩ့ဇိဘၫအစဎွၩဟၫ ဒၭအံဇၧၫတၭ, စဒၫဝံၭဖ့ၬခွံၬၦစံရအၫဖိၪလဖၪနီၪနံၫ",
			"6": "<sup>6</sup> လၬနံၫထီၫ့လီၫ.- ထီးနီၪလဖၧၫ့ စဒၫဝံၭအီၪက့ၪၦခိၭ ဆၧလဖၪလၧစံရအၫဘၪဆဲၫ့ လၧဒမၭစကၧၭအဖၧၩ့ တၭ,ၦစံရအၫဖိၪကဲၪထၪ့စဒၫဝံၭ အခ့ၫအၡၩတၭ,ဖ့ၪ လၫ့အခီၫ့လီၫ. တၭထီးဒၪစဒၫဝံၭလ့ၩဆၧလစီၪ့လါ",
			"7": "<sup>7</sup> လါနီၪယဟိဝၩယိထဲၩ့ခွါထဲၩ့အဝ့ၫလီၫ.- စဒၫဝံၭမၩ န့ထၩ့ဖံၭထီၫ့ၥံၪလၧအအီၪဝ့ၫ လၧစဟၫဒၭအံဇၧၫအ ခ့ၫအၡၩအလီၩ့တၭ, ဂဲၫဆိၬဝ့ၫလၧယရုစလံၫ့လီၫ.",
			"8": "<sup>8</sup> တၭစဒၫဝံၭမၩန့ထီးၥံၪၡၬၥံၪအၪအၪလ့ၬ လၧစဟၫ ဒၭအံဇၧၫအဒိၩ့ဘံတၫ, ဒဲဘံရိၥဲၫလဖၪ အဖၧၩ့နီၪ လီၫ.",
			"9": "<sup>9</sup> ထီးဟၫမၭအစဎွၩစတိအဲၫနါဂၧၫ့ဝ့ၫ လၧစဒၫဝံၭဖ့ၬ ခွံၬယူၭစဟၫဒၭအံဇၧၫ အၡၩၥုၭမုခမျၧးဖၭဒိၪထီး",
			"10": "<sup>10</sup> အလူၬတၭ,- စတိအဲၫအၪ့မၧၫ့အဖိၪခွၫစယိရၫ့လ့ၩ ချဲၩ့ဒုၪ့စဎွၩဒၫဝံၭ ဒဲဆိၪဂ့ၩဝ့ၫလၧအဒုၭၥုၭလၧစဟၫ ဒၭအံဇၧၫ,ဒဲလၧအဖ့ၬခွံၬဝ့ၫအကၠီၩ့လီၫ. အဂဲးဘဲၫ ယီၩစဟၫဒၭအံဇၧၫဒုၭယူၭဆၧလၧ စတိအဲၫလီၫ.တၭ အဝ့ၫဂဲၫဆိၬထွ့ၫစ့ၩလဖၪ, ဒဲထွ့ၫထီၫ့လဖၪ, ဒဲထွ့ၫထီး",
			"11": "<sup>11</sup> ဝီၩလဖၪလၧအၥိၭလီၫ.- တၭစဎွၩဒၫဝံၭမၩဘိၪ့ယဟိ ဝၩလၧအဝ့ၫၥံၪ, ဒဲလၧကျိၪၥံၪစ့ၩၥံၪ, ဒဲထီၫ့ၥံၪလွ့ၫၥံၪ လၧအမၩဘိၪ့ယူၭလၧဆၧဘၪဆဲၫ့ ကယဲၦအဆၨၩလ",
			"12": "<sup>12</sup> ဖၪလၧအမၩနၧၩ့မၩစၪဝ့ၫနီၪလီၫ.- မွဲဆၧဘၪဆဲၫ့လၧ စံရအၫ,ဒဲမိအၭ, ဒဲၦအၫမၧၫ့ဖိၪ, ဒဲၦဖလံၡၫဖိၪ,ဒဲအၫ မလ့ၭ, ဒဲဇိဘၫအစဎွၩစရ့ဟီၭ အဖိၪခွၫစဟၫဒၭအံ ဇၧၫအဆၧဖိၪဆၧလံၩနီၪလီၫ.",
			"13": "<sup>13</sup> တၭထီးစဒၫဝံၭဂဲၫထဲၩ့ လၧအဖ့ၬခွံၬၦစံရအၫဖိၪလ လၬဎိၭထီၫ့လၧထံၫလၪ အခိၪလီၩ့ဆူၭဖၧၩ့နီၪ အမံၩ့",
			"14": "<sup>14</sup> ဂၧၫ့ထၪ့ၥၩလၩ့ဝ့ၫလီၫ.- တၭအဝ့ၫအီၪက့ၪ ၦခိၭ ဆၧလၧအံဒၧၫ့အဖၧၩ့, အီၪက့ၪၦခိၭဆၧ လၧအံဒၧၫ့ ထၧၫ့ခးယၫအဖၧၩ့တၭ, ကယဲၦအံဒၧၫ့ဖိၪကဲၪထၪ့စဒၫ ဝံၭအခ့ၫအၡၩထီးအလူၬလီၫ. ထီးဒၪစဒၫဝံၭလ့ၩဆၧ",
			"15": "<sup>15</sup> လစီၪ့လါလါနီၪယဟိဝၩယိလၩ့ခွါလၩ့ဝ့ၫလီၫ.- စဒၫ ဝံၭကဲၪစဎွၩလၧအံၫစရ့လၭ ထီးအလူၬအဖၫ့ခိၪတၭး စဒၫဝံၭစ့ၩရၫ့ဆၧတီၩဆၧလီၩ့ လၧၦခမျၧးထီးအလူၬ",
			"16": "<sup>16</sup> အဂးလီၫ.- တၭနးဇ့ၫရုၫအဲအၫ အဖိၪခွၫစယိအၭကဲၪ ဝ့ၫလၧၦၥုၭမုခမျၧးအခိၪ, ဒဲစအဟဲလၧၭအဖိၪခွၫစယ",
			"17": "<sup>17</sup> ဟီၡဖၭမွဲၦကွ့ၭနဲၪ့ဆၧလီၫ.- တၭစအဟဲတၧၭအဖိၪ ခွၫစဇၫဒီၭ, ဒဲစအဘဲအၥၫအဖိၪခွၫ စအဟံမလ့ၭမွဲၦ",
			"18": "<sup>18</sup> လုဆၧလဖၪ,ဒဲစစံရအဲအၫမွဲၦကွ့ၭလံၬတၭ,- စယဟီ အဒၫအဖိၪခွၫစဘံၫ့အအဲအၫ အီၪဝ့ၫလၧၦခ့ရ့ၭဖိၪ,ဒဲ ၦဖံလ့ၭဖိၪအဖၫ့ခိၪတၭ, စဒၫဝံၭအဖိၪခွၫၥံၪ မွဲၦပၧၩ့ ဆၧအခိၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, လၧစစီလူၫ အၡၩဂံၪ့ဖိၪအ ကျၩ,ဘဲၫၥိၭယမိမၩဝ့ၫလၧအခိးအတၩ လၧစစၪ့နၥၧၫ့",
			"2": "<sup>2</sup> အကၠီၩ့နီၪၦအီၪလၩ့ထးဒံၭလဂၩဂၩဆ့ဧၪ.- ဆၧအ ခ့ၫအၡၩလၧစစီလူၫအၡၩဂံၪ့ဖိၪအကျၩ အီၪဝ့ၫလဂၩ တၭ,အမံၩ့မွဲစဇဲဘၫတၭ, ထီးၦၡၩကိၭအဝ့ၫဂဲၫလၧ စဒၫဝံၭအအီၪနီၪ, စဎွၩစံၭအဝ့ၫ, နမွဲစဇဲဘၫဆ့ဧၪ.",
			"3": "<sup>3</sup> တၭအဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ နဎီးနၡၩလီၫ.- တၭစဎွၩစံၭ ဝ့ၫဒၪၦလၧစစီလူၫအၡၩဂံၪ့ဖိၪအကျၩ လၧယမိမၩဝ့ၫ လၧယွၩအခိးအတၩနီၪ, မွဲလအီၪလၧၩ့ဘၪဧၪ. တၭစ ဇဲဘၫစံၭစဎွၩ, စစၪ့နၥၧၫ့အဖိၪခွၫ လၧအခၪ့ဂၭဂီၩ့နီၪ",
			"4": "<sup>4</sup> အီၪဒံၭလဂၩလီၫ.- တၭစဎွၩစံၭ, မွဲအအီၪခီၫခီၫလဲၪ. တၭစဇဲဘၫစံၭစဎွၩ, ယိခွါ, အီၪဝ့ၫလၧစအၫမအ့လၭ",
			"5": "<sup>5</sup> အဖိၪခွၫစမၫခၧၫအဂံၪ့ လၧလိၫဒံဘၫအဖၧၩ့လီၫ.- ထီး နီၪလဖၧၫ့စဎွၩဒၫဝံၭအၪ့မၧၫ့ ၦလ့ၩလၧစအၫမအ့လၭ အဖိၪခွၫစမၫခၧၫအဂံၪ့ လၧလိၫဒံဘၫအဖၧၩ့နီၪ, ဂဲၫ ထဲၩ့ဆိၬအဝ့ၫဒၪလီၫ.",
			"6": "<sup>6</sup> တၭစစီလူၫအဖိၪခွၫ စစၪ့နၥၧၫ့အဖိၪခွၫစမဖံၭဘ ၡ့ၭဂဲၫလၧစဒၫဝံၭအအီၪတၭ, ၡီၫ့လၩ့အၥၭတၭ, ထွံၩလၩ့ ဝ့ၫနီၪ,စဒၫဝံၭစံၭဝ့ၫဒၪ, စမဖံၭဘၡ့ၭဧ့, တၭအဝ့ၫဒၪ",
			"7": "<sup>7</sup> စံၭဆၧၫ့ဝ့ၫ,ယိခွါ, နဎီးနၡၩလီၫ.- တၭစဒၫဝံၭစံၭအဝ့ၫ ဒၪ,ၥၭမဲၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ယမိမၩတၡါနၧၩလၧ ဆၧအခိးအတၩလၧနဖါစစၪ့နၥၧၫ့အကၠီၩ့တၭ, ယမိ ဖ့ၪလၫ့ထဲၩ့နၧၩလၧနဖါစစီလူၫ အဂၪ့ခိၪထီးအလူၬ တၭ,နဝ့ၫဒၪနမိဘၪအၪ့ဆၧအီၩဆၧ လၧယစပွဲထံၭ",
			"8": "<sup>8</sup> လထံၪဎးလီၫ.- အဝ့ၫဒၪထွံၩလၩ့တၭ, စံၭဝ့ၫဒၪ,လၧ နမိယိထဲၩ့ထွံၪအၥံၫလဒုၩ ဘဲၫယၧၩအၥိၭနီၪ, နဎီး နၡၩမွဲဆၧနီၪလမံၩ့လဲၪ.",
			"9": "<sup>9</sup> တၭစဎွၩကိၭန့စစီလူၫအခ့ၫအၡၩ စဇဲဘၫတၭ,စံၭ အဝ့ၫ,ယဖ့ၪလၫ့ယူၭ နကဆါအဖိၪခွၫ လၧကယဲဆၧ လၧအဘၪဆဲၫ့လၧစစီလူၫ ဒဲအဂံၪ့နီၪထီးအလူၬလီၫ.",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭနဝ့ၫဒၪ, ဒဲနဖိၪခွၫၥံၪ ဒဲနဎီးနၡၩၥံၪ မိဘၪမၩကၩလၧအဂးတၭ, နဘၪဂဲၫဆိၬဆၧဘဲၫၥိၭ နကဆါအဖိၪခွၫ မိအီၪလၧဆၧအၪ့ဆၧအီၩ အဂးနီၪ, အ့ၪမွဲနကဆါအဖိၪခွၫ စမဖံၭဘၡ့ၭ မိအၪ့ဆၧလၧယ စပွဲထံၭလထံၪဎးလီၫ. တၭစဇဲဘၫအီၪလၧအဖိၪခွၫ",
			"11": "<sup>11</sup> လဆံၫယဲဂၩ, ဒဲအခ့ၫအၡၩနံၫဆံၫလီၫ.- ထီးနီၪလဖၧၫ့ စဇဲဘၫစံၭစဎွၩ, ဘဲၫကယဲဆၧလၧယကဆါ, စဎွၩမၪ လူၬအဎီးအၡၩအၥိၭနီၪ, နဎီးနၡၩမိမၩဘဲၫနီၪအၥိၭ လီၫ.တၭ ဎစဎွၩစံၭဝ့ၫ,ၭ စမဖံၭဘၡ့ၭမိအၪ့ဆၧလၧယ",
			"12": "<sup>12</sup> စပွဲထံၭဘဲၫစဎွၩအဖိၪခွၫလဂၩ အၥိၭနီၪလီၫ.- တၭ စမဖံၭဘၡ့ၭအီၪလၧအဖိၪခွၫအဆံၭလဂၩ, အမံၩ့မွဲစမဲ ခၫလီၫ. တၭကယဲၦလၧအအီၪဝ့ၫ လၧစဇဲဘၫအဂံၪ့ ဖၧၩ့ထီးအလူၬနီၪ မွဲစမဖံၭဘၡ့ၭ အဎီးအၡၩလီၫ.",
			"13": "<sup>13</sup> စမဖံၭဘၡ့ၭအီၪလၧယရုစလံၫ့အဖၧၩ့လီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫအၪ့ဆၧလၧစဎွၩ အစပွဲထံၭလထံၪဎး ဒဲအ ခၪ့ဂၭဂီၩ့နံၫခီၫလူၬလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> လၧဆၧနီၪအလးခဲၫ့တၭ, ဆၧမၩအၥၭလၧၦအၫ မၧၫ့ဖိၪအစဎွၩၥံၫဝ့ၫတၭ, အဖိၪခွၫစဟၫနၧၫ့ကဲၪထၪ့",
			"2": "<sup>2</sup> စဎွၩလၧအလးလီၫ.- တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ယမိမၩခိး မၩတၩစနၫဟၭအဖိၪခွၫစဟၫနၧၫ့ ဘဲၫအဖါမၩခိးမၩ တၩယၧၩအၥိၭနီၪလီၫ. တၭစဒၫဝံၭအၪ့မၧၫ့ၦလ့ၩမၩ မုၬထၪ့ထဲၩ့ဝ့ၫလၧအဖါအကၠီၩ့ လၧအခ့ၫအၡၩအစူၪ ဖၧၩ့လီၫ. တၭစဒၫဝံၭအခ့ၫအၡၩ လ့ၩနုၬလၧၦအၫ",
			"3": "<sup>3</sup> မၧၫ့ဖိၪအခးဖၧၩ့လီၫ.- တၭၦအၫမၧၫ့ဖိၪအခိၪလဖၪ စံၭလၧအကဆါ စဟၫနၧၫ့နီၪး မွဲနဆီၫ့မီၪ့လၧစဒၫဝံၭ မၩလၩမၩဖၩ့နဖါ လၧနမ့ၬယၫလၧအအၪ့မၧၫ့ ၦမၩ မုၬထၪ့ထဲၩ့ဆၧလဖၪလၧနအီၪအကၠီၩ့ဆ့ဧၪ. တၭစဒၫ ဝံၭအၪ့မၧၫ့အခ့ၫအၡၩ ဂဲၫအၪ့ဎၬဆၧလၧဒိၩ့ဖၧၩ့,ဒဲယိ ဂူၪဆၧလၧအဖၧၩ့တၭ, မၩဂၭဂီၩ့ဝ့ၫနီၪ, မွဲအ့ၬဧၪ.",
			"4": "<sup>4</sup> အခိးမွဲစဟၫနၧၫ့မၩန့ စဒၫဝံၭအခ့ၫအၡၩတၭ, လိၩ့အ ခၪလၬဆီၪ့လခီၫတၭ, ကူၭထ့ၬအဆဲၫ့လၧအၥၭကျၩ,",
			"5": "<sup>5</sup> ထီးအခဲၫ့ခွးနီၪဂီၩ့တၭ, ဖျါခွံၬဝ့ၫဒၪလီၫ.- ၦလီၩဘၪ စဒၫဝံၭတၭ, အဝ့ၫအၪ့မၧၫ့ၦလ့ၩအၪ့ဂၬဝ့ၫလီၫ. အဂဲး ဘဲၫယီၩ ၦၡၩၥံၪနီၪအမ့ၬမဲဒိၪမၬလီၫ. တၭစဎွၩနီၪ စံၭဝ့ၫဒၪ,အီၪလၧယ့ၫရခိၫ ထီးနၥံၪအခၪလၬဆီၪ့ဂဲၫ ထၪ့ထဲၩ့တၭ, ဂဲၫထဲၩ့ဘီၪ.",
			"6": "<sup>6</sup> ၦအၫမၧၫ့ဖိၪဒၪဘၪဝ့ၫ လၧအဘၪစံၪစၪလၧစဒၫဝံၭ အမ့ၬယၫတၭ, ၦအၫမၧၫ့ဖိၪ အၪ့မၧၫ့လၩ့ ၦၡၩအၪ့ လံၩ့ၦစံရအၫဖိၪ, ဘၪဆဲၫ့လၧဘ့ၭၥရ့ဟီၭ,ဒဲၦစံရအၫ ဖိၪဘၪဆဲၫ့လၧဇိဘၫၦခၪ့ၥုၭဖိၪနံၫလၬး ဒဲၦလထီၫ့ဘၪ ဆဲၫ့လၧစဎွၩမၫအခၫ, ဒဲၦလလၬနံၫထီၫ့ဘၪဆဲၫ့လၧ",
			"7": "<sup>7</sup> စအံၡတီၭလီၫ.- ထီးစဒၫဝံၭနါဂၧၫ့ဝ့ၫတၭ, အၪ့မၧၫ့ လၩ့စယိအၭ ဒဲၦၥုၭဖိၪခမျၧးၥံၪ ၦအဆီၪ့ထီးအလူၬ",
			"8": "<sup>8</sup> လီၫ.- ၦအၫမၧၫ့ဖိၪဂဲၫထၪ့တၭ, တဲၩ့ဝဲၩဆၧဒုၭၥုၭထီး ဆၧလ့ၩနုၬလၧတရၫ့အလးတၭ, ၦစံရအၫဖိၪဘၪဆဲၫ့ လၧဇိဘၫ,ဒဲရ့ဟိၭ, ဒဲအံၡတီၭ, ဒဲမၫအခၫလဖၪနီၪ,",
			"9": "<sup>9</sup> အီၪလစီၪ့ဒၪလၧဆၧပျၩ့ဖၧၩ့လီၫ.- ထီးစယိအၭဒၪဘၪ ဝ့ၫလၧဆၧဒုၭၥုၭအလးအီၪဝ့ၫ လၧအမ့ၬယၫဒဲလၧအ ချိၫ့လခီၫဆ့တၭ, အၪ့မၩန့ၦရွံန့ဖိၪထီးအလူၬလၧအံၫ စရ့လၭအကျၩတၭ, တဲၩ့ဝဲၩဝ့ၫထၫ့ဒုၪဒၩ ၦစံရအၫဖိၪ",
			"10": "<sup>10</sup> လီၫ.-တၭၦအီၪလၩ့ထးလဖၪနီၪ, အီၪက့ၪဝ့ၫလၧအ ထၧၫ့ဖုဝဲစအၭဘၡဲၫအစူၪဖၧၩ့ ဘဲၫၥိၭအမိတဲၩ့ဝဲၩဝ့ၫ",
			"11": "<sup>11</sup> တၭထၫ့ဒုၪဒၩၦအၫမၧၫ့ဖိၪလီၫ.- စံၭဝ့ၫဒၪ, ၦစံရအၫ ဖိၪအ့ၪဆီၪ့နဲၪ့ဒံၭယၧၩတၭ, ထီးနီၪလဖၧၫ့ နဘၪဂဲၫ မၩဆၧၩ့ယၧၩ, အ့ၪမွဲၦအၫမၧၫ့ဖိၪ အ့ၪဆီၪ့နဲၪဒံၭနၧၩ",
			"12": "<sup>12</sup> တၭ,ထီးနီၪလဖၧၫ့ ယမိလ့ၩမၩဆၧၩ့နၧၩလီၫ.- အီၪ က့ၪဒူၩနၥၭဘီၪး မွဲပအီၪက့ၪဆီၪ့ၡီၩ့ပၥၭ လၧၦခမျၧး အဂး,ဒဲလၧပယွၩအဒိၩ့လဖၪအဂးဆံၭ. တၭမွဲယဟိ ဝၩမၩဆၧထီးဒၪအဂ့ၩလၧအမ့ၬယၫဆံၭ.",
			"13": "<sup>13</sup> စယိအၭဒဲၦခမျၧး အီၪလၧအစူၪဖၧၩ့ၥုၭဘူၭအၥၭ ဘဲၫၥိၭအမိဒုၭဆၧလၧၦစံရအၫဖိၪၥံၪတၭ, အဝ့ၫၥံၪ",
			"14": "<sup>14</sup> စဲၪ့ဖျိၭလၧအမ့ၬယၫလီၫ.- ထီးၦအၫမၧၫ့ဖိၪဒၪဘၪလၧ ၦစံရအၫဖိၪၥံၪစဲၪ့ဖျိၭတၭ, အဝ့ၫၥံၪစဲၪ့ဖျိၭဆ့လၧစအၭ ဘၡဲၫအမ့ၬယၫတၭ, လ့ၩနုၬလၧဒိၩ့ဖၧၩ့လီၫ. အခိး မွဲစယိအၭဂဲၫထဲၩ့လၧၦအၫမၧၫ့ဖိၪၥံၪ အအီၪတၭ ဂဲၫ ထီၩ့လၧယရုစလံၫ့လီၫ.",
			"15": "<sup>15</sup> ထီးၦစံရအၫဖိၪၥံၪဒၪဘၪ လၧအဘၪဆၧဖ့ၬခွံၬဝ့ၫ လၧအံၫစရ့လၭ အမ့ၬယၫတၭ အဝ့ၫၥံၪအီၪကိၩ့အီၪ",
			"16": "<sup>16</sup> ကီၪ့ဝ့ၫလီၫ.- စဟၫဒၭအံဇၧၫ အၪ့မၧၫ့လၩ့ဆၧတၭ, ကိၭန့ၦစံရအၫဖိၪၥံၪလၧအအီၪ လၧထံၫမိၡါဝါလခီၫ တၭ,အဝ့ၫၥံၪဂဲၫထီၩ့လၧဟ့လၫ့လီၫ. တၭစဟၫဒၭ အံဇၧၫအၡၩၥုၭမုအခိၪစၡိဘၭ လ့ၩလၧအဝ့ၫၥံၪအ",
			"17": "<sup>17</sup> မ့ၬယၫလီၫ.- ထီးၦလီၩဘၪစဒၫဝံၭတၭ, အဝ့ၫဒၪဒုၭ အီၪကီၪ့အံၫစရ့လၭထီးအလူၬတၭ, ခၫ့ဂၬယီၫဒၫ့နီၪ, ဂဲၫလၧဟ့လၫ့တၭ, ၦစံရအၫဖိၪၥံၪတဲၩ့ဝဲၩဆၧထၫ့ဒုၪ",
			"18": "<sup>18</sup> ဒၩစဒၫဝံၭတၭ, ဒုၭၥုၭလၧအဝ့ၫဒၪလီၫ.- ၦစံရအၫဖိၪ ၥံၪစဲၪ့လၧၦအံၫစရ့လၭဖိၪၥံၪအမ့ၬယၫတၭ, စဒၫဝံၭ မၩၥံၫၦစံရအၫဖိၪၥံၪအလဲၪ့ၥုၭအၡၩနွ့ၫယၩ, ဒဲၦက ၥ့ၪၥုၭဖိၪလံလၬတၭ, ဖ့ၬခွံၬၦၥုၭမုအခိၪ စၡိဘၭလၧ",
			"19": "<sup>19</sup> အၥံၫဝ့ၫထီးနီၪလီၫ.- ထီးစဎွၩၥံၪလၧအမွဲစဟၫဒၭအံ ဇၧၫအခ့ၫအၡၩကိၭဂၩဒ့ၭလဖၪနီၪ ဒၪဘၪလၧအဘၪ ဆၧဖ့ၬခွံၬဝ့ၫ လၧအံၫစရ့လၭအမ့ၬယၫနီၪ, အဝ့ၫၥံၪ မၩဘၪလိၬဆၧ လၧအံၫစရ့လၭတၭ, မၩအဝ့ၫၥံၪအ ဆၧလီၫ. အခိးမွဲၦစံရအၫဖိၪၥံၪၥၭမဲၪဝ့ၫနီၪ မၩဆၧၩ့ ၦအၫမၧၫ့ဖိၪဘုၪ့လၧၩ့အ့ၬ."
		},
		"11": {
			"1": "<sup>1</sup> ထီးနံၪ့ဆၧၫ့ထဲၩ့ အလးနီၪ, အဆၧၫ့အထီဘၪလၧ စဎွၩလဖၪလ့ၩထၪ့တၭ, ဆၧမၩအၥၭလၧစဒၫဝံၭအၪ့ မၧၫ့လၩ့စယိအၭ ဒဲအခ့ၫအၡၩအီၪလၧအစူၪဖၧၩ့, ဒဲ အံၫစရ့လၭထီးအလူၬတၭ, အဝ့ၫၥံၪမၩဂၭဂီၩ့ၦအၫ မၧၫ့ဖိၪတၭ,ဝၩ့ထၬရၭဘၫလီၫ. အ့ၪမွဲစဒၫဝံၭအီၪဒံၭ",
			"2": "<sup>2</sup> လၧယရုစလံၫ့အဖၧၩ့လီၫ.- ဆၧမၩအၥၭလၧမုဂၪလၩ့ နီၪ,စဒၫဝံၭဂဲထုၪ့လၧအလးမံၫခိၪတၭ, လဲးလီၩ့ဝ့ၫလၧ စဎွၩအဂံၪ့ခိၪလီၫ. တၭလၧအအီၪလၧဂံၪ့ခိၪနီၪ, ဒၪ ဘၪၦမုၪလဂၩ အၪ့လူထံၫလီၫ. တၭၦမုၪနီၪ ဎံၫလၩ",
			"3": "<sup>3</sup> ဂ့ၩမၬလီၫ.- စဒၫဝံၭအၪ့မၧၫ့ၦလ့ၩအၪ့စၪ့ဆၧလၧၦမုၪ နီၪအဂဲးအကၠီၪ့တၭ, ၦလဂၩစံၭဝ့ၫဒၪ, အယီၩမွဲစအံ လဲၫအၫ့အဖိၪမုၪနးဘၭၥၡ့ဘၫ, ၦဟံၥၭဖိၪစယုၫရဲအၫ",
			"4": "<sup>4</sup> အမၫနီၪ,မွဲအ့ၬဧၪ.- စဒၫဝံၭအၪ့မၧၫ့အၥီၫ့လဖၪမၩန့ ဝ့ၫတၭ,အဝ့ၫဂဲၫလၧအအီၪတၭ, အဝ့ၫဒၪမံၫဎုၬလၧအ ဝ့ၫနီၪလီၫ. (အဂဲးဘဲၫယီၩ ဆံၫ့ထၪ့ယူၭလၧအဆၧလ ဆံၫ့ဘၪနီၪယူၭ.) တၭၦမုၪနီၪ ထဲၩ့ထဲၩ့ဝ့ၫ လၧအဂံၪ့",
			"5": "<sup>5</sup> လီၫ.- ၦမုၪနီၪဒၧၩ့ထၪ့တၭ, အၪ့မၧၫ့လၩ့ ၦလီၩဘၪ",
			"6": "<sup>6</sup> စဒၫဝံၭတၭ, စံၭဝ့ၫဒၪ, ယဒၧၩ့ထၪ့ယူၭ.- စဒၫဝံၭအၪ့ မၧၫ့လၩ့ဆၧလၧစယိအၭတၭ, စံၭဝ့ၫဒၪ, အၪ့မၧၫ့လၩ့ ၦဟံၥၭဖိၪ စယုၫရဲအၫနီၪလၧယအီၪဆံၭ. တၭစယိ အၭအၪ့မၧၫ့လၩ့ စယုၫရဲအၫလၧစဒၫဝံၭ အအီၪလီၫ.",
			"7": "<sup>7</sup> ထီးစယုၫရဲအၫဂဲၫထီၩ့တၭ, စဒၫဝံၭအၪ့စၪ့ဝ့ၫလၧ စယိအၭအီၪမုၬဝ့ၫအဂဲးအကၠီၪ့, ဒဲလၧၦခမျၧးအအီၪ မုၬဝ့ၫအဂဲးအကၠီၪ့, ဒဲလၧဆၧဒုၭၥုၭနီၪ ဘီၪထၪ့ယီၫ",
			"8": "<sup>8</sup> ထၪ့အဂဲးအကၠီၪ့နီၪလီၫ.- တၭစဒၫဝံၭစံၭစယုၫရဲအၫ, လ့ၩလၩ့လၧနဂံၪ့ ဒဲၥူၫဝၭဆံၫ့နခၪ့ဆံၭ. တၭစယုၫရဲ အၫစဲၪ့လၩ့ခွံၬလၧစဎွၩအဂံၪ့တၭ, ဆၧအၪ့ဆၧအီၩ",
			"9": "<sup>9</sup> ဖိၬအခဲၫ့လၧစဎွၩဖ့ၪလၫ့ဝ့ၫလီၫ.- တၭစယုၫရဲအၫမံၫ ဝ့ၫထီးစဎွၩအဂံၪ့တရၫ့ထံၭ, အီၪလၧအကဆါ အခ့ၫ အၡၩထီးအလူၬအၥိၭတၭ, လ့ၩလၩ့လၧအဂံၪ့အ့ၬ.",
			"10": "<sup>10</sup> ၦလီၩဘၪစဒၫဝံၭတၭ, စံၭဝ့ၫဒၪ, စယုၫရဲအၫနီၪလ့ၩ လၩ့လၧအဂံၪ့အ့ၬ. တၭစဒၫဝံၭစံၭစယုၫရဲအၫ နလ့ၩ ဆၧနဂဲၫထဲၩ့မွဲအ့ၬဧၪ. နလလ့ၩလၩ့ဘၪ လၧနဂံၪ့မွဲ",
			"11": "<sup>11</sup> ဘၪလဲၪ.- စယုၫရဲအၫစံၭစဒၫဝံၭ, တလၫနီၪ,ဒဲအံၫစ ရ့လၭဒဲယုဒၫအီၪဝ့ၫ လၧတဲၩၥံၪအဖၧၩ့တၭ, ယကဆါ စယိအၭ,ဒဲယကဆါအခ့ၫအၡၩလဖၪ ၥုၪ့တဲၩလၧဆၧ ပျၩ့ဖၧၩ့တၭ, ယဝ့ၫဒၪယမိလ့ၩနုၬ လၧယဂံၪ့ဖၧၩ့ဘဲၫ ၥိၭယမိအၪ့ဆၧ, ဒဲအီၩဆၧ, ဒဲမံၫဎုၬလၧယမၫဆ့ဧၪ.",
			"12": "<sup>12</sup> နမၧၫ့နဝ့ၫဒဲနၥၭမၧၫ့ဝ့ၫ, ယမၩဆၧဘဲၫနီၪအ့ၬ.- တၭစ ဒၫဝံၭစံၭစယုၫရဲအၫ, အီၪထီးယီၩ မုလနံၩယီၩဆ့ တၭ,ကဲဂီၩလနံၩ ယမိဖျါခွံၬနၧၩလီၫ. တၭစယုၫရဲ အၫအီၪဝ့ၫလၧယရုစလံၫ့လၧမုလနံၩနီၪ, ဒဲလၧမုဆဲၪ့",
			"13": "<sup>13</sup> ထၪ့လနံၩနီၪလီၫ.- ထီးစဒၫဝံၭကိၭန့အဝ့ၫတၭ, အဝ့ၫ နီၪအၪ့ဆၧဒဲအီၩဆၧလၧအမ့ၬယၫတၭ, စဒၫဝံၭဒုၭ အီၩမၧၩ့ဝ့ၫတၭ, လၧမုဂၪလၩ့နီၪ မွဲအစဲၪ့ထၪ့မံၫလၧ အလးမံၫဖၧၩ့အီၪလၧ အကဆါအခ့ၫအၡၩအၥိၭတၭ, လ့ၩဝ့ၫလၧအဂံၪ့အ့ၬ.",
			"14": "<sup>14</sup> မုဆဲၪ့ထၪ့နီၪ ဆၧမၩအၥၭလၧစဒၫဝံၭ ကွ့ၭန့စယိ အၭအလံၬလဘံၪ့တၭ, ဖ့ၪယုဝ့ၫလၧစယုၫရဲအၫအစူၪ",
			"15": "<sup>15</sup> ဖၧၩ့လီၫ.- ကွ့ၭဝ့ၫလၧလံၬဖၧၩ့နီၪ, စံၭဝ့ၫဒၪ, လၧဆၧ ဒုၭၥုၭဆီၪ့ဆီၪ့လ့ၬအဖၧၩ့နီၪ အီၪက့ၪစယုၫရဲအၫလၧ ယၫလခီၫတၭ, ဂဲၫထဲၩ့စဲၪ့ဒၪခွံၬအဝ့ၫ, ဘဲၫၥိၭအမိဘၪ ဆၧဖ့ၬခွံၬဝ့ၫ, ဒဲၥံၫနီၪဆံၭ.",
			"16": "<sup>16</sup> ထီးစယိအၭယိဒိၩ့နီၪတၭ, ဆၧမၩအၥၭလၧအအီၪ က့ၪလၩ့စယုၫရဲအၫထီးအလး လၧအၥ့ၪယၫၦအဆီၪ့",
			"17": "<sup>17</sup> လဖၪအီၪဝ့ၫလီၫ.- တၭၦဒိၩ့ဖိၪလဖၪ လ့ၩထၪ့ဒုၭဆၧ လၧစယိအၭတၭ, ၦလၧစဒၫဝံၭအခ့ၫအၡၩ အကျၩ လၩ့ထံၩဖါဝ့ၫ, ဒဲၦဟံၥၭဖိၪစယုၫရဲအၫၥံၫဝ့ၫဆ့လီၫ.",
			"18": "<sup>18</sup> စယိအၭအၪ့မၧၫ့လၩ့ဆၧတၭ, လီၩဘၪစဒၫဝံၭလၧ ကယဲဆၧဘၪဆဲၫ့လၧဆၧဒုၭၥုၭ ထီးအလူၬနီၪလီၫ.",
			"19": "<sup>19</sup> တၭအဝ့ၫမၪလူၬအၥီၫ့လဂၩနီၪ, စံၭဝ့ၫဒၪ, ထီးနလီၩ ထဲၩ့ဆၧဘၪဆဲၫ့လၧဆၧဒုၭၥုၭနီၪ လၧစဎွၩဂီၩ့တၭ,",
			"20": "<sup>20</sup> စဎွၩအၥၭအ့ၪထၪ့တၭစံၭနၧၩ, ထီးနၥံၪဒုၭၥုၭတၭ,န ၥံၪၥုၭဘူၭနၥံၪအၥၭ လၧဒိၩ့ဖိၪနီၪ,မွဲဘၪလဲၪ. ၦလၧ ဒိၩ့ခိၪဒၧၩ့နီၪမိခၭဆၧတၭ, မွဲနၥံၪလၥ့ၪယၫဘၪဧၪ.",
			"21": "<sup>21</sup> မွဲပလၫဖ့ၬခွံၬစယရၧၭဘၡ့ၭ အဖိၪခွၫစအဘံမလ့ၭလ ဂၩလဲၪ. ၦမုၪလဂၩခွံၬလၩ့ဒိၭအဝ့ၫ လၧဆုၪ့ဂူၬလိးလ ကဲၩ့လၧဒိၩ့ခိၪဒၧၩ့အလီၩ့တၭ, ၥံၫဝ့ၫလၧၥ့ဘ့ၭနီၪမွဲ အ့ၬဧၪ. နၥံၪလ့ၩဘူၭ လၧဒိၩ့ခိၪဒၧၩ့နီၪ, မွဲဘၪလဲၪ, ထီးနီၪလဖၧၫ့စံၭနဝ့ၫ, နခ့ၫနၡၩၦဟံၥၭဖိၪ စယုၫရဲအၫ လဂၩနီၪၥံၫဆ့ယူၭ.",
			"22": "<sup>22</sup> အခိးမွဲအၥီၫ့လဂၩနီၪလ့ၩဝ့ၫတၭ, ဂဲၫထဲၩ့လီၩဘၪ စဒၫဝံၭ ကယဲဆၧလၧစယိအၭ အၪ့မၧၫ့လၩ့ဝ့ၫလီၫ.",
			"23": "<sup>23</sup> အၥီၫ့လဂၩနီၪ စံၭစဒၫဝံၭ, ၦၡၩၥံၪနီၪ မၩနၧၩ့တၡါ ပၧၩတၭ,ဂဲၫထၪ့ထီၩ့လၧပအီၪလၧဆၧပျၩ့ဖၧၩ့တၭ,",
			"24": "<sup>24</sup> ပလီၩ့ဒုၭအဝ့ၫၥံၪထီၩ့လၧ တရၫ့ထံၭလီၫ.- တၭၦခၭ ဆၧလဖၪလၧဒိၩ့ခိၪဒၧၩ့နီၪ ခၭနခ့ၫနၡၩတၭ, စဎွၩအ ခ့ၫအၡၩလဖၪၥံၫယူၭ, ဒဲနခ့ၫနၡၩၦဟံၥၭဖိၪစယုၫရဲ",
			"25": "<sup>25</sup> အၫၥံၫဆ့ယူၭ.- ထီးနီၪလဖၧၫ့ စဒၫဝံၭစံၭအၥီၫ့နီၪ,န ဘၪစံၭစယိအၭဘဲၫယီၩ, မွဲဆၧယီၩ ထီးကဲၪထၪ့ဆၧ အၧၩ့လၧနမ့ၬယၫလဂ့ၩ, အဂဲးဘဲၫယီၩ ဖၩ့ၥံၪနၭၥံၪ အၪ့အယီၩလဂၩ ဘဲၫအနီၪလဂၩအၥိၭလီၫ. ဒုၭဆီၪ့ ဒံၭထၫ့ဒုၪဒၩဒိၩ့နီၪတၭ, မၩဂၭဂီၩ့ဆံၭ. တၭဒုၭဆီၪ့ ထၪ့အဝ့ၫဒၪအၥုၪ့အၥၭဆံၭ.",
			"26": "<sup>26</sup> တၭထီးစယုၫရဲအၫအမၫနါဂၧၫ့ဝ့ၫ လၧအဝၩစ ယုၫရဲအၫၥံၫယူၭတၭ, ဒဲၩလၩ့အၥၭနၫၡါ လၧအဝၩအ",
			"27": "<sup>27</sup> ကၠီၩ့လီၫ.- ဂၪ့ဆၧယၧၩ့ဆၧဖီၩ့ခွံၬတၭ, စဒၫဝံၭအၪ့ မၧၫ့လၩ့ဆၧတၭ, မၩန့ဝ့ၫလၧအဂံၪ့ဖၧၩ့တၭ, အဝ့ၫ ကဲၪထၪ့အမၫတၭ, အီၪဖျဲၪန့ဝ့ၫအဖိၪခွၫလီၫ. တၭဆၧ လၧစဒၫဝံၭမၩဝ့ၫနီၪ, မွဲဆၧအၧၩ့ လၧယဟိဝၩအမ့ၬ ယၫလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> တၭယဟိဝၩအၪ့မၧၫ့လၩ့စနၫၥၫ့ လၧစဒၫဝံၭအအီၪ လီၫ. ထီးအဂဲၫလၧအအီၪတၭ, စံၭအဝ့ၫ,ၦနံၫဂၩအီၪ လၧဒိၩ့လဖျိၪ့ဎးလီၫ. အလဂၩမွဲၦၥထံၫတၭ, အဝ့ၫလ",
			"2": "<sup>2</sup> ဂၩမွဲၦၡၪ့ဖိၪယၬဖိၪလီၫ.- တၭၦၥထံၫလဂၩနီၪအီၪ",
			"3": "<sup>3</sup> လၧချီၥံၪ, ၥိၪၥံၪဘ့ၪၥံၪအၪအၪလ့ၬလီၫ.- ၦၡၪ့ဖိၪယၬ ဖိၪလဂၩနီၪ အဆၧအီၪနးဒုၩအ့ၬ. အီၪဝ့ၫန့ၫၥိၪမိဖိၪ လၧအဎွ့ၩန့ဝ့ၫတၭ, အၪ့ဘုၪဝ့ၫလဒုၩလီၫ. တၭ ဒိၪ ထၪ့လၧအဝ့ၫအၥိၭ ဒဲလၧအဖိၪအလံၩအၥိၭနီၪး အၪ့ အဝ့ၫဒၪအဆၧအၪ့ဒၪဝ့ၫ, ဒဲအီၩဆၧလၧအဝ့ၫဒၪ အ လိၫ့အဖၧၩ့တၭ, မံၫနၩ့လၧအၥၭနၫၡါအဖၧၩ့တၭ,ကဲၪ",
			"4": "<sup>4</sup> ထၪ့လၧအဂးဘဲၫအဖိၪမုၪဒၪဝ့ၫအၥိၭနီၪလီၫ.- တၭၦ လ့ၩဆၧလဂၩဂဲၫထီၩ့လၧ ၦၥထံၫအအီၪတၭ, အဝ့ၫဒၪ လီၫ့ကီၩ့အၥိၪဒၪဝ့ၫ, အဘ့ၪဒၪဝ့ၫ, ဒဲအချီၥံၪဒၪဝ့ၫ,လၧ အမိတဲၩ့ဝဲၩဆၧလၧၦဖိၬဖၧၩ့ၥၭ လၧအဂဲၫလၧအအီၪ လဂၩအဂးတၭ, အၪ့မၩန့ၦၡၪ့ဖိၪယၬဖိၪအၥိၪလဒုၩ နီၪတၭ,တဲၩ့ဝဲၩဝ့ၫလၧ ၦဂဲၫလၧအအီၪလဂၩ အဂး လီၫ.",
			"5": "<sup>5</sup> စဒၫဝံၭအၥၭထၪ့ ခဲၩထၪ့ဘၪၦလဂၩနီၪ ဒိၪဒိၪလ့ၬ တၭ,စံၭစနၫၥၫ့, ယဟိဝၩမၧၫ့ဝ့ၫ, ၦလၧအမၩဆၧလ",
			"6": "<sup>6</sup> မံၩ့နီၪ,မွဲအမိဘၪၥံၫတၡါလီၫ.- တၭမိဘၪဖ့ၪလၫ့ထဲၩ့ ၥိၪဖိၪနီၪလံစၩ လၧအမၩဆၧနီၪအကၠီၩ့, ဒဲလၧအလ ယၫ့ၥၭဘၪဆၧအကၠီၩ့လီၫ.",
			"7": "<sup>7</sup> စနၫၥၫ့စံၭစဒၫဝံၭနီၪ, နဝ့ၫဒၪယီၩနမွဲၦၡၩလဂၩနီၪ လီၫ.ယဟိဝၩအံၫစရ့လၭအယွၩ စံၭဝ့ၫဘဲၫယီၩ, ယ ဂုၪနၧၩလၧစဎွၩ လၧအံၫစရ့လၭအဖၫ့ခိၪတၭ, ယမၩ",
			"8": "<sup>8</sup> ဖီၩ့မၩဖျ့ၭနၧၩ, လၧစစီလူၫအစူၪဖၧၩ့တၭ,- ယဖ့ၪလၫ့ နၧၩလၧနကဆါအဂံၪ့ ဒဲနကဆါအမၫလဖၪလၧနၥၭနၫ ၡါအဖၧၩ့, ယဖ့ၪလၫ့နၧၩလၧအံၫစရ့လၭ ဒဲယုဒၫအဂံၪ့, အ့ၪၡၩလၨၪတၭ, ယမိဖ့ၪလၫ့နၧၩ ဆၧဘဲၫအံၩဘဲၫ",
			"9": "<sup>9</sup> အိၩလၧအဖၫ့ခိၪဒံၭလီၫ.- အခိးမွဲနလဒူၩလယၪ့ဘၪ ယဟိဝၩအဆၧမၪလူၬတၭ, နမၩဆၧအၧၩ့ လၧအမ့ၬ ယၫနီၪ,မွဲဘၪလဲၪ. နမၩၥံၫၦဟံၥၭဖိၪစယုၫရဲအၫလၧ နၭတၭ,နမၩန့အမၫလၧအမိကဲၪနမၫတၭ, နမၩၥံၫအ",
			"10": "<sup>10</sup> ဝ့ၫလၧၦအၫမၧၫ့ဖိၪအနၭလီၫ.- အခိးမွဲဘဲၫနီၪတၭဘိၩ့ နဲၪ့ယီၩ,နၭၥံၪဖၩ့ၥံၪမိစဲၪ့ဒၪနဂံၪ့နးဆိၭအ့ၬ. အဂဲးဘဲၫ ယီၩနမၩကြၩ့ထမးယၧၩတၭ, နမၩန့ၦဟံၥၭဖိၪစယုၫ",
			"11": "<sup>11</sup> ရဲအၫအမၫလၧအမိကဲၪနမၫလီၫ.- ယဟိဝၩစံၭဝ့ၫဘဲၫ ယီၩ,ယိခွါ, ယမိဒုၭအီၪထၪ့ဆၧအၧၩ့ လၧနဂံၪ့ဒၪနဝ့ၫ အဖၧၩ့တၭ, ယမိမၩန့နမၫလဖၪ လၧနမ့ၬယၫတၭ,မိ ဖ့ၪလၫ့အဝ့ၫၥံၪလၧၦလၧနနဲၩ့ထံၭတၭ, အဝ့ၫဒၪမိမံၫ",
			"12": "<sup>12</sup> ဎုၬနမၫလဖၪ လၧမုယီၩအမ့ၬယၫလီၫ.- နဝ့ၫဒၪနမၩ ဆၧအီၪၥူၪ, အ့ၪမွဲယဝ့ၫဒၪယီၩယမိမၩဆၧလမံၩ့ယီၩ လၧအံၫစရ့လၭထီးအလူၬအမ့ၬယၫ, ဒဲလၧမုအမ့ၬ ယၫလီၫ.",
			"13": "<sup>13</sup> စဒၫဝံၭစံၭစနၫၥၫ့, ယမၩမၪဘၪယူၭယဟိဝၩယူၭ, တၭ,စနၫၥၫ့စံၭစဒၫဝံၭ, ယဟိဝၩမၩဖီၩ့မၩဖျ့ၭနဆၧဒဲၩ",
			"14": "<sup>14</sup> ဘၭယူၭ, နၥံၫဘၪအ့ၬ.- မွဲလါနၫ့လၧဆၧမၩလမံၩ့ယီၩ အကၠီၩ့နီၪနဖ့ၪလၫ့ယူၭ ယဟိဝၩ အဒုၪအဒၩလၧဆၧ ဒုၪဒွ့ၪအလးဖၭဒိၪ, အခိးမွဲဖိၪၥၪလၧအမိအီၪဖျဲၪလၧ နဂးနီၪမိၥံၫတၡါလီၫ.",
			"15": "<sup>15</sup> တၭစနၫၥၫ့ထဲၩ့ထဲၩ့ဝ့ၫလၧအဂံၪ့လီၫ. တၭယဟိဝၩ ကျီၪ့ဖိၪၥၪ လၧစယုၫရဲအၫအမၫအီၪဖျဲၪန့ လၧစဒၫဝံၭ",
			"16": "<sup>16</sup> အဂးနီၪ, ဆၫဝ့ၫနၭမၬလီၫ.- အခိးမွဲစဒၫဝံၭအၪ့ယၫ ယွၩလၧဖိၪၥၪအဂးတၭ, စဒၫဝံၭ ဒုၪဆၧအၪ့ဆၧအီၩ တၭ,လ့ၩနုၬဝ့ၫတၭမံၫနၩ့ လၧဂၪ့ခိၪလီၩ့ ၥၫ့နၩချီၩ့",
			"17": "<sup>17</sup> လီၫ.- အၡၩဂံၪ့ဖိၪအၥုၪ့က့ၭၥၭၡါဂဲထုၪ့တၭ, လ့ၩလၧ အအီၪ ဘဲၫၥိၭအမိဘိၭဂဲထုၪ့ဝ့ၫလၧဂၪ့ခိၪ, အ့ၪမွဲအ ဝ့ၫဒၪအုၩ့လၩ့ဝ့ၫအ့ၬ, တၭအၪ့ဆၧလၧအဝ့ၫၥံၪအၥိၭ",
			"18": "<sup>18</sup> ဆ့အ့ၬ.- တၭမုနွ့ၫနံၩလနံၩနီၪဆၧမၩအၥၭလၧဖိၪၥၪ နီၪၥံၫဝ့ၫလီၫ. ဖိၪၥၪနီၪၥံၫယူၭတၭ, စဒၫဝံၭအခ့ၫအၡၩ လီၩဘၪအဝ့ၫဘုၪ့ဝါအ့ၬ. အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪစံၭ ဝ့ၫဒၪ,ယိခွါ, လၧဖိၪၥၪမၧၫ့ဒံၭအဘိၩ့ဘၭနီၪ, ပချဲၩ့ဆၧ လၧအဝ့ၫတၭ, ခိၭနၪပလူအ့ၬ, ပအ့ၪလီၩဘၪဖိၪၥၪၥံၫ",
			"19": "<sup>19</sup> ယူၭနီၪတၭ, မွဲအမိမၩၡၪ့လၩ့အၥၭဆံၭအၪလဲၪ.- ထီး စဒၫဝံၭဒၪဘၪအခ့ၫအၡၩချဲၩ့ဘံၪၥွံၪနီၪ, စဒၫဝံၭနၪၥ့ၪ လၧဖိၪၥၪၥံၫယူၭတၭ, စဒၫဝံၭစံၭအခ့ၫအၡၩ, မွဲဖိၪၥၪ နီၪၥံၫယူၭဧၪ. တၭအဝ့ၫၥံၪစံၭ, ၥံၫယူၭဝ့ၫယူၭ.",
			"20": "<sup>20</sup> ထီးနီၪလဖၧၫ့ စဒၫဝံၭဂဲထုၪ့ထၪ့ထဲၩ့လၧဂၪ့ခိၪ,ၥူၫ ဝၭဆံၫ့အၥၭ လၧထံၫဒဲဂုၪအၥၭ ဒဲလုထၪ့အၥၭတၭ, ဂဲၫနုၬလၧယဟိဝၩ အဂံၪ့ဖၧၩ့တၭ, ဘိၪ့ထၪ့ဘၩထၪ့ ဆၧလီၫ. ထီးနီၪလဖၧၫ့ ဂဲၫနုၬလၧအဂံၪ့ ဒၪဝ့ၫတၭ, အၪ့မၧၫ့ဆၧတၭ, ၦအီၪက့ၪဆၧအၪ့ လၧအမ့ၬယၫနီၪ, အဝ့ၫဒၪအၪ့ဆၧလီၫ.",
			"21": "<sup>21</sup> တၭအခ့ၫအၡၩစံၭအဝ့ၫ, နမၩဆၧယီၩ,မွဲဆၧနီၪ လမံၩ့လဲၪ. နဒုၪဆၧအၪ့ဆၧအီၩတၭး နဂၪ့လၧဖိၪၥၪ အကၠီၩ့လၧအမၧၫ့ဒံၭအဘိၩ့ဘၭ, အ့ၪမွဲထီးဖိၪၥၪၥံၫ",
			"22": "<sup>22</sup> တၭ,နဂဲထုၪ့အၪ့ဆၧမၬလဲၪ.- တၭအဝ့ၫဒၪစံၭဝ့ၫ,ဖိၪ ၥၪမၧၫ့ဒံၭအဘိၩ့ဘၭနီၪ, ယဒုၪဆၧအၪ့ဆၧအီၩ,ဒဲယ ဂၪ့လီၫ.အဂဲးဘဲၫယီၩ ယစံၭ,ယွၩမိယၫ့ၥၭယၧၩ,ဒဲဒုၭ",
			"23": "<sup>23</sup> မၧၫ့ဒံၭဖိၪၥၪဧၪနီၪ, မွဲပလၫၥ့ၪယၫလဂၩလဲၪ.- အ့ၪမွဲ ဘိၩ့နဲၪ့ယီၩ ၥံၫယူၭဝ့ၫယူၭ ယမိဒုၪဆၧအၪ့ဆၧအီၩ နီၪ,မွဲဘၪလဲၪ, ယဒုၭဂဲၫထဲၩ့ထဲၩ့ဘၪမိၥ့ၪဧၪ. ယမိဘၪ လ့ၩလၧအအီၪ, အ့ၪမွဲအဝ့ၫဒၪမိဂဲၫထဲၩ့ လၧယအီၪ အ့ၬ.",
			"24": "<sup>24</sup> စဒၫဝံၭမၩမုၬထၪ့ထဲၩ့အမၫနးဘၭၥၡ့ဘၫတၭ, လ့ၩ နုၬလၧအအီၪနီၪ, မံၫဎုၬလၧအဝ့ၫတၭ, အဝ့ၫအီၪဖျဲၪန့ အဖိၪခွၫလဂၩဖျိၬဝ့ၫအမံၩ့ လၧစစီလမၧၫ့တၭ, ယဟိ",
			"25": "<sup>25</sup> ဝၩအဲၪအဝ့ၫလီၫ.- အဝ့ၫအၪ့မၧၫ့လၩ့ဆၧလၧမီၪစနၫၥၫ့ အစူၪတၭ, ဖျိၬအမံၩ့လၧစယ့ၭဒဒဲအၫ, လၧယဟိဝၩ အကၠီၩ့လီၫ.",
			"26": "<sup>26</sup> စယိအၭဒုၭဆၧထၫ့ဒုၪဒၩရၭဘၫ ဘၪဆဲၫ့လၧၦအၫ",
			"27": "<sup>27</sup> မၧၫ့ဖိၪတၭ, မၩန့စဎွၩအဒိၩ့လီၫ.- စယိအၭအၪ့မၧၫ့ လၩ့အၥီၫ့လဖၪလၧစဒၫဝံၭအအီၪတၭ စံၭဝ့ၫဒၪ,ယဒုၭ ဆၧလၧရၭဘၫတၭ, မၩန့ယူၭဒိၩ့အီၪလၧကမၫလဖၪ",
			"28": "<sup>28</sup> လီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ဒုၭအီၪကိၩ့အီၪကီၪ့ၦခမျၧး လၧအအီၪလၩ့ထးလဖၪနီၪ, ၥုၪ့တဲၩထၫ့ဒုၪဒၩဒိၩ့တၭ, မၩန့ဝ့ၫဆံၭး ဘၪလဘၪယမိမၩန့ဘၪခိၬဒိၩ့တၭ, ၦမိ",
			"29": "<sup>29</sup> ဖျိၬအမံၩ့ဘဲၫယမံၩ့အၥိၭလီၫ. စဒၫဝံၭဒုၭအီၪကိၩ့အီၪ ကီၪ့ၦခမျၧးထီးအလူၬတၭ, လ့ၩဝ့ၫလၧရၭဘၫတၭ,",
			"30": "<sup>30</sup> ဒုၭဆၧထၫ့ဒၩဝ့ၫတၭ, မၩန့ဝ့ၫလီၫ.- တၭဘျူၭလၩ့န့ အဝ့ၫၥံၪအစဎွၩအၥရဖူၩလၧအခိၪဎွံၪလီၩ့, အလယၧး နီၪမွဲထီၫ့လကံကၫဒဲအမနံၬလဖၪလီၫ. တၭၦအီၪက့ၪ ဝ့ၫလၧစဒၫဝံၭ အခိၪဎွံၪလီၫ. တၭဆၧဖိၪဆၧလံၩ လၧ အအၪ့ဂူၬန့ဝ့ၫ လၧဒိၩ့ဖၧၩ့လဖၪနီၪ ဂဲၫဆိၬထၪ့ခွံၬဝ့ၫ",
			"31": "<sup>31</sup> အၪအၪလ့ၬလီၫ.- တၭဂဲၫဆိၬထၪ့ၦလၧအအီၪလၧအ ဖၧၩ့လဖၪဒုၭကဲၪထၪ့ဝ့ၫ လၧၦဂူၬလွၭ, ဒဲမၩလၧခရါ ၥံၪ,ဒဲလၧကွၩၥံၪအဆၧမၩနီၪ ဒဲလၧၦမၩအၩ့ကတဲၩ ဆ့လီၫ. မွဲအမၩၦအၫမၧၫ့ဖိၪအဒိၩ့ ဘဲၫနီၪအၥိၭ ထီး အလူၬလီၫ. တၭစဒၫဝံၭဒဲၦထီးအလူၬ ဂဲၫထဲၩ့ဝ့ၫထီး လၧယရုစလံၫ့လီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ဆၧနီၪအလးခဲၫ့ ဆၧမၩအၥၭ လၧစဒၫဝံၭအဖိၪခွၫ စအၭဘစလၧၫ့အီၪလၧအထၧၫ့ဖုဝဲမုၪလဂၩ လၧအခံး အဂၩ့ဂ့ၩ, အမံၩ့မွဲနးတၫမၫတၭ, စဒၫဝံၭအဖိၪခွၫစအၫ",
			"2": "<sup>2</sup> မနၧၫ့အဲၪဝ့ၫလီၫ.- တၭစအၫမနၧၫ့အၥုၪ့ခိအၥၭဝီၩ ထီးအဆၫထၪ့ဝ့ၫလၧအထၧၫ့ဖုဝဲမုၪ နးတၫမၫအကၠီၩ့ လီၫ.အဂဲးဘဲၫယီၩမွဲၦမုၪနၩ့လဂၩတၭ, မၩဆၧလၧ အဝ့ၫလမံၩ့မံၩ့နီၪကၪလၧ စအၫမနၧၫ့အမ့ၬယၫလီၫ.",
			"3": "<sup>3</sup> စအၫမနၧၫ့အီၪလၧအထံၩအၥိၭလဂၩ, အမံၩ့မွဲစယီန ဒၭ,စဒၫဝံၭအထၧၫ့ဖုဝဲ စၡံမအၫအဖိၪခွၫလီၫ. တၭ",
			"4": "<sup>4</sup> စယီနဒၭနီၪ မွဲၦကိၪ့ဆၧၥ့ၪမၬလဂၩလီၫ.- တၭအဝ့ၫ ဒၪစံၭအဝ့ၫ စဎွၩအဖိၪခွၫနဝ့ၫဒၪယီၩ, နဎွ့လၩ့လနံၩ ဘၪလနံၩနီၪမွဲအဘၪ ဆၧနီၪလမံၩ့လဲၪ. နလီၩဘၪ ယၧၩအ့ၬဧၪ. တၭစအၫမနၧၫ့စံၭအဝ့ၫ, ယအဲၪယထၧၫ့ ဖုဝဲမုၪစအၭဘစလၧၫ့အထၧၫ့ဖုဝဲမုၪ နးတၫမၫနီၪ",
			"5": "<sup>5</sup> လီၫ.- စယီနဒၭစံၭအဝ့ၫ, မံၫနၩ့လၧနလးမံၫဖၧၩ့တၭ, ကျဲၩ့မၩဆၫနၥၭ, ထီးနဖါဂဲၫအၪ့စၪ့နၧၩတၭ, စံၭအ ဝ့ၫ,ဒုၭဂဲၫလါယထၧၫ့ဖုဝဲမုၪနးတၫမၫ, လၧအမိဖ့ၪလၫ့ ယၧၩလၧဆၧအၪ့ ဒဲတဲၩ့ဝဲၩဆၧလၧယမ့ၬယၫဘဲၫၥိၭ",
			"6": "<sup>6</sup> ယမိဒၪဘၪဆၧလၧအစူၪဖၧၩ့ဆံၭ.- စအၫမနၧၫ့မံၫနၩ့ ကျဲၩ့မၩဆၫအၥၭတၭ, ထီးစဎွၩဂဲၫယိဝ့ၫနီၪ စအၫမ နၧၫ့စံၭစဎွၩ, ဒုၭဂဲၫလါယထၧၫ့ဖုဝဲမုၪနးတၫမၫလၧအ မိမၩန့ယၧၩ လၧကိၪပၪပဲၪနံၫဘံၪ့ လၧယမ့ၬယၫဘဲၫ ၥိၭယမိအၪ့ဆၧလၧအစူၪဖၧၩ့နီၪဆံၭ.",
			"7": "<sup>7</sup> ထီးနီၪလဖၧၫ့စဒၫဝံၭအၪ့မၧၫ့လၩ့ ဆၧလၧနးတၫမၫ အဂံၪ့တၭ, စံၭဝ့ၫဒၪ, လ့ၩလၧနထၧၫ့ဖုဝဲစအၫမနၧၫ့အ",
			"8": "<sup>8</sup> ဂံၪ့တၭ,တဲၩ့ဝဲၩန့အဝ့ၫဒၪအဆၧအၪ့ဆံၭ.- အခိးမွဲနး တၫမၫလ့ၩဝ့ၫလၧအထၧၫ့ဖုဝဲ စအၫမနၧၫ့အဂံၪ့တၭ, အဝ့ၫဒၪမံၫနၩ့ဝ့ၫလီၫ. တၭအဝ့ၫဒၪ မၩန့ကိၪမုၬတၭ, ဘံၭဝ့ၫတၭမၩကိၪပၪပဲၪလၧအမ့ၬယၫတၭ, အၪ့ဎူကိၪ ပၪပဲၪၥံၪလီၫ.",
			"9": "<sup>9</sup> တၭမၩန့ဆၧပၪပဲၪနီၪ, ဂါလၩ့န့ဝ့ၫလၧအမ့ၬယၫး မွဲလါနၫ့ဘိၩစအၫမနၧၫ့ မိအၪ့ဘၪအၥၭအ့ၬ. တၭစံၭ ဝ့ၫဒၪ,မွဲၦခွၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧယအီၪထီးအလူၬဆံၭ. တၭၦခွၫၥံၪစဲၪ့ထၪ့ခွံၬ လၧအအီၪ ကိၭဂၩဒ့ၭလီၫ.",
			"10": "<sup>10</sup> စအၫမနၧၫ့စံၭနးတၫမၫ, ဂဲၫဆိၬဆၧအၪ့လၧဒူၭဖၧၩ့ တၭ,ယမိအၪ့ဆၧလၧနစူၪဖၧၩ့လီၫ. တၭနးတၫမၫမၩ န့ကိၪပၪပဲၪ လၧအမၩယူၭတၭ, ဂဲၫဆိၬဝ့ၫ လၧအဒူၭ",
			"11": "<sup>11</sup> ဖၧၩ့လၧအထၧၫ့ဖုဝဲ စအၫမနၧၫ့အအီၪလီၫ.- ထီးအ ဂဲၫဆိၬဝ့ၫဘဲၫၥိၭ အမိအၪ့ဘၪတၭ, အဝ့ၫဒၪဖီၪ့န့ဝ့ၫ တၭ,စံၭအဝ့ၫဂဲၫမံၫဎုၬလၧယၧၩဆံၭ, ယထၧၫ့ဖုဝဲမုၪ",
			"12": "<sup>12</sup> ဧ့,- တၭၦမုၪစံၭဆၧၫ့ဝ့ၫ,မွဲအ့ၬ, ယထၧၫ့ဖုဝဲခွၫဧ့,ထီး ဆၪ့လၩ့ယၧၩလဂ့ၩ, အဂဲးဘဲၫယီၩ မၩဆၧဘဲၫနီၪ လၧအံၫစရ့လၭအဖၧၩ့ဂ့ၩအ့ၬ. မၩၦဂၭဂီၩ့ဖိၪအဆၧ",
			"13": "<sup>13</sup> မၩလမံၩ့ယီၩလဂ့ၩ.- တၭယဝ့ၫဒၪယမိဒုၭစဲၪ့ထၪ့ခွံၬ ယဆၧမ့ၬမဲဘဲၫၥ့ၪလဲၪ. တၭနဝ့ၫဒၪ နမိကဲၪထၪ့ဘဲၫ ၦဂၭဂီၩ့ဖိၪလဂၩ အၥိၭလၧအံၫစရ့လၭ အဖၧၩ့လီၫ. တၭဘိၩ့နဲၪ့ယီၩ ချဲၩ့ဆၧလၧစဎွၩဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫမိပဒၩ့ယၧၩလၧနၧၩအ့ၬ.",
			"14": "<sup>14</sup> မွဲလါနၫ့ဘိၩအဝ့ၫခိၭနၪအလူအၥၭအီၪအ့ၬ. အ့ၪမွဲ လၧအဆီၪ့နဲၪ့အဝ့ၫဒၪအကၠီၩ့တၭ, ဆၪ့လၩ့ဆီၪ့ဝ့ၫ",
			"15": "<sup>15</sup> တၭ,မံၫဎုၬဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့စအၫမနၧၫ့ၥၭဂဲၫ့ အဝ့ၫဒိၪဒိၪလ့ၬ ထီးဆၧၥၭဂဲၫ့ လၧအၥၭဂဲၫ့ဝ့ၫနီၪဒိၪ နဲၪ့ဆၧအဲၪလၧအအဲၪယူၭဝ့ၫနီၪလီၫ. တၭစအၫမနၧၫ့ စံၭအဝ့ၫး ဂဲထုၪ့စဲၪ့ထၪ့ခွံၬဘီၪ. တၭအဝ့ၫနီၪ စံၭဝ့ၫ, အလးအီၪအ့ၬ.",
			"16": "<sup>16</sup> ဆၧအၧၩ့လၧနနၫ့ထၪ့ခွံၬယၧၩယီၩ ဒိၪနဲၪ့ဆၧဂူၫ ဂၩလမံၩ့ လၧနမၩယၧၩဒံၭလီၫ. တၭခိၭနၪအလူနီၪ",
			"17": "<sup>17</sup> အၥၭအီၪအ့ၬ.- တၭကိၭန့အခ့ၫအၡၩလဂၩ လၧအ မၩအခ့ၫအၡၩအဆၧတၭ, စံၭဝ့ၫဒၪ, နၫ့ထၪ့ခွံၬၦလ ဂၩယီၩလၧယအီၪတၭ, ဆ့ၭထၬတရၫ့ လၧအဝ့ၫဒၪအ",
			"18": "<sup>18</sup> လးခဲၫ့ဆံၭ.- တၭၦမုၪနီၪၥိၭအဆဲၫ့ကံၪကဲၩ့လီၫ. အ ဂဲးဘဲၫယီၩ စဎွၩအဖိၪမုၪအမုၪနၩ့ၥံၪ ၥိၭဆဲၫ့ဘဲၫနီၪ လီၫ. တၭအခ့ၫအၡၩ ဒုၭစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧခီၫ့တၭ, ဆ့ၭထၬတရၫ့လၧအဝ့ၫဒၪအလးခဲၫ့လီၫ.",
			"19": "<sup>19</sup> နးတၫမၫအီၪက့ၪထၪ့ဖံၫ့ချၪ လၧအခိၪဎွံၪတၭ, ၡၫ့ အဆဲၫ့ကံၪကဲၩ့လၧအၥိၭဝ့ၫနီၪ, အီၪက့ၪအစူၪလၧအ ခိၪဎွံၪတၭ, ထဲၩ့လခီၫဂၪ့လခီၫလီၫ.",
			"20": "<sup>20</sup> တၭအထၧၫ့ဖုဝဲ စအၭဘစလၧၫ့စံၭအဝ့ၫ, မွဲနထၧၫ့ဖု ဝဲစအၫမနၧၫ့အီၪယူၭလၧနၥိၭဆ့ဧၪ. မွဲလါနၫ့ဘိၩ့နဲၪ့ ယီၩ,အီၪလၩ့မါပံၭဘီၪ, ယထၧၫ့ဖုဝဲမုၪဧ့း အဝ့ၫဒၪ ထၧၫ့ဖုဝဲလၧနၧၩတၭ, အီၪက့ၪဆၧလမံၩ့နီၪလၧဆၧနး မံၩ့လဂ့ၩ, ဧီၪး အခိးမွဲနးတၫမၫအီၪလၧအထၧၫ့ဖုဝဲစ အၭဘစလၧၫ့အဂံၪ့ဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> အ့ၪမွဲစဎွၩနါဂၧၫ့ဆၧလဖၪနီၪ ထီးအလူၬတၭ,အ ၥၭထၪ့ဒိၪမၬလီၫ.",
			"22": "<sup>22</sup> တၭလၧဆၧအၧၩ့မွဲဂ့ၩ, လၧဆၧဂ့ၩမွဲဂ့ၩ, စအၭဘ စလၧၫ့ချဲၩ့ဆၧ လၧအထၧၫ့ဖုဝဲစအၫမနၧၫ့နီၪ နးမံၩ့ အ့ၬ.အဂဲးဘဲၫယီၩ စအၭဘစလၧၫ့ၥၭဂဲၫ့စအၫမနၧၫ့ လၧအဆၪ့လၩ့အထၧၫ့ဖုဝဲမုၪ နးတၫမၫအကၠီၩ့လီၫ.",
			"23": "<sup>23</sup> တၭမုနံၩလဖၪနံၫနံၪ့ဖီၩ့ခွံၬနီၪ ဆၧမၩအၥၭလၧစအၭ ဘစလၧၫ့အီၪလၧၦထံၬၥိၪအဆီၪ့ လၧဘၫအလၭဟၫ ဇီၫအဖၧၩ့, လၧအအီၪဝ့ၫလၧအံဖြံၫ့အဖၧၩ့တၭ, စအၭ ဘစလၧၫ့ကိၭန့စဎွၩအဖိၪခွၫလဖၪ ကိၭဂၩဒ့ၭလီၫ.",
			"24": "<sup>24</sup> တၭစအၭဘစလၧၫ့ဂဲၫလၧစဎွၩအအီၪတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,နခ့ၫနၡၩအီၪလၧ ၦထံၬၥိၪအဆီၪ့လဖၪလီၫ. မွဲ စဎွၩဒဲအခ့ၫအၡၩ လ့ၩလါလၧနခ့ၫနၡၩအၥိၭဆံၭ.",
			"25": "<sup>25</sup> စဎွၩစံၭစအၭဘစလၧၫ့, မွဲအ့ၬ. ယဖိၪခွၫဧ့, မွဲပထီး လ့ၩၡီၩ့ထီးအလူၬ ဘိၩ့နဲၪ့ယီၩလဂ့ၩ, ပမိကဲၪထၪ့ဘၪ ခိၬဆၧဎၧၫ့လၧနဂးလီၫ. တၭအဝ့ၫဒၪအၪ့ယၫဆီၪ့ဝ့ၫ လီၫ.မွဲလါနၫ့လ့ၩဝ့ၫအၥၭအီၪအ့ၬ. အ့ၪမွဲဆိၪဂ့ၩဝ့ၫ",
			"26": "<sup>26</sup> ဒၪလီၫ.- ထီးနီၪလဖၧၫ့စအၭဘစလၧၫ့ စံၭဝ့ၫဒၪ, အ့ၪ လမွဲဘၪတၭ ဒုၭလ့ၩလါယထၧၫ့ဖုဝဲ စအၫမနၧၫ့လၧ ပၥိၭနီၪဘီၪ. တၭစဎွၩစံၭဝ့ၫ, အဝ့ၫဒၪမိလ့ၩလၧနၥိၭ",
			"27": "<sup>27</sup> နီၪမွဲဘၪလဲၪ.- စအၭဘစလၧၫ့ အၪ့ယၫဆီၪ့ဝ့ၫတၭ, အဝ့ၫဒၪဖျါခွံၬစအၫမနၧၫ့ ဒဲစဎွၩအဖိၪခွၫ ထီးအလူၬ",
			"28": "<sup>28</sup> လၧအဝ့ၫအၥိၭလီၫ.- စအၭဘစလၧၫ့ မၪလူၬအခ့ၫအ ၡၩတၭ, စံၭဝ့ၫဒၪ, ထီးစအၫမနၧၫ့ အၥၭမုၬဝ့ၫလၧစ ဘံၭထံၫတၭ, ယိနဲၪ့ဆံၭ, ထီးယအ့ၪစံၭနၥံၪဖ့ၬစအၫ မနၧၫ့နီၪတၭ, ထီးနီၪလဖၧၫ့ မၩၥံၫအဝ့ၫဒၪဆံၭ, ထီး ၥၭမဲၪဆၧလဂ့ၩ, ယမၪလူၬနၥံၪမွဲအ့ၬဧၪ. အီၪက့ၪဒူၩ နၥံၪအၥၭတၭ, ကဲၪထၪ့ၦဂဲးဆီၪ့ အဖိၪခွၫၥံၪဆံၭ.",
			"29": "<sup>29</sup> တၭစအၭဘစလၧၫ့ အခ့ၫအၡၩ မၩစအၫမနၧၫ့ ဘဲၫစ အၭဘစလၧၫ့ မၪလူၬဝ့ၫအၥိၭနီၪလီၫ. ထီးနီၪလဖၧၫ့ စဎွၩအဖိၪခွၫၥံၪဂဲထုၪ့ကိၭဂၩဒ့ၭတၭ, ထူၬထၪ့အက ၥ့ၪယီၩ့လဂၩဘၪလဂၩတၭ စဲၪ့ဖျိၭဝ့ၫကိၭဂၩဒ့ၭလီၫ.",
			"30": "<sup>30</sup> အဝ့ၫၥံၪအီၪလၧဖၧၩ့ၥၭအဘိၩ့ဘၭနီၪ, ဆၧမၩအ ၥၭလၧဆၧပရၧၫ့ဂဲၫလၧစဒၫဝံၭအအီၪတၭ, စံၭဝ့ၫဒၪ, စအၭဘစလၧၫ့မၩၥံၫယူၭစဎွၩအဖိၪခွၫၥံၪ ထီးအလူၬ",
			"31": "<sup>31</sup> ယူၭ.အီၪလၩ့ထးနးဂၩအ့ၬ.- ထီးနီၪလဖၧၫ့စဎွၩဂဲ ထုၪ့တၭ,ၡၫ့အကီၩ့အၥိၭ ဒဲမံၫနၩ့လၧဂၪ့ခိၪတၭ,အခ့ၫ အၡၩဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭ ထီးအလူၬအီၪလၧအ",
			"32": "<sup>32</sup> ဝ့ၫၥံၪအကီၩ့အၥိၭယၬဝ့ၫဆ့လီၫ.- စဒၫဝံၭအထၧၫ့ဖု ဝဲစၡံမအၫအဖိၪခွၫ စယီနဒၭချဲၩ့ဆၧတၭ, စံၭဝ့ၫဒၪ, မွဲယကဆါထီးစံၭ လၧဆၧမၩၥံၫၦဖိၪၥၪခွၫ, စဎွၩအ ဖိၪခွၫထီးအလူၬနီၪလဂ့ၩ, အဂဲးဘဲၫယီၩ ၥံၫဝ့ၫန့ၫစ အၫမနၧၫ့လဂၩလီၫ. အဂဲးဘဲၫယီၩ ဆၧနီၪအီၪဝ့ၫလၧ စအၭဘစလၧၫ့အနိၭလၧအကိၪ့ဝဲၩဝ့ၫ, ခီၫဒၪမုလနံၩ လၧအဝ့ၫဒၪဆၪ့လၩ့အထၧၫ့ဖုဝဲမုၪ နးတၫမၫနီၪလီၫ.",
			"33": "<sup>33</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, မွဲယကဆါစဎွၩ ထီးအီၪက့ၪဆၧလမံၩ့ယီၩ လၧအၥၭခံဖၧၩ့တၭ, စံၭ လၧစဎွၩအဖိၪခွၫ ထီးအလူၬ ၥံၫယူၭနီၪလဂ့ၩ. အဂဲး",
			"34": "<sup>34</sup> ဘဲၫယီၩ ၥံၫဝ့ၫန့ၫစအၫမနၧၫ့လဂၩနီၪလီၫ.- အ့ၪမွဲစ အၭဘစလၧၫ့နီၪ စဲၪ့ဖျိၭဝ့ၫဒၪလီၫ. တၭၦဖိၪၥၪခွၫလ ဂၩလၧအခိၭဆၧနီၪ ကျဲၪ့ထၪ့အမ့ၬတၭ, ယိဝ့ၫ, ယိခွါ, ၦခမျၧးဖၭဒိၪဂဲၫဝ့ၫလၧ အချိၫ့လခီၫလၧခိၪလီၩ့အဖၩ",
			"35": "<sup>35</sup> လီၫ.- တၭစယီနဒၭစံၭစဎွၩ,ယိခွါ, စဎွၩအဖိၪခွၫလဖၪ ဂဲၫဝ့ၫ, ဘဲၫနခ့ၫနၡၩစံၭဆၧအၥိၭနီၪ, ဆၧမၩအၥၭဘဲၫ",
			"36": "<sup>36</sup> နီၪလီၫ.- ထီးအချဲၩ့ဆၧဂီၩ့တၭ, ယိခွါ,စဎွၩအဖိၪခွၫ လဖၪဂဲၫတၭ, အဝ့ၫၥံၪထုၭထၪ့အလူတၭ, ဂၪ့ခံးဂၪ့ၡၭ ဝ့ၫ,ဒဲစဎွၩဆ့, ဒဲအခ့ၫအၡၩထီးအလူၬ ဂၪ့ဝ့ၫနၭနၭ လ့ၬလီၫ.",
			"37": "<sup>37</sup> တၭစအၭဘစလၧၫ့စဲၪ့ဖျိၭတၭး လ့ၩဝ့ၫလၧဂ့ၭၡၧၫ အစဎွၩစအၫမဟၧၭအဖိၪခွၫ စတၫလမ့ၫအအီၪလီၫ. တၭစဒၫဝံၭ အၥၭလမုၬဘၪ လၧအဖိၪခွၫ အကၠီၩ့နီၪ ကိၭမုနံၩမုနၩဒ့ၭလီၫ.",
			"38": "<sup>38</sup> စအၭဘစလၧၫ့စဲၪ့ဖျိၭတၭ, လ့ၩဝ့ၫလၧဂ့ၭၡၧၫတၭ, အီၪထီးနီၪၥၧၫ့နံၪ့လီၫ.",
			"39": "<sup>39</sup> တၭစဒၫဝံၭဆိၫ့လ့ၩလၧ စအၭဘစလၧၫ့အအီၪလီၫ. အဂဲးဘဲၫယီၩ အၥၭမုၬထၪ့ထဲၩ့လၧ စအၫမနၧၫ့အကၠီၩ့ တၭ,အဂဲးဘဲၫယီၩ အဝ့ၫဒၪၥံၫယူၭဝ့ၫယူၭ."
		},
		"14": {
			"1": "<sup>1</sup> တၭနးဇ့ၫရုၫအဲအၫအဖိၪခွၫ စယိအၭၥ့ၪယၫဝ့ၫလၧ",
			"2": "<sup>2</sup> စဎွၩအၥၭအီၪစအၭဘစလၧၫ့လီၫ.- တၭစယိအၭအၪ့ မၧၫ့လၩ့ဆၧလၧတကိအၫအလးနီၪတၭ, အၪ့မၩန့ၦမုၪ လၧအကိၪ့ဆၧၥ့ၪလဂၩတၭ, စံၭအဝ့ၫ, ကျဲၩ့မၩနၥၭ လၧၦဂၪ့ဆၧယၧၩ့ဆၧတၭ, ၥိၭၦဂၪ့ဆၧယၧၩ့ဆၧအ ကီၩ့အၥိၭတၭ, ထီးဂုၪနလီၩ့လၧၥိၪလဂ့ၩ. အ့ၪမွဲအီၪ နဝ့ၫဘဲၫၦလၧအဂၪ့ဝ့ၫ လၧၦၥံၫအကၠီၩ့ ယံၬယံၬလ့ၬ",
			"3": "<sup>3</sup> အၥိၭနီၪး- တၭဂဲၫလၧစဎွၩအအီၪနီၪတၭ, ချဲၩ့ဆၧလၧ အဝ့ၫ,ဘဲၫဆၧချဲၩ့ ဘဲၫယီၩအၥိၭနီၪဆံၭ. တၭစယိ အၭအီၪက့ၪဆၧချဲၩ့နီၪ လၧအနိၭဖၧၩ့လီၫ.",
			"4": "<sup>4</sup> ၦတကိအၫမုၪချဲၩ့ဆၧလၧစဎွၩတၭ, ၡီၫ့လၩ့အၥၭ တၭထွံၩလၩ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, မၩဖီၩ့မၩဖျ့ၭဆၧဆံၭ,",
			"5": "<sup>5</sup> စဎွၩဧ့,- တၭစဎွၩစံၭဝ့ၫ, မွဲနဘၪဆၧနီၪလမံၩ့လဲၪ. အ ဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧ, ယမွဲၦမုၪမဲၫတၡါတၭ, ယဝၩၥံၫ",
			"6": "<sup>6</sup> ယူၭ.- တၭနဎီးမုၪအီၪလၧအဖိၪခွၫနံၫဂၩတၭ, အဝ့ၫ ၥံၪနံၫဂၩနီၪအဲၪ့လိၬဆိၭချဲၩ့လိၬအၥၭ လၧဆၧပျၩ့ဖၧၩ့ တၭ,ဆၧမၩလၩ့ဖၭအဝ့ၫၥံၪ အီၪနးဂၩအ့ၬ. အ့ၪမွဲအ",
			"7": "<sup>7</sup> လဂၩဖ့ၬခွံၬအဝ့ၫလဂၩတၭ, မၩၥံၫဝ့ၫဒၪလီၫ.- တၭ ယိခွါ,ၦဂံၪ့ဒီၪ့ထၧၫ့ဒီၪ့ယၫ ဂဲထုၪ့ထၫ့ဒုၪဒၩ နဎီးမုၪ တၭ,စံၭဝ့ၫဒၪ, ဖ့ၪလၫ့ခွံၬၦလၧအဖ့ၬခွံၬ အထၧၫ့ဖုဝဲ လဂၩနီၪ,ဘဲၫၥိၭပမိမၩၥံၫအဝ့ၫ, လၧအထၧၫ့ဖုဝဲလၧ အမၩၥံၫဝ့ၫလဂၩ အၥၭမၧၫ့အကၠီၩ့တၭ, ပမိမၩဂၭ ဂီၩ့ဆ့ၦလၧအန့ၥၫဆၧလီၫ. အခိးမွဲအဝ့ၫၥံၪမိမၩလၩ့ ဖံၬယမ့ၪအၧၩ့ လၧအအီၪလၩ့ထးတၭ, အမံၩ့မွဲဂ့ၩ, ဆၧအီၪလၩ့ထးလၧဂၪ့ခိၪချိၫ့မွဲဂ့ၩ, မိအီၪက့ၪလၩ့ထး ဝ့ၫလၧယဝၩအဂးနးမံၩ့အ့ၬ.",
			"8": "<sup>8</sup> စဎွၩစံၭၦမုၪနီၪ, ထဲၩ့ထဲၩ့လၧနဂံၪ့တၭ, ယမိမၪ လူၬဆၧလၧနဂဲးနကၠီၪ့လီၫ.",
			"9": "<sup>9</sup> တၭၦတကိအၫမုၪစံၭစဎွၩ, ယကဆါစဎွၩဧ့,မွဲ ဆၧအၧၩ့နီၪဘၪယၧၩ, ဒဲယဖါအၡၩဂံၪ့ဖိၪတၭ, စဎွၩ ဒဲအလးဆီၩ့ဆီဖီၩ့ဖျ့ၭဆံၭ.",
			"10": "<sup>10</sup> တၭစဎွၩစံၭဝ့ၫဒၪ, ထီးဒၪၦလၧအချဲၩ့ဆၧလၧနၧၩ နီၪဂဲၫဆိၬအဝ့ၫလၧယအီၪဆံၭ. မွဲအမိထိၭဘၪလၧၩ့",
			"11": "<sup>11</sup> နၧၩအ့ၬ.- ထီးနီၪလဖၧၫ့ ၦမုၪနီၪစံၭဝ့ၫဒၪ, မွဲစဎွၩနၪ့ ထၪ့ထဲၩ့ယဟိဝၩနယွၩ လၧနလဒုၭ မၩဂၭဂီၩ့လၧၩ့ ဘၪၦဎွ့ၩန့ထဲၩ့ဆၧၥွံၪလဖၪ ဘဲၫၥိၭအထီးမၩဂၭဂီၩ့ ယဖိၪခွၫလဂ့ၩ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ယဟိဝၩမၧၫ့ဝ့ၫ, နဖိၪခွၫအခိၪၥူၫလဘီၩ့ လၩ့ထ့ၬဘၪလၧဂၪ့ခိၪအ့ၬ.",
			"12": "<sup>12</sup> ၦမုၪစံၭဝ့ၫဒၪ, ဒုၭချဲၩ့လါနဎီးမုၪလၧဆၧချဲၩ့လထံၪ, လၧယကဆါစဎွၩဆံၭ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ချဲၩ့ထၪ့",
			"13": "<sup>13</sup> ဘီၪ.- တၭၦမုၪနီၪစံၭဝ့ၫဒၪ, နဆီၫ့မီၪ့ဆၧဘဲၫနီၪလၧ ယွၩအၡၩခမျၧးနီၪ အဂဲးအကၠီၪ့,မွဲဘၪလဲၪ. တၭစဎွၩ ချဲၩ့ဆၧလမံၩ့နီၪ ဘဲၫၦလၧအမၩမၪ ဆၧအၥိၭလၧစ ဎွၩလဂဲၫထဲၩ့ဆိၬဘၪ အၡၩဝံၩ့ဝၩ့ဖိၪလဂၩ အကၠီၩ့",
			"14": "<sup>14</sup> နီၪလီၫ.- အဂဲးဘဲၫယီၩ မွဲပဘၪၥံၫပဝ့ၫတၭ, ဆၧမၩအ ၥၭဘဲၫထံၫလၧဆၧလူၫလၩ့ဝ့ၫ လၧဂၪ့ခိၪတၭ,ၦဘျႃၪ့ ထၪ့ထဲၩ့လၥ့ၪလၧၩ့ဘၪအၥိၭနီၪလီၫ. တၭယွၩယိဒိၪ ဆံၭအၪၡၩၦနးဂၩအ့ၬ. တၭမွဲအကိၪ့ထၪ့ဝ့ၫဘဲၫၥိၭ အၡၩဂၭဝံၩ့ဝၩ့ဖိၪနီၪ အထီးဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫလၧ",
			"15": "<sup>15</sup> အမ့ၬယၫလဂ့ၩလီၫ.- တၭဘိၩ့နဲၪ့ယီၩ ယမိဂဲၫချဲၩ့ဆၧ လၧယကဆါစဎွၩ လၧဆၧလမံၩ့ယီၩ အဂဲးအကၠီၪ့ လီၫ.အဂဲးဘဲၫယီၩ ၦခမျၧး မၩၥၭမဲၪ ၥၭဖျဲၩ့ယၧၩ တၭ,နဎီးမုၪစံၭဝ့ၫဒၪ, ယမိချဲၩ့ဆၧလၧစဎွၩလီၫ. ဘၪ လဘၪစဎွၩမိမၩဆၧလၧ အဎီးမုၪအၪ့ကံၩ့ဝ့ၫနီၪလီၫ.",
			"16": "<sup>16</sup> အဂဲးဘဲၫယီၩ စဎွၩမိခိၭနၪဘဲၫၥိၭ အမိမၩဖျ့ၭထၪ့ခွံၬ အဎီးမုၪလၧၦၡၩ အစူၪဖၧၩ့ လၧအမိမၩဂၭဂီၩ့ခွံၬ ယၧၩ,ဒဲယဖိၪခွၫလစီၪ့ဎး, လၧယွၩအဆၧန့ၥၫအဖၧၩ့",
			"17": "<sup>17</sup> လီၫ.- တၭနဎီးမုၪစံၭဝ့ၫဒၪ, ယကဆါစဎွၩအဆၧချဲၩ့ မိကဲၪထၪ့ဆၧမၩမုၬထၪ့ထဲၩ့ယၧၩလီၫ. အဂဲးဘဲၫယီၩ ဘဲၫယွၩအၥီၫ့လဂၩအၥိၭနီၪ, ယကဆါစဎွၩ မၩအ ၥၭဘဲၫနီၪ, ဘဲၫၥိၭအမိအၪ့နၩ့ဖၭဆၧဂ့ၩ, ဒဲဆၧအၧၩ့ အဆၧၫ့နီၪလီၫ. တၭယဟိဝၩနယွၩ မိအီၪလၧနၥိၭ လီၫ.",
			"18": "<sup>18</sup> ထီးနီၪလဖၧၫ့ စဎွၩစံၭဆၧၫ့ဆၧတၭ, စံၭၦမုၪနီၪ, ဆၧလၧယမိအၪ့စၪ့နၧၩနီၪ ထီးအီၪက့ၪၥူၪခွံၬလၧယ မ့ၬယၫနးမံၩ့လဂ့ၩ. တၭၦမုၪနီၪစံၭဝ့ၫဒၪ, မွဲယကဆါ",
			"19": "<sup>19</sup> စဎွၩချဲၩ့လါဆၧဆံၭ.- တၭစဎွၩစံၭဝ့ၫဒၪ, စယိအၭ အစူၪအီၪလၧနၥိၭ, လၧဆၧလဖၪယီၩ ထီးအလူၬအ ဖၧၩ့မွဲအ့ၬဧၪ. ၦမုၪစံၭဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, နၥၭ မၧၫ့ဝ့ၫယကဆါစဎွၩဧ့, လၧစူၪထွ့ၪမွဲဂ့ၩ, လၧစူၪစ့ၪမွဲ ဂ့ၩ,ၦကၠၪထဲၩ့အၥၭ လၧယကဆါစဎွၩ ချဲၩ့ဆၧအ အီၪၥ့ၪနးဂၩအ့ၬ. အဂဲးဘဲၫယီၩနခ့ၫနၡၩ စယိအၭမၪ လူၬယၧၩတၭ, အီၪက့ၪဆၧချဲၩ့ထီးအလူၬနီၪ လၧနဎီး",
			"20": "<sup>20</sup> မုၪအနိၭဖၧၩ့လီၫ.- နခ့ၫနၡၩစယိအၭမၩဆၧယီၩဘဲၫ ၥိၭအမိဒုၭအီၪထၪ့ဆၧချဲၩ့ အခံးအဂၩ့ လမံၩ့နီၪလီၫ. တၭယကဆါကိၪ့ဆၧၥ့ၪ ဘဲၫယွၩအၥီၫ့လဂၩ အဆၧ ကိၪ့ၥ့ၪအၥိၭနီၪ, ဘဲၫၥိၭအမိၥ့ၪယၫ ဆၧလၧအအီၪ လၧဂၪ့ခိၪချိၫ့ထီးအလူၬလီၫ.",
			"21": "<sup>21</sup> စဎွၩစံၭစယိအၭ,ယိခွါ, ယမၩယူၭဆၧနီၪလမံၩ့ ယူၭတၭ,လ့ၩ, ဂဲၫထဲၩ့န့ၦဖိၪၥၪခွၫ စအၭဘစလၧၫ့နီၪ",
			"22": "<sup>22</sup> ဘီၪ.- စယိအၭၡီၫ့လၩ့အၥၭတၭ, ထွံၩလၩ့တၭ, စံၭ ထၪ့အၪ့အူၭစဎွၩအခိးအတၩတၭ, စယိအၭစံၭဝ့ၫဒၪ, ဆၧလၧမုဆၫလနံၩယီၩနခ့ၫနၡၩၥ့ၪယၫဝ့ၫ လၧအဘၪ ခိးဘၪတၩလၧနမ့ၬယၫလီၫ. ယကဆါ, စဎွၩဧ့, အ ဂဲးဘဲၫယီၩ စဎွၩမၩယူၭအခ့ၫအၡၩ အဆၧချဲၩ့ယူၭ",
			"23": "<sup>23</sup> လီၫ.- စယိအၭဂဲထုၪ့တၭ, လ့ၩဝ့ၫလၧဂ့ၭၡၧၫတၭ,ဂဲၫ",
			"24": "<sup>24</sup> ထဲၩ့န့စအၭဘစလၧၫ့ လၧယရုစလံၫ့လီၫ.- တၭစဎွၩ စံၭဝ့ၫဒၪ, မွဲအထဲၩ့ထဲၩ့လၧအဂံၪ့ဒၪဝ့ၫဆံၭ. မွဲအထီး ဒၪဘၪယမ့ၬလဂ့ၩ. အခိးမွဲစအၭဘစလၧၫ့ ထဲၩ့ထဲၩ့ လၧအဂံၪ့ဒၪဝ့ၫနီၪ, ဒၪဘၪစဎွၩအမ့ၬအ့ၬ.",
			"25": "<sup>25</sup> မွဲလါနၫ့လၧအံၫစရ့လၭ အကျၩနီၪၦဘၪဆၧစံၭထၪ့ အၪ့အူၭလၧအဎံၫအလၩအကၠီၩ့, ဘဲၫစအၭဘစလၧၫ့ အၥိၭနီၪအီၪနးဂၩအ့ၬ. လၧအခၪ့ယၫၥၭဖိးလၧအခိၪ",
			"26": "<sup>26</sup> ဒၩနီၪအဆၧလလၧၫ့လဎွ့ၩဘၪအီၪနးမံၩ့အ့ၬ.- ထီး အကူၭထ့ၬအခိၪၥူၫတၭ, (အဂဲးဘဲၫယီၩ ထီးနံၪ့ဆၧၫ့ ထဲၩ့အလးတၭ, ကူၭထ့ၬဝ့ၫလီၫ. မွဲအခိၪၥူၫဎၧၫ့ဝ့ၫ လၧအလီၩ့အကၠီၩ့တၭ, ကူၭထ့ၬဝ့ၫဒၪလီၫ.) အခိၪၥူၫ ဎၧၫ့ၡက့လၭနံၫယၩ, ဘဲၫစဎွၩအဆၧခံၫ့ၥၪအၥိၭနီၪ လီၫ.",
			"27": "<sup>27</sup> တၭလၧစအၭဘစလၧၫ့အဂးနီၪ အဖိၪခွၫအီၪဖျဲၪဝ့ၫ ၥၧၫ့ဂၩ, ဒဲအဖိၪမုၪလဂၩ လၧအမံၩ့မွဲနးတၫမၫလီၫ. တၭအဝ့ၫဒၪမွဲၦမုၪ အခံးအဂၩ့ဂ့ၩလဂၩလီၫ.",
			"28": "<sup>28</sup> စအၭဘစလၧၫ့ အီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့နံၫနံၪ့",
			"29": "<sup>29</sup> ယၫတၭ, ဒၪဘၪစဎွၩအမ့ၬအ့ၬ.- အခိးမွဲစအၭဘစ လၧၫ့အၪ့မၧၫ့လၩ့ဆၧလၧ စယိအၭအအီၪဘဲၫၥိၭအမိ ဒုၭလ့ၩဝ့ၫလၧစဎွၩအအီၪတၭ, အ့ၪမွဲအဝ့ၫဒၪဂဲၫလၧ အအီၪနီၪအၥၭအီၪအ့ၬ. အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ဒီၭနံၫ ဘျၩ့လဘျၩ့တၭ, အဝ့ၫဂဲၫလၧအအီၪနီၪ အၥၭအီၪ",
			"30": "<sup>30</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭစံၭအခ့ၫအၡၩ, ယိခွါ,စယိ အၭအဆံၬအီၪဘူၭ လၧယဆံၬတၭ, အီၪဝ့ၫလၧဘုၪ မုယီၩထီးနီၪလီၫ. တၭလ့ၩဆူၭထၪ့ခွံၬ လၧမ့ၪဆံၭ. တၭစအၭဘစလၧၫ့ အခ့ၫအၡၩလဖၪနီၪလ့ၩဆူၭထၪ့",
			"31": "<sup>31</sup> ဆံၬလၧမ့ၪလီၫ.- ထီးနီၪလဖၧၫ့စယိအၭဂဲထုၪ့တၭ,ဂဲၫ လၧစအၭဘစလၧၫ့အဂံၪ့ဖၧၩ့တၭ, စံၭအဝ့ၫ,နခ့ၫနၡၩ",
			"32": "<sup>32</sup> ဆူၭထၪ့ခွံၬယဆံၬလၧမ့ၪနီၪ, မွဲဘၪလဲၪ.- တၭစအၭ ဘစလၧၫ့စံၭဆၧၫ့စယိအၭ, ယိခွါ, ယအၪ့မၧၫ့လၩ့ဆၧ လၧနအီၪ, စံၭဂဲၫလၧယီၩဘဲၫၥိၭယမိအၪ့မၧၫ့လၩ့နၧၩ လၧစဎွၩအအီၪဘဲၫနမိစံၭ, ယဂဲၫထဲၩ့လၧဂ့ၭၡၧၫနီၪ, မွဲဘၪလဲၪ. ယအ့ၪအီၪဒံၭ ထီးနီၪဂ့ၩလၧယဂးလီၫ. တၭဘိၩ့နဲၪ့ယီၩ ဒုၭဒၪဘၪယၧၩ လၧစဎွၩအမ့ၬဆံၭ. ဆၧအၧၩ့အ့ၪအီၪလၧယဖၧၩ့တၭ, မွဲအမၩၥံၫယၧၩ",
			"33": "<sup>33</sup> ဘီၪ.- အခိးမွဲစယိအၭ ဂဲၫလၧစဎွၩအအီၪတၭ, လီၩ ဘၪအဝ့ၫတၭ, ထီးအဝ့ၫဒၪကိၭန့စအၭဘစလၧၫ့တၭ, အဝ့ၫဂဲၫဝ့ၫလၧစဎွၩအအီၪနီၪ, ၡီၫ့လၩ့အၥၭလၧစဎွၩ အမ့ၬယၫတၭ, စဎွၩအဲၪဂါစအၭဘစလၧၫ့နီၪလီၫ."
		},
		"15": {
			"1": "<sup>1</sup> တၭလၧဆၧနီၪအလးခဲၫ့ဆၧမၩအၥၭ, လၧစအၭဘ စလၧၫ့တဲၩ့ဝဲၩလဲၪ့ၥုၭလဖၪ, ဒဲကၥ့ၪလဖၪ, ဒဲၦၡၩယဲ",
			"2": "<sup>2</sup> ဆံၫဘဲၫၥိၭအမိစဲၪ့တလဲးလၧအမ့ၬယၫလီၫ.- စအၭ ဘစလၧၫ့ဂဲထုၪ့ဂီၩဂီၩတၭ, ဆၧၫ့ထုၪ့လၧတရၫ့အ ဖၧၩ့ၥၭနဲၩ့တၭ, ထီးၦအီၪလၧအမူၭအရါလဂၩဂၩ ဂဲၫလၧစဎွၩအအီၪ လၧဆၧစ့ၩရၫ့အဂးတၭ, ဆၧမၩ အၥၭလၧစအၭဘစလၧၫ့ကိၭန့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ,နဘၪ ဆဲၫ့လၧဒိၩ့ပလၫလဲၪ. တၭအဝ့ၫနီၪ စံၭဝ့ၫဒၪ, နခ့ၫန ၡၩဘၪဆဲၫ့လၧအံၫစရ့လၭအဒီၪ့လဖၪ အကျၩလဒီၪ့",
			"3": "<sup>3</sup> လီၫ.- တၭစအၭဘစလၧၫ့စံၭအဝ့ၫဒၪ, ယိခွါ,နမူၭနီၪ မွဲဆၧဂ့ၩ ဒဲဘၪဝ့ၫး မွဲလါနၫ့စဎွၩအခ့ၫအၡၩလၧအမိ",
			"4": "<sup>4</sup> ခိၭနၪနလူနီၪအီၪအ့ၬ.- တၭစအၭဘစလၧၫ့စံၭဝ့ၫဒၪ, မွဲပလၫမိအီၪက့ၪယၧၩ လၧၦစ့ၩရၫ့ခွးလၧခးဖၧၩ့လ ဂၩလဲၪ. တၭကယဲၦလၧအအီၪလၧအမူၭအရါမွဲဂ့ၩ, ဆၧစ့ၩရၫ့အလးမွဲဂ့ၩ, အ့ၪဂဲၫဝ့ၫလၧယအီၪတၭ, ယ",
			"5": "<sup>5</sup> မိစ့ၩရၫ့အဝ့ၫ လၧဆၧတီၩဆၧလီၩ့လီၫ.- ထီးၦလဂၩ ဂၩၥုၭဘူၭအၥၭဘဲၫၥိၭ အမိထွံၩလၩ့တၭ, ဆၧမၩအ ၥၭလၧအဝ့ၫဒၪယူၬစိၩအစူၪတၭ, မၩန့ဝ့ၫတၭအဲၪဂါ",
			"6": "<sup>6</sup> ဝ့ၫလီၫ.- တၭစအၭဘစလၧၫ့မၩအံၫစရ့လၭထီးအ လူၬလၧအဂဲၫလၧစဎွၩအအီၪ လၧစ့ၩရၫ့ဆၧအဂးဘဲၫ ဆၧနီၪလမံၩ့အၥိၭလီၫ. အခိးမွဲစအၭဘစလၧၫ့အၪ့ ဂူၪန့အံၫစရ့လၭအၥၭလီၫ.",
			"7": "<sup>7</sup> တၭအနံၪ့လံဆံၫ အလးခဲၫ့နီၪဆၧမၩအၥၭလၧ စအၭဘစလၧၫ့စံၭစဎွၩ, ဒုၭလ့ၩလါယၧၩ ဘဲၫၥိၭယမိ မၩဘိၪ့ဆၧဘၪဆဲၫ့လၧဆၧဆိၪလၩ့ယၥၭ လၧယဆိၪ",
			"8": "<sup>8</sup> လၩ့လၧယဟိဝၩလၧဟံဘြၧၫ့အဖၧၩ့နီၪဆံၭ.- အဂဲး ဘဲၫယီၩလၧယအီၪလၧဂ့ၭၡၧၫ လၧစံရအၫအဖၧၩ့နီၪ နခ့ၫနၡၩဆိၪလၩ့အၥၭ လၧဆၧဆိၪလၩ့လမံၩ့တၭ, စံၭ, ယဟိဝၩအ့ၪဒုၭဂဲၫထဲၩ့ဒီၭယၧၩ လၧယရုစလံၫ့ အဖၧၩ့တၡါတၭ, ထီးနီၪလဖၧၫ့ ယမိမၩယဟိဝၩအ",
			"9": "<sup>9</sup> ဆၧလီၫ.- တၭစဎွၩစံၭအဝ့ၫ, လ့ၩဆၧမုၬမုၬဆံၭ. အ ခိးမွဲအဝ့ၫဒၪဂဲထုၪ့တၭ, လ့ၩဝ့ၫလၧဟံဘြၧၫ့လီၫ.",
			"10": "<sup>10</sup> စအၭဘစလၧၫ့အၪ့မၧၫ့လၩ့ ၦယိၥူၪဆၧလၧအံၫစရ့ လၭအဒီၪ့ၥံၪထီးအလူၬအကျၩတၭစံၭဝ့ၫ, ထီးနၥံၪနါ ဂၧၫ့ခွ့ၩအၥီၫတၭ, နၥံၪမိဘၪစံၭ, စအၭဘစလၧၫ့ကဲၪ",
			"11": "<sup>11</sup> စဎွၩလၧဟံဘြၧၫ့အဖၧၩ့လီၫ.- တၭၦၡၩနံၫယၩစဲၪ့ ထၪ့ခွံၬဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ ဖိၬစအၭဘစလၧၫ့အ ခဲၫ့နီၪလီၫ. ဆၧကိၭန့ဝ့ၫတၭ, အဝ့ၫၥံၪလ့ၩဝ့ၫတီၩတီၩ",
			"12": "<sup>12</sup> လီၩ့လီၩ့တၭ, ၥ့ၪယၫဆၧနးမံၩ့အ့ၬ.- တၭစအၭဘစ လၧၫ့အၪ့မၧၫ့လၩ့ၦလ့ၩကိၭန့ ၦဂဲလိၫဖိၪစအဟံၭၥိၫဖ့ လၭစဒၫဝံၭအၡၩ ဒုၭကိၪ့ဆၧလဂၩ လၧအအီၪလၧ ဒိၩ့ဂဲလိၫအဖၧၩ့ လၧအလုထၪ့ဆၧလဖၪ အဘိၩ့ဘၭ လီၫ. တၭဆၧပိၩ့ထၪ့ဆၧနီၪဆီၪ့ဝ့ၫ, အဂဲးဘဲၫယီၩၦ နုၬလၧစအၭဘစလၧၫ့အစူၪဖၧၩ့နီၪ အၪထၪ့ဝ့ၫလထံၪ ဎးလီၫ.",
			"13": "<sup>13</sup> အၥီၫ့လဂၩဂဲၫလၧစဒၫဝံၭအအီၪတၭ, စံၭဝ့ၫဒၪ, အံၫစရ့လၭအၡၩလဖၪ အၥၭအီၪလၧစအၭဘစလၧၫ့",
			"14": "<sup>14</sup> အၥိၭလီၫ.- တၭစဒၫဝံၭစံၭအခ့ၫအၡၩထီးအလူၬ လၧ အအီၪလၧအၥိၭလၧယရုစလံၫ့အဖၧၩ့နီၪ ဂဲထုၪ့တၭ,မွဲ ပစဲၪ့ဖျိၭၡီၩ့ဆံၭ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, ပဖီၩ့ဖျ့ၭ လၧစအၭဘစလၧၫ့အ့ၬး စဲၪ့ထၪ့ခွံၬချဲၫ့ချဲၫ့ဆံၭ. မိချႃၭ န့ရှုၭဘၪခိၬပၧၩတၭ, မိဒုၭဘၪပၧၩလၧဆၧအၧၩ့တၭ,",
			"15": "<sup>15</sup> မိဖ့ၬခွံၬဒိၩ့လၧနၭအနါလီၫ.- တၭစဎွၩအခ့ၫအၡၩၥံၪ စံၭစဎွၩ,ယိခွါ, နခ့ၫနၡၩလဖၪ, ထီးဒၪယကဆါစဎွၩ မိစ့ၩရၫ့ဆၧလမံၩ့လါလါလီၫ.",
			"16": "<sup>16</sup> စဎွၩစဲၪ့ထၪ့ဒဲအၡၩဂံၪ့ဖိၪထီးအလူၬ အီၪလၧအၥိၭ တၭ,စဎွၩအီၪက့ၪလၩ့ထးအၥံၪမၫဆံၫဂၩ ဘဲၫၥိၭအ",
			"17": "<sup>17</sup> မိအီၪခိၭဂံၪ့နီၪလီၫ.- စဎွၩစဲၪ့ထၪ့ဒဲၦခမျၧးထီးအလူၬ အီၪလၧအၥိၭတၭ, အီၪထီလၧအလးအီၪယဲၩ့လီၫ.",
			"18": "<sup>18</sup> တၭအခ့ၫအၡၩထီးအလူၬနီၪ လ့ၩလၧအနဲၩ့ထံၭတၭ, ၦခ့ၫရံၭဖိၪထီးအလူၬ, ဒဲၦပံလ့ၭဖိၪထီးအလူၬ, ဒဲၦဂံၭ တဲၭဖိၪထီးအလူၬ, ၦဎူၫယၩလၧအဂဲၫလၧအၥိၭလၧ",
			"19": "<sup>19</sup> ဂၫၥၭအဖၧၩ့နီၪ လ့ၩဝ့ၫလၧစဎွၩအမ့ၬယၫလီၫ.- ထီး နီၪလဖၧၫ့ စဎွၩစံၭၦဂံၭတဲၭဖိၪ စအံၭတအဲၫ, နဝ့ၫဒၪ ယီၩမွဲဘၪနီၫလၧနလ့ၩဖိၬပခဲၫ့လဲၪ, ထဲၩ့ထဲၩ့လၧနလး တၭအီၪလၧစဎွၩအၥိၭဆံၭ. အဂဲးဘဲၫယီၩနမွဲၦလခီၫ ဘၩ့မုးဖိၪ, ဒဲၦဘၪဆၧနၫ့ထၪ့ခွံၬ လၧနလးဆ့လီၫ.",
			"20": "<sup>20</sup> နဂဲၫလၧမုဂၪတဂၪနီၪ, ယမိအၪ့မၧၫ့နဂၭဝံၩ့ဝၩ့ဖိၬပခဲၫ့ လၧမုဆၫလနံၩယီၩဆ့ဧၪ, ယမိလ့ၩဆၧထီးဒၪယမိ လ့ၩနီၪ,ထဲၩ့ထဲၩ့နဝ့ၫတၭ, ထဲၩ့ဆိၬနထၧၫ့ဖုဝဲလဖၪ ဆံၭ. မွဲဆၧအခိးအတၩ, ဒဲဆၧမွဲဆၧတီၩအီၪလၧနၥိၭ",
			"21": "<sup>21</sup> ဆံၭ.- စအံၭတအဲၫစံၭဆၧၫ့စဎွၩနီၪတၭ, စံၭဝ့ၫဒၪ, ယ ဟိဝၩမၧၫ့ဝ့ၫ, ဒဲယကဆါမၧၫ့ဝ့ၫ, ထီးဒၪအလးလၧက ဆါအီၪဝ့ၫလၧဆၧမၧၫ့အဖၧၩ့မွဲဂ့ၩ, လၧဆၧၥံၫအဖၧၩ့",
			"22": "<sup>22</sup> မွဲဂ့ၩ, နခ့ၫနၡၩမိအီၪဝ့ၫ ထီးနီၪဆ့လီၫ.- စဒၫဝံၭစံၭ စအံၭတအဲၫ, လ့ၩဘီၪ, ခၫ့ဂၬဆၧဆံၭ. တၭၦဂံၭတဲၭ ဖိၪစအံၭတအဲၫနီၪလ့ၩခၫ့ဂၬဆၧ ဒဲအၡၩထီးအလူၬ,",
			"23": "<sup>23</sup> ဒဲကယဲဖိၪဒံၩဖိၪၥၪလၧအအီၪလၧအၥိၭလီၫ.- ၦခးဖိၪ ထီးအလူၬဂၪ့ဝ့ၫ လၧအလူဖၭဒိၪတၭ, ၦခမျၧးခၫ့ဂၬ ဆၧထီးအလူၬ, ဒဲစဎွၩအနၫ့ဆါဒၪဝ့ၫနီၪခၫ့ဂၬထံၫချိၬ ကံၭဒၧၫ့တၭ, ၦထီးအလူၬခၫ့ဂၬဆၧ, တီၩလၧမံၩ့လၬ ကျၩအဖၧၩ့ၥၭနီၪလီၫ.",
			"24": "<sup>24</sup> တၭယိခွါ, စဇၫဒီၭဆ့, ဒဲၦလံဝဲၫဖိၪထီးအလူၬအီၪ လၧအၥိၭ, ဆိၬယွၩအဆၧအုၩ့လၩ့အတလၫနီၪ, အဝ့ၫ ၥံၪအီၪက့ၪလၩ့ ယွၩအတလၫတၭ, စအဘဲအၥၫလ့ၩ ထၪ့,ထီးၦခမျၧးထီးအလူၬစဲၪ့ထၪ့ခွံၬလၧဒိၩ့ဖၧၩ့လူၬ",
			"25": "<sup>25</sup> ဝ့ၫလီၫ.- တၭစဎွၩစံၭစဇၫဒီၭ, ထဲၩ့ဆိၬယွၩအတလၫ နီၪလၧဒိၩ့ဖၧၩ့ဆံၭ. ယအ့ၪဘၪခိးဘၪတၩလၧယဟိ ဝၩအမ့ၬယၫတၭ, အဝ့ၫဒၪမိဒုၭဂဲၫထဲၩ့ထဲၩ့ယၧၩတၭ,",
			"26": "<sup>26</sup> မိဒုၭနဲၪယၧၩ လၧအဝ့ၫနီၪ, ဒဲအအီၪအလးလီၫ.- မွဲ လါနၫ့အဝ့ၫဒၪအ့ၪစံၭဘဲၫယီၩ, လဘၪဘၪယၥၭဒဲနၧၩ နီၪ,ယိခွါ,ယၧၩလီၫ. မွဲအမၩယၧၩထီးအဂ့ၩလၧအ",
			"27": "<sup>27</sup> မ့ၬယၫဆံၭ.- တၭစဎွၩစံၭၦလုဆၧစဇၫဒီၭ, နမွဲၦဒၪ ဆၧလၧယၫမွဲအ့ၬဧၪ. ထဲၩ့ထဲၩ့လၧဒိၩ့ဖၧၩ့မုၬမုၬဒဲန ဖိၪခွၫနံၫဂၩလၧနၥိၭ, နဖိၪခွၫစအဟံမအၭ, ဒဲစအဘဲ",
			"28": "<sup>28</sup> အၥၫအဖိၪခွၫစစၪ့နၥၧၫ့နီၪဆံၭ.- ယိခွါဘီၪ ယမိအီၪ လၧၡါမုနၧၫ့ဖၫအဆၧပျၩ့ဖၧၩ့ ထီးဆၧချဲၩ့ဂဲၫလၧနၥံၪ",
			"29": "<sup>29</sup> အအီၪလၧအမိဒုၭနဲၪယဆၧလီၫ.- အခိးမွဲစဇၫဒီၭဒဲ စအဘဲအၥၫ, ဂဲၫဆိၬထဲၩ့ယွၩအတလၫလၧယရုစလံၫ့ အဖၧၩ့တၭ, အဝ့ၫၥံၪအီၪထီးနီၪလီၫ.",
			"30": "<sup>30</sup> စဒၫဝံၭလ့ၩထၪ့ခိၪလီၩ့အလဲအိၫ့အလီၩ့တၭ, လ့ၩ ဝ့ၫလခီၫဂၪ့ဝ့ၫလခီၫ ဒဲအီၪလၧအခိၪဎွံၪချႃၬဘံၭအၥၭ ဒဲလ့ၩဆၧလၧအခၪ့အီၪဘိၪ့, ဒဲကယဲၦခမျၧးလၧအအီၪ လၧအၥိၭထီးအလူၬနီၪ, ချႃၬဘံၭအခိၪဎွံၪကိၭဂၩဒ့ၭ တၭ,အဝ့ၫၥံၪလ့ၩထၪ့ဝ့ၫနီၪ, လ့ၩထၪ့ဝ့ၫလခီၫဂၪ့ဝ့ၫ",
			"31": "<sup>31</sup> လခီၫလီၫ.- တၭၦလီၩဘၪစဒၫဝံၭ, စံၭဝ့ၫဒၪ,စအဟံၭ ၥိၫဖ့လၭအီၪဝ့ၫ လၧၦပိၩ့ထၪ့ဆၧအကျၩ, လၧစအၭ ဘစလၧၫ့အၥိၭနီၪလီၫ. တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ယဟိ ဝၩဧ့,ဒုၭကဲၪထၪ့လါစအဟံၭၥိၫဖ့လၭအဆၧကိၪ့လၧ ဆၧပျီၩပျီၩနီၪဆံၭ.",
			"32": "<sup>32</sup> တၭဆၧမၩအၥၭ ထီးစဒၫဝံၭဂဲၫထီၩ့လၧဆၧဒၩ့ခိၪ ထီးအဘိၪ့ထၪ့ဘၩထၪ့ယွၩအလးတၭ, ယိခွါ, ၦအၫ ခဲၫဖိၪစဟုၡ့ၫဂဲၫထၪ့အၪ့ဂၬအဝ့ၫ အီၪလၧအဆဲၫ့ယၬ,",
			"33": "<sup>33</sup> ဒဲဂၪ့ခိၪအမုၬအီၪလၧအခိၪဎွံၪလီၫ.- စဒၫဝံၭစံၭအဝ့ၫ, နအ့ၪလ့ၩဆၧလၧယၥိၭတၭ, နမိကဲၪထၪ့ဆၧယိၭအ",
			"34": "<sup>34</sup> ဎၧၫ့လၧယဂးလီၫ.- အ့ၪမွဲနအ့ၪထဲၩ့လၧဒိၩ့ဖၧၩ့တၭ, စံၭစအၭဘစလၧၫ့ယမိကဲၪထၪ့နခ့ၫနၡၩ, စဎွၩဧ့,ယ မွဲနဖါအခ့ၫအၡၩ လၧဖျိၩ့လံၩလံၩတၭ, ဘိၩ့နဲၪ့ယီၩ ယမိကဲၪထၪ့နခ့ၫနၡၩဆ့တၭ, ထီးနီၪလဖၧၫ့နမိမၩဂၭ ဂီၩ့ဘၪစအဟံၭၥိၫဖ့လၭ အဆၧကိၪ့နီၪလၧယဂးလီၫ.",
			"35": "<sup>35</sup> တၭၦလုဆၧစဇၫဒီၭ, ဒဲစအဘဲအၥၫအီၪလၧနၥိၭထီး နီၪ,မွဲအ့ၬဧၪ. တၭကယဲဆၧလၧနမိနါဂၧၫ့ဘၪလၧစဎွၩ အဂံၪ့ဖၧၩ့လမံၩ့လါလါနီၪ ဆၧမိမၩအၥၭလၧနမိဘၪ",
			"36": "<sup>36</sup> လီၩထဲၩ့ၦလုဆၧစဇၫဒီၭ ဒဲစအဘဲအၥၫလီၫ.- ယိခွါ, အဝ့ၫၥံၪအဖိၪခွၫနံၫဂၩ အီၪလၧအဝ့ၫၥံၪအၥိၭထီးနီၪ, စဇၫဒီၭအဖိၪခွၫစအဟံမအၭ, ဒဲစအဘဲအၥၫအဖိၪခွၫ စစၪ့နၥၧၫ့တၭ, နၥံၪမိဘၪဖ့ၪယုယၧၩလၧကယဲဆၧလၧ နၥံၪနါဂၧၫ့လၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ.",
			"37": "<sup>37</sup> စဒၫဝံၭအထံၩအၥိၭ စဟုၡ့ၫဂဲၫနုၬလၧဒိၩ့ဖၧၩ့တၭ, စအၭဘစလၧၫ့ဂဲၫနုၬလၧယရုစလံၫ့အဖၧၩ့လီၫ."
		},
		"16": {
			"1": "<sup>1</sup> တၭထီးစဒၫဝံၭလ့ၩဖီၩ့ခွံၬဆၧဒၩ့ခိၪ လဆံၭတၭ, ယိခွါ,စမံၫဖံၭဘၡ့ၭအခ့ၫအၡၩ စဇဲဘၫဂဲၫထၪ့ဆီးအ ဝ့ၫအီၪလၧကၥ့ၪယီၩ့နံၫဒုၩ တဲၩ့ဝဲၩအၥၭလၧအပီၩ့,ဒဲ ကိၪအလီၪ့နံၫယၩ, ဒဲစဘံၭၥၪဎဲၫ့အဆူၬလယၩ,ဒဲဆၧ ခိခၫအဆၧၥၪလယၩ, ဒဲစဘံၭထံၫထိၪ့လဖျိၪ့ အီၪဝ့ၫ",
			"2": "<sup>2</sup> လၧအခိၪလီၫ.- တၭစဎွၩစံၭစဇဲဘၫ, လၧဆၧလဖၪ ယီၩနမိဒုၭနဲၪအခီၫပယီၫဘဲၫၥ့ၪလဲၪ. တၭစဇဲဘၫစံၭ ဝ့ၫဒၪ,ကၥ့ၪယီၩ့ၥံၪမွဲလၧစဎွၩအၡၩဂံၪ့ဖိၪ မိထူၬဝ့ၫအ ဂး,ကိၪဒဲဆၧခိခၫအဆၧၥၪ မွဲလၧၦၡၩဖိၪၥၪခွၫအဆၧ အၪ့အဂး, ဒဲစဘံၭထံၫနီၪ မွဲဝ့ၫဘဲၫၦလၧအလၩ့ဘဲၩ",
			"3": "<sup>3</sup> လၧၡါမုနၧၫ့ဖၫနီၪမိအီၩဘၪဝ့ၫလီၫ.- တၭစဎွၩစံၭဝ့ၫ ဒၪ,နကဆါအဖိၪခွၫနီၪ, မွဲအအီၪခီၫခီၫလဲၪး တၭစဇဲ ဘၫစံၭစဎွၩ, ယိခွါ, မွဲအအီၪဝ့ၫလၧယရုစလံၫ့အဖၧၩ့ လီၫ. အဂဲးဘဲၫယီၩစံၭဝ့ၫဒၪ, ဆၧလၧမုဆၫလနံၩယီၩ အံၫစရ့လၭ အၡၩဂံၪ့ဖိၪ မိဖ့ၪထဲၩ့ယၧၩ လၧယဖါအ",
			"4": "<sup>4</sup> ဘၩ့အမုးနီၪလီၫ.- စဎွၩစံၭစဇဲဘၫ,ယိခွါ, ကယဲစမံၫ ဖံၭဘၡ့ၭအဆၧနီၪ မွဲနဆၧထီးအလူၬလီၫ. တၭစဇဲ ဘၫစံၭဝ့ၫဒၪ, ယအၪ့ကံၩ့အၪ့ယၫနၧၩလၧဆၧဆၪ့လၩ့ ၥၭအဖၧၩ့, မွဲယမိဘၪခိးဘၪတၩလါ လၧနမ့ၬယၫဆံၭ, ယကဆါ, စဎွၩဧ့,",
			"5": "<sup>5</sup> ထီးစဎွၩဒၫဝံၭဂဲၫထီၩ့လၧဘဟုရံၫ့တၭ, ယိခွါ,ၦလၧ စစီလူၫအၡၩဂံၪ့ဖိၪအဒီၪ့အကျၩလဂၩ ဂဲၫထၪ့ထီးနီၪ တၭ,အမံၩ့မွဲစၡံမအဲၫ, စဂ့ရၫအဖိၪခွၫလီၫ. အဝ့ၫဒၪ",
			"6": "<sup>6</sup> ဂဲၫထၪ့တၭ, ဂဲၫထၪ့လခီၫဆိၪအၧၩ့ဆၧလခီၫလီၫ.- တၭ ခွံၬစဒၫဝံၭ, ဒဲစဎွၩဒၫဝံၭအခ့ၫအၡၩထီးအလူၬလၧလိး လီၫ. တၭၦခမျၧးထီးအလူၬ, ဒဲၦဂဲးဆီၪ့ထီးအလူၬ အီၪဝ့ၫလၧအစူၪထွ့ၪလခီၫ, ဒဲလၧအစူၪစ့ၪလခီၫလီၫ.",
			"7": "<sup>7</sup> တၭလၧစၡံမအဲၫဆိၪအၧၩ့ဆၧနီၪ, စံၭဝ့ၫဘဲၫယီၩ, စဲၪ့ ထၪ့ဘီၪ,စဲၪ့ထၪ့ဘီၪ, ဆၧၥွံၪအၡၩလဂၩ, ၦဘၫအလၭ",
			"8": "<sup>8</sup> ဖိၪဧ့,- စစီလူၫ, လၧနကဲၪစဎွၩလၧအလး, အၡၩဂံၪ့ဖိၪ ထီးအလူၬအၥွံၪနီၪ ယဟိဝၩဒုၭဘၪထဲၩ့ယူၭလၧနဖၫ့ ခိၪတၭ, ယဟိဝၩဖ့ၪလၫ့ယူၭ နဘၩ့နမုးလၧနဖိၪခွၫ စအၭဘစလၧၫ့ အစူၪဖၧၩ့ယူၭ. ယိခွါ, နဘၪဆၧဖီၪ့ နၧၩလၧနဆၧအၧၩ့ဒၪနဝ့ၫအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ နမွဲဆၧၥွံၪအၡၩလီၫ.",
			"9": "<sup>9</sup> တၭနးဇ့ၫရုၫအဲအၫအဖိၪခွၫ စအၭဘၡဲၫစံၭစဎွၩ, ထွံၪၥံၫလဒုၩယီၩ မိဆိၪအၧၩ့ယကဆါစဎွၩနီၪ, မွဲဘၪ လဲၪ. ဒုၭလ့ၩခၫ့ဂၬလါယၧၩဘီၪး တၭယမိဖ့ၬထ့ၬအ",
			"10": "<sup>10</sup> ခိၬလီၫ.- တၭစဎွၩစံၭဝ့ၫဒၪ, ဆၧဘၪဆဲၫ့လၧယၧၩဒဲန ၥံၪမွဲဘဲၫၥ့ၪလဲၪ. နးဇ့ၫရုၫအဲအၫ အဖိၪခွၫၥံၪဧ့, မွဲအ ဆိၪအၧၩ့ဒၪဝ့ၫဆံၭ, တၭယဟိဝၩအ့ၪစံၭဝ့ၫ, ဆိၪအၧၩ့ စဒၫဝံၭဘီၪ, တၭမွဲပလၫမိစံၭ, နမၩဘဲၫနီၪ, မွဲဘၪလဲၪ",
			"11": "<sup>11</sup> နီၪ,လဂၩလဲၪ.- တၭစဒၫဝံၭစံၭစအၭဘၡဲၫဒဲအခ့ၫအ ၡၩထီးအလူၬ, ယိခွါ, ယဖိၪခွၫလၧအဂဲၫထၪ့လၧယ ဎွံၬဖၧၩ့လဂၩ အၪ့ဎၬယၥၭမၧၫ့လီၫ. ဘိၩ့နဲၪ့ယီၩၦ ဘံၪ့ယမံၫ့ဖိၪနီၪ ဒံၩ့မိမၩဝ့ၫဆံၭဒိၪလဲၪ. အီၪဒၪဝ့ၫမွဲ အဆိၪအၧၩ့ဒၪဝ့ၫဘီၪး အဂဲးဘဲၫယီၩ ယဟိဝၩအၪ့မၧၫ့",
			"12": "<sup>12</sup> ဝ့ၫဒၪလီၫ.- ဘၪလဘၪ ယဟိဝၩ မိယိလၩ့ယဆၧနၭ ဆၧၡၪ့တၭ, ယဟိဝၩမိဖ့ၪကၪယၧၩ ဆၧဂ့ၩလၧအဆၧ",
			"13": "<sup>13</sup> ဆိၪအၧၩ့မုဆၫလနံၩယီၩအဂးလီၫ.- တၭစဒၫဝံၭဒဲအ ခ့ၫအၡၩလ့ၩဆၧလၧဖၧၩ့ၥၭတၭ, စၡံမအဲၫလ့ၩဝ့ၫလၧ ခိၪလီၩ့ဖၩဆဲၫဎၩ့လၧအဝ့ၫတၭ, လ့ၩဝ့ၫလခီၫ, ဆိၪ အၧၩ့ဝ့ၫလခီၫ, ဒဲခွံၬဝ့ၫလၧလိး ဒဲဎွံၪဝ့ၫလၧဂၪ့ခိၪမုၬ",
			"14": "<sup>14</sup> လီၫ.- တၭစဎွၩဒဲၦခမျၧးလၧအအီၪဝ့ၫ လၧအၥိၭထီး အလူၬ, ဂဲၫဝ့ၫတၭ, ဆၧပွံၭအၥၭနီၪ, အီၪပွံၭဝ့ၫထီးနီၪ လီၫ.",
			"15": "<sup>15</sup> စအၭဘစလၧၫ့, ဒဲၦခမျၧးထီးအလူၬ လၧအံၫစရ့ လၭအၡၩအကျၩနီၪ ဂဲၫဝ့ၫလၧယရုစလံၫ့တၭ, စအ",
			"16": "<sup>16</sup> ဟံၭၥိၫဖ့လၭအီၪလၧအဝ့ၫၥံၪအၥိၭလီၫ.- တၭဆၧမၩ အၥၭထီးစဒၫဝံၭအထံၩအၥိၭ ၦအၫခဲၫဖိၪ စဟုၡ့ၫဂဲၫ ဝ့ၫလၧစအၭဘစလၧၫ့အအီၪနီၪတၭ, စဟုၡ့ၫစံၭစအၭ",
			"17": "<sup>17</sup> ဘစလၧၫ့, မွဲစဎွၩမၧၫ့ဝ့ၫဆံၭ,မွဲစဎွၩမၧၫ့ဝ့ၫဆံၭ.- တၭ စအၭဘစလၧၫ့စံၭစဟုၡ့ၫ, အယီၩ,မွဲနခိးနတၩလၧန မၩနထံၩနၥိၭဆ့ဧၪ, နလလ့ၩဘၪ လၧနထံၩနၥိၭနီၪ,",
			"18": "<sup>18</sup> မွဲဘၪလဲၪ.- တၭစဟုၡ့ၫစံၭစအၭဘစလၧၫ့, မွဲအ့ၬး ၦ လၧယဟိဝၩဒဲၦခမျၧးယီၩ, ဒဲအံၫစရ့လၭအၡၩထီး အလူၬရွံန့ဝ့ၫလဂၩနီၪ, ယမိကဲၪထၪ့အဆၧ, ဒဲယမိ",
			"19": "<sup>19</sup> အီၪလၧအၥိၭလီၫ.- မၩဒီၭလဖၧၫ့ ယမိမၩဘၪပလၫ အဆၧလဂၩလဲၪ. လၧအဖိၪခွၫအမ့ၬယၫ မွဲအ့ၬဧၪ. ဘဲၫယမၩဆၧလၧနဖါအမ့ၬယၫ အၥိၭနီၪယမိအီၪလၧ",
			"20": "<sup>20</sup> နမ့ၬယၫဘဲၫနီၪလီၫ.- ထီးနီၪလဖၧၫ့စအၭဘစလၧၫ့စံၭ စအဟံၭၥိၫဖ့လၭ, ပမိမၩဘဲၫၥ့ၪလဲၪ ဘဲၫၥ့ၪလဲၪနီၪ, ဖ့ၪလၫ့ဆၧကိၪ့လၧနၥံၪအကျၩဆံၭ.",
			"21": "<sup>21</sup> တၭစအဟံၭၥိၫဖ့လၭစံၭစအၭဘစလၧၫ့, နဖါအၥံၪ မၫလၧအအီၪက့ၪလၩ့ထးဝ့ၫ ဘဲၫၥိၭအမိခိၭဂံၪ့လဖၪ နီၪလ့ၩနုၬလၧအအီၪဆံၭ, တၭအံၫစရ့လၭထီးအလူၬ မိနါဂၧၫ့လၧနဖါၥၭလိၪနၧၩတၭ, ကယဲၦလၧအအီၪလၧ",
			"22": "<sup>22</sup> နၥိၭကိၭဂၩဒ့ၭနီၪအစူၪမိဆီၪ့ထၪ့လီၫ.- အခိးမွဲၦမၩ ထၪ့စအၭဘစလၧၫ့အတဲၩ လၧဂံၪ့ခိၪတၭ, စအၭဘ စလၧၫ့လ့ၩနုၬလၧအဖါအၥံၪမၫလဖၪ အအီၪလၧအံၫ",
			"23": "<sup>23</sup> စရ့လၭထီးအလူၬအမ့ၬယၫလီၫ.- တၭစအဟံၭၥိၫဖ့ လၭအဆၧကိၪ့လၧအဒုၭကိၪ့ဆၧလၧ မုနံၩလဖၪနီၪမၩ အၥၭဘဲၫၦအၪ့စၪ့ဆၧလၧယွၩ အလူအၥိၭနီၪလီၫ. ကယဲစအဟံၭၥိၫဖ့လၭ အဆၧကိၪ့ထီးအလူၬမၩအ ၥၭဘဲၫနီၪလၧစဒၫဝံၭ, ဒဲစအၭဘစလၧၫ့ နံၫဂၩလူၬလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> စအဟံၭၥိၫဖ့လၭစံၭ စအၭဘစလၧၫ့ဒုၭရွံန့ယၧၩ လၧၦလလၬနံၫထီၫ့ဆံၭ, ယမိဂဲထုၪ့တၭ,ယမိလီၩ့ဆီး",
			"2": "<sup>2</sup> စဒၫဝံၭလၧမုလနၩယီၩလီၫ.- ယမိချႃၭန့အဝ့ၫ, လၧ ဆၧပွံၭအၥၭ ဒဲအစူၪလၩ့ဆါ အဘိၩ့ဘၭနီၪတၭ, ယမိ မၩၥၭမဲၪအဝ့ၫတၭ, ကယဲၦလၧအအီၪလၧအၥိၭကိၭ ဂၩဒ့ၭနီၪမိစဲၪ့ဖျိၭတၭ, ယမိဖ့ၬခွံၬန့ၫစဎွၩလဂၩလီၫ.",
			"3": "<sup>3</sup> တၭယမိဒုၭဂဲၫထဲၩ့ ၦခမျၧးထီးအလူၬ လၧနအီၪလီၫ. ၦလၧနအၪ့ဎၬဝ့ၫလဂၩနီၪ မၩအၥၭဘဲၫၦထီးအလူၬဂဲၫ ထဲၩ့အၥိၭနီၪလီၫ. ၦခမျၧးထီးအလူၬ မိအီၪလၧဆၧ",
			"4": "<sup>4</sup> ဘၪလိၬအိၭလိၬလီၫ.- တၭဆၧချဲၩ့နီၪ ဘၪစအၭဘစ လၧၫ့အၥၭဂ့ၩမၬ, ဒဲအံၫစရ့လၭအၥုၪ့က့ၭၥၭၡါထီး",
			"5": "<sup>5</sup> အလူၬဆ့လီၫ.- ထီးနီၪလဖၧၫ့, စအၭဘစလၧၫ့စံၭဝ့ၫ ဒၪ,ကိၭန့ၦအၫခဲၫဖိၪစဟုၡ့ၫဆ့ဆံၭ, မွဲဆၧနီၪလၫအီၪ လၧအနိၭလဲၪနီၪ ပမိနါဂၧၫ့ဘၪပၥၭဆ့လီၫ.",
			"6": "<sup>6</sup> စဟုၡ့ၫဂဲၫလၧစအၭဘစလၧၫ့ အအီၪတၭ, စံၭဝ့ၫ ဒၪ,စအဟံၭၥိၫဖ့လၭချဲၩ့ဆၧ ဘဲၫဆၧချဲၩ့ယီၩအၥိၭ နီၪပမိဘၪမၩဘဲၫအဆၧချဲၩ့နီၪအၥိၭဧၪ. အ့ၪလမွဲဘၪ တၭ,ချဲၩ့နဝ့ၫဒၪဆံၭ.",
			"7": "<sup>7</sup> တၭစဟုၡ့ၫစံၭစအၭဘစလၧၫ့, ဆၧကိၪ့လၧစအဟံၭ",
			"8": "<sup>8</sup> ၥိၫဖ့လၭဖ့ၪလၫ့ယူၭနီၪအယီၩလဖၧၫ့ဂ့ၩဝါအ့ၬ.- တၭ စဟုၡ့ၫစံၭဝ့ၫဒၪ, အဂဲးဘဲၫယီၩ နၥ့ၪယၫနဖါဒဲအၡၩ ၥံၪလၧအမွဲၦအဆီၪ့, ဒဲအၥၭဆၫ, ဘဲၫဖုၫထၫ့မိလၧၦ အၪ့ဂူၬန့အဖိၪလၧမံၩ့လၬကျၩအၥိၭနီၪတၭ, နဖါမွဲၦ ဒုၭၥုၭလဂၩတၭ မိအီၪလၧၦခမျၧးအၥိၭ ၥၫ့နၩချီၩ့",
			"9": "<sup>9</sup> အ့ၬ.- ယိခွါမွဲအအီၪၥူၪဝ့ၫဘိၩ့နဲၪ့ယီၩ လၧဆၧဖၧၩ့လ စီၪ့စီၪ့,အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, အီၪဝ့ၫလၧအလးလ စီၪ့စီၪ့နီၪ, ထီးၦလနၩ့နၩ့လၩ့ထံၩဖါဆိၫဝ့ၫတၭ, ဆၧ မိမၩအၥၭလၧထီးဒၪၦလၧ အနါဂၧၫ့ဝ့ၫလဂၩလါလါ နီၪမိစံၭဝ့ၫဒၪ, ဆၧမၩၥံၫလမံၩ့မံၩ့အီၪဝ့ၫ လၧၦလၧအ",
			"10": "<sup>10</sup> ဖိၬစအၭဘစလၧၫ့အခဲၫ့လဖၪအကျၩနီၪလီၫ.- တၭၦ အဆီၪ့လၧအၥၭ မၩအၥၭဘဲၫဆၬလၥၧၫ့အၥိၭနီၪမိ ဖံၪထၪ့တၡါဝ့ၫလီၫ. အဂဲးဘဲၫယီၩအံၫစရ့လၭထီးအ လူၬၥ့ၪယၫဝ့ၫ လၧနဖါမွဲၦအဆီၪ့ဒဲၦအီၪလၧအၥိၭလ",
			"11": "<sup>11</sup> ဖၪမွဲၦအဆီၪ့ဆ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭယဆၧကိၪ့ မွဲဝ့ၫလၧဆၧမိဒုၭအီၪကိၩ့အီၪကီၪ့ အံၫစရ့လၭထီးအ လူၬလၧနအီၪ, လၧဒၫ့ဖိးလၧဘံအၧၫၡံၫဘၫ, အၪဝ့ၫဘဲၫ မ့ၭၥံၪလၧမၫဆမံၭနဲၩ့အၥိၭနီၪ, ဒဲလၧနမိဘၪလ့ၩဒုၭ",
			"12": "<sup>12</sup> ၥုၭလၧနနၫ့ဆါဒၪနဝ့ၫလီၫ.- ထီးဒၪအလးလၧၦမိဒၪန့ ဝ့ၫလစီၪ့စီၪ့တၭ, ၦမိဆီးလၩ့လၧအလီၩ့ ဘဲၫဆၩ့ထံၫ လၩ့ဘၪဂၪ့ခိၪအၥိၭနီၪတၭး လၧအဝ့ၫဒၪ, ဒဲၦအီၪလၧ အၥိၭထီးအလူၬအကျၩနီၪ န့ၫလဂၩမိအီၪက့ၪလၩ့ထး",
			"13": "<sup>13</sup> ဘၪဝ့ၫဒၪအ့ၬ.- တၭအ့ၪအီၪက့ၪလၩ့အၥၭလၧဒိၩ့လ ဒိၩ့အဖၧၩ့တၭ, အံၫစရ့လၭထီးအလူၬ မိဘၪဂဲၫဆိၬ ဖျံၩလဖၪလၧဒိၩ့လဒိၩ့နီၪ, ပမိထုၭလၩ့န့ဝ့ၫ လၧထံၫ ချိၬဖၧၩ့ထီးလိးဖိၪအီၪလၩ့ထးဘၪ ထီးနီၪနးဖျိၪ့အ့ၬ.",
			"14": "<sup>14</sup> တၭစအၭဘစလၧၫ့ ဒဲအံၫစရ့လၭအၡၩထီးအလူၬ နီၪစံၭဝ့ၫဒၪ, ၦအၫခဲၫဖိၪစဟုၡ့ၫအဆၧကိၪ့လမံၩ့ယီၩ ဂ့ၩနဲၪ့စအဟံၭၥိၫဖ့လၭ အဆၧကိၪ့နီၪဒံၭလီၫ. အဂဲး ဘဲၫယီၩယဟိဝၩစ့ၩရၫ့ဆၧဘဲၫၥိၭ စဟံၭၥိၫဖ့လၭအ ဆၧကိၪ့ဂ့ၩလမံၩ့နီၪ မိဘၪလၧဆၧဂၭဂီၩ့, ဘဲၫၥိၭယ ဟိဝၩမိဒုၭဘၪဆၧအၧၩ့ လၧစအၭဘစလၧၫ့ အဖၫ့ခိၪ လီၫ.",
			"15": "<sup>15</sup> စဟုၡ့ၫစံၭၦလုဆၧစဇၫဒီၭ, ဒဲစအဘဲအၥၫ, စအ ဟံၭၥိၫဖ့လၭဒုၭကိၪ့ စအၭဘစလၧၫ့, ဒဲအံၫစရ့လၭ အၡၩၥုၪ့က့ၭၥၭၡါ ဘဲၫအံၩဘဲၫအိၩတၭ, ယဒုၭကိၪ့",
			"16": "<sup>16</sup> ထၪ့ယူၭယဝ့ၫဆၧဘဲၫအံၩဘဲၫအိၩလီၫ.- တၭဘိၩ့နဲၪ့ ယီၩအၪ့မၧၫ့လၩ့ဆၧ ချဲၫ့ချဲၫ့တၭ, လီၩဘၪစဒၫဝံၭ တၭ,စံၭ,အီၪၥၫ့နၩချီၩ့ လၧၡါမုနၧၫ့ဖၫအဆၧပျၩ့ဖၧၩ့ လဂ့ၩ,ခၫ့ဂၬအ့ၪချဲၫ့ဆံၭ, စဎွၩဒဲၦအီၪလၧအၥိၭထီး အလူၬမိဘၪဆၧယုလၩ့ခွံၬဘၪခိၬဝ့ၫလီၫ.",
			"17": "<sup>17</sup> စစၪ့နၥၧၫ့ဒဲစအဟံၭမအၭအီၪဝ့ၫ လၧအံၫ့ရိဂ့လၭ အနဲၩ့း အဂဲးဘဲၫယီၩ မွဲဆၧထီးဒၪဘၪအဝ့ၫၥံၪလ့ၩနုၬ လၧဒိၩ့ဖၧၩ့နီၪလဂ့ၩး ဎီးမုၪလဂၩလ့ၩလီၩဘၪအဝ့ၫ",
			"18": "<sup>18</sup> ၥံၪနီၪတၭ, အဝ့ၫၥံၪလ့ၩလီၩဘၪစဒၫဝံၭလီၫ.- မွဲလါ နၫ့ဘိၩၦဖိၪၥၪအခွၫလဂၩ ဒၪဘၪအဝ့ၫၥံၪတၭ, လီၩ ဘၪစအၭဘစလၧၫ့လီၫ. အ့ၪမွဲၦနံၫဂၩနီၪလ့ၩဆၧချဲၫ့ ချဲၫ့တၭ,ဂဲၫထီၩ့လၧၦလဂၩအဂံၪ့ လၧဘဟုရံၫ့အဖၧၩ့ လၧထံၫဖၧၩ့ အီၪလၧအဝၩ့ဖၧၩ့နီၪတၭ, အဝ့ၫၥံၪစဲၪ့",
			"19": "<sup>19</sup> လၩ့ဝ့ၫလၧအဖၧၩ့လီၫ.- ၦမုၪနီၪမၩန့ဒၩလၩ့ထၬထံၫ ဖၧၩ့အခိၪထိၭတၭ, အၪ့လိၫလၩ့ဂူၫဆၪ လၧအဖၫ့ခိၪ",
			"20": "<sup>20</sup> တၭး ဆၧလမံၩ့နီၪ ၦၥ့ၪယၫဝ့ၫအ့ၬ.- ထီးစအၭဘစ လၧၫ့အခ့ၫအၡၩဂဲၫ လၧၦမုၪနီၪအအီၪ လၧဂံၪ့ဖၧၩ့ တၭ,အဝ့ၫၥံၪစံၭ, စစၪ့နၥၧၫ့, ဒဲစအဟံမအၭနီၪမွဲအ အီၪခီၫခီၫလဲၪ. တၭၦမုၪနီၪစံၭအဝ့ၫၥံၪ, ၦၡၩနီၪခၫ့ဂၬ ယူၭထံၫချိၬယူၭ. ထီးအဝ့ၫၥံၪအၪ့ဎၬနီၪလဒၪဘၪဝ့ၫ",
			"21": "<sup>21</sup> တၭ,ထဲၩ့ထဲၩ့ဝ့ၫလၧယရုစလံၫ့လီၫ.- တၭလၧအဝ့ၫ ၥံၪစဲၪ့ထၪ့ခွံၬ အလးခဲၫ့နီၪဆၧမၩအၥၭ လၧၦလဖၪနီၪ စဲၪ့ထၪ့ခွံၬ လၧထံၫဖၧၩ့နီၪ, လ့ၩလီၩဘၪ စဎွၩဒၫဝံၭ တၭ,စံၭစဒၫဝံၭ, ဂဲထုၪ့တၭခၫ့ဂၬထံၫချိၬ ချဲၫ့ချဲၫ့ဆံၭ. အဂဲးဘဲၫယီၩ စအဟံၭၥိၫဖ့လၭဒုၭကိၪ့ဆၧထၫ့ဒုၪဒၩ",
			"22": "<sup>22</sup> နၥံၪဘဲၫအံၩဘဲၫအိၩလီၫ.- ထီးနီၪလဖၧၫ့ စဒၫဝံၭဂဲ ထုၪ့,ဒဲကယဲၦလၧအအီၪလၧ အၥိၭလဖၪတၭ, ခၫ့ဂၬ ယီၫဒၫ့လီၫ. ထီးမုဆဲၪ့ထၪ့နီၪ ၦလၧအလခၫ့ဂၬဒံၭဘၪ ယီၫဒၫ့အီၪနးဂၩအ့ၬ.",
			"23": "<sup>23</sup> ထီးစအဟံၭၥိၫဖ့လၭ, ဒၪဘၪဝ့ၫလၧၦၡၩလမၩဘၪ ဘဲၫအဝ့ၫဒၪကိၪ့ထၪ့ဆၧအၥိၭနီၪတၭ, အီၪက့ၪထၪ့ပီၩ့ လၧကၥ့ၪယီၩ့အလီၩ့တၭ, ဂဲထုၪ့တၭထဲၩ့ထဲၩ့ဝ့ၫလၧ အဂံၪ့, လၧအဒိၩ့ဒၪဝ့ၫအဖၧၩ့တၭ, မၪလူၬအၡၩဂံၪ့ဖိၪ အဆၧတၭ, စၧၩ့လၩ့ၥံၫအၥၭတၭ, ၥံၫဝ့ၫနီၪ, ဘၪဆၧ ခုၪ့လၩ့ဘၧၩ့ခွံၬဝ့ၫ လၧအဖါအၥွၪခိၪဖၧၩ့နီၪလီၫ.",
			"24": "<sup>24</sup> ထီးနီၪလဖၧၫ့ စဒၫဝံၭ ဂဲၫဝ့ၫလၧမၫဟနၫအံၫ့လီၫ. စအၭဘစလၧၫ့ခၫ့ဂၬယီၫဒၫ့, အဝ့ၫဒၪဒဲအံၫစရ့လၭအ ၡၩထီးအလူၬလၧအၥိၭလီၫ.",
			"25": "<sup>25</sup> တၭစအၭဘစလၧၫ့ဒုၭကဲၪစအၫမစၫ လၧၥုၭမုခ မျၧးအခိၪလၧစယိအၭအလးလီၫ. စအၫမစၫမွဲၦလဂၩ အဖိၪခွၫ, ၦလၧအမံၩ့မွဲစအံၥၫၦအံၫစရ့လၭဖိၪလၧ အလ့ၩနုၬလၧနးအၭဘဂၫလၭအအီၪ, လၧအမွဲစယိ အၭနးဇ့ၫရုၫအဲအၫအထၧၫ့ဖုဝဲမုၪ, စနၫဟၭအဖိၪမုၪလီၫ.",
			"26": "<sup>26</sup> တၭအံၫစရ့လၭ ဒဲစအၭဘစလၧၫ့ၥုၪ့တဲၩ လၧခး ဂံလအၭအဖၧၩ့လီၫ.",
			"27": "<sup>27</sup> ထီးစဒၫဝံၭဂဲၫထီၩ့လၧမၫဟနၫအံၫ့တၭ, ဆၧမၩအ ၥၭလၧၦအၫမၧၫ့ဖိၪ စနၫဟၭအဖိၪခွၫ စၡိဘဲၫဘၪဆဲၫ့ လၧရၭဘၫ, ဒဲစအၫမအ့လၭအဖိၪခွၫ စမၫခၧၫဘၪဆဲၫ့ လၧလိၫဒံဘၫ, ဒဲၦဂံလအၭဖိၪစဘၫဇံလ့ၫဘၪဆဲၫ့လၧ",
			"28": "<sup>28</sup> ရိၫဇံလံၫ့ၥံၪနီၪ,- ဂဲၫဆိၬလးမံၫၥံၪ, ဒဲလိၫ့ၥံၪ, ဒဲဖၧၩ့ၥံၪ, ဒဲဘုၪကၠိၩ့, ဒဲဘုၪမုယီၩ, ဒဲကိၪမုၬ, ဒဲဘုၪဖီး,ဒဲပထိၭၥၪ,",
			"29": "<sup>29</sup> ဒဲဘဲၩ့ၥၪ,ဒဲဆၧအၪ့ဝ့ၭဖီး,- ဒဲန့ၫစၩ့,ဒဲထီဘၭ, ဒဲၥိၪ,ဒဲ ချီနူထံၫခိလီၪ့လဖၪလၧစဒၫဝံၭအဂး, ဒဲလၧၦၡၩလၧ အအီၪလၧအၥိၭမိအၪ့အဂးလီၫ. အဂဲးဘဲၫယီၩမွဲအ စံၭဝ့ၫဒၪ, ၦခမျၧးနီၪဆၧၥၭဝံအၥၭ, ဒဲဆၧပွံၭအၥၭ, ဒဲ ဆၧၥူၫအၥၭလၧထံၫလၧၡါမုနၧၫ့ဖၫနီၪလီၫ."
		},
		"18": {
			"1": "<sup>1</sup> စဒၫဝံၭ, ဝံထၪ့နၬထၪ့ၦခမျၧးလၧအအီၪလၧအၥိၭ တၭ, အီၪက့ၪၦအထီၫ့ၥံၪအခိၪလဖၪ, ဒဲၦအယၩၥံၪ",
			"2": "<sup>2</sup> အခိၪလဖၪ လၧအဝ့ၫၥံၪအဖၫ့ခိၪလီၫ.- တၭစဒၫဝံၭ အၪ့မၧၫ့လၩ့ၥၧၫ့ဒီၪ့လဒီၪ့ လၧစယိအၭအစူၪဖၧၩ့, ဒဲ ၥၧၫ့ဒီၪ့လဒီၪ့ လၧနးဇ့ၫရုၫအဲအၫအဖိၪခွၫ စယိအၭအ ထၧၫ့ဖုဝဲစအၭဘၡဲၫအစူၪဖၧၩ့, ဒဲၥၧၫ့ဒီၪ့လဒီၪ့လၧၦဂံ တဲၫဖိၪစအံၭတအဲၫ အစူၪဖၧၩ့လီၫ. တၭစဎွၩစံၭၦခ မျၧးၥံၪ,ယမိလ့ၩထၪ့ ယနၫ့ဆါဒၪယဝ့ၫ လၧနၥံၪအ",
			"3": "<sup>3</sup> ၥိၭတၡါလီၫ.- တၭၦခမျၧးစံၭဆၧၫ့ဝ့ၫဒၪ, နလ့ၩဘၪ အ့ၬ,အဂဲးဘဲၫယီၩပအ့ၪစဲၪ့တၭ, အဝ့ၫၥံၪနီၪအီၪက့ၪ ပၧၩလၧအၥၭအ့ၬ. ပဝ့ၫဒၪယီၩပအ့ၪၥံၫဖိၭဖၫ့လါနၫ့ တၭ,အဝ့ၫၥံၪအီၪက့ၪပၧၩ လၧအၥၭအ့ၬ. အဂဲးဘဲၫ ယီၩဘိၩ့နဲၪ့ယီၩနဂ့ၩနဲၪ့ဒံၭၦလလၬနီၪဒံၭလီၫ. အခိး မွဲဘိၩ့နဲၪ့ယီၩ နအီၪမၩဆၧၩ့ပၧၩလၧဒိၩ့နီၪ မွဲအဂ့ၩ",
			"4": "<sup>4</sup> ဒၪအဆၧဒံၭလီၫ.- တၭစဎွၩစံၭအဝ့ၫၥံၪ, ယမိမၩဆၧ အဂ့ၩလၧနၥံၪအမ့ၬယၫလီၫ. တၭစဎွၩဆၧၫ့ထုၪ့လၧ အတရၫ့အနဲၩ့တၭ, ၦခမျၧးထီးအလူၬဂဲၫထၪ့လၧခီၫ့ အယၩလဖၪ, ဒဲအထီၫ့လဖၪလီၫ.",
			"5": "<sup>5</sup> တၭစဎွၩမၪလူၬစယိအၭ, ဒဲစအၭဘၡဲၫ,ဒဲစအံၭ တအဲၫၥံၪ,စံၭဝ့ၫဒၪ, မၩၦဖိၪၥၪခွၫစအၭဘစလၧၫ့စီၩစီၩ လၧယကၠီၩ့ဆံၭ. တၭစဒၫဝံၭမၪလူၬ ၦၥုၭဖိၪအခိၪလ ဖၪလၧစအၭဘစလၧၫ့အဂဲးအကၠီၪ့နီၪ, ၦခမျၧးနါဂၧၫ့ ဝ့ၫကိၭဂၩဒ့ၭလီၫ.",
			"6": "<sup>6</sup> အခိးမွဲဘဲၫနီၪၦခမျၧးစဲၪ့ထၪ့ဝ့ၫ လၧဆၧပျၩ့ဖၧၩ့ ထၫ့ဒုၪဒၩအံၫစရ့လၭတၭ, ဆၧဒုၭၥုၭအီၪဝ့ၫလၧအံဖြံၫ့",
			"7": "<sup>7</sup> အၥံၪ့လစီၪ့အကျၩလီၫ.- တၭအံၫစရ့လၭအၡၩခမျၧး ဘၪဆၧမၩၥံၫဝ့ၫလၧစဒၫဝံၭအခ့ၫအၡၩ အမ့ၬယၫတၭ, ဆၧလၧမုလနံၩနီၪ ဆၧမၩၥံၫဖၭဒိၪ အီၪဝ့ၫၦၡၩနံၫလၬ",
			"8": "<sup>8</sup> လီၫ.- ဆၧဒုၭၥုၭနီၪလၩ့ပြံၩလၩ့ပၩ ထီးလၧခးထၧၫ့ ဘံၪ့ယၫတၭ, ဆၧလၧမုလနံၩနီၪ ၥံၪ့လစီၪ့နီၪအၪ့ခွံၬ ၦၡၩအၪနဲၪ့နၭၥံၪဖၩ့ၥံၪ အၪ့ခွံၬဆၧဒံၭလီၫ.",
			"9": "<sup>9</sup> စအၭဘစလၧၫ့ ဘၪခီၩ့စဒၫဝံၭအခ့ၫအၡၩလီၫ. စ အၭဘစလၧၫ့ထူၬကၥ့ၪလၫတၭ, ကၥ့ၪလၫလ့ၩဝ့ၫလၧ ၥံၪ့ထိၭဖၫအထဲၩ့တၪ့အဖၫ့လၬတၭ စအၭဘစလၧၫ့အ ခိၪၥူၫဘၪကွၭလၧၥံၪ့ထိၭဖၫနီၪ, အနၫ့ဆါလၩ့ဆဲၩလၧ ဆၧဖိၭဖၫ့လီၫ. တၭကၥ့ၪလၫလၧအအီၪဝ့ၫလၧအဝ့ၫ",
			"10": "<sup>10</sup> ဒၪအဖၫ့လၬနီၪ စဲၪ့ခွံၬဝ့ၫဒၪလီၫ.- ၦလဂၩဒၪဘၪဝ့ၫ နီၪ,လီၩဘၪစယိအၭတၭ, စံၭဝ့ၫဒၪ, ယိခွါ,ယဒၪဘၪ စအၭဘစလၧၫ့ လၩ့ဆဲၩလၧၥံၪ့ထိၭဖၫလထံၭအခံၫ",
			"11": "<sup>11</sup> လီၫ.- စယိအၭစံၭၦလၧအလီၩဘၪဝ့ၫနီၪ, ယိခွါ,နဒၪ ဘၪတၭနလဖ့ၬခွံၬဘၪနဝ့ၫထီးနီၪ ထီၩ့လၩ့လၧဂၪ့ခိၪ နီၪ,မွဲဘၪလဲၪ, တၭယမိဖ့ၪလၫ့နၧၩလၧစ့ၩဆံၫဘံၪ့ဒဲ",
			"12": "<sup>12</sup> ခၧၩ့ယးလီၫ.- ၦလဂၩနီၪစံၭစယိအၭ, ယအ့ၪဒိၭန့စ့ၩ လထီၫ့လၧယစူၪဖၧၩ့လါနၫ့တၭ, ယယၩ့ထၪ့ယစူၪ ထၫ့ဒုၪဒၩစဎွၩအဖိၪခွၫဆ့အ့ၬ. အဂဲးဘဲၫယီၩလၧပ နါဖၧၩ့နီၪစဎွၩမၪလူၬနၧၩ ဒဲစအၭဘၡဲၫဒဲစအံၭတအဲၫ တၭ,စံၭဝ့ၫဒၪ, နၥံၪမၩၦဖိၪၥၪခွၫစအၭဘစလၧၫ့ဘဲၫ",
			"13": "<sup>13</sup> ၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ ထီးလၩ့နၥံၪအၥၭဆံၭ.- အ့ၪလ မွဲဘၪဘဲၫနီၪတၭ, ယမိမၩဆၧထၫ့ဒုၪဒၩယၥၭမၧၫ့ဒၪ ယဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ဆၧအီၪၥူၪလၧစဎွၩအမ့ၬ ယၫနးမံၩ့အ့ၬ. တၭနဝ့ၫဒၪနနၫ့ဆါဒၪနဝ့ၫ နမိအီၪက့ၪ",
			"14": "<sup>14</sup> ထၪ့နၥၭထၫ့ဒုၪဒၩယၧၩဆ့လီၫ.- ထီးနီၪလဖၧၫ့ စယိ အၭစံၭဝ့ၫဒၪ, ယအီၪယံၬအီၪနးလၧနၧၩ ဘဲၫယီၩၥ့ၪ အ့ၬ.အဝ့ၫဒၪ မၩန့ဖၩ့ၥၧၫ့ဘံၪ့ လၧအစူၪဖၧၩ့တၭ, ဆ့ၭဖျီၫ့စအၭဘစလၧၫ့ အၥၭဘိၩ့ အမၧၫ့ဒံၭလၧၥံၪ့",
			"15": "<sup>15</sup> ထိၭဖၫအခံၫနီၪလီၫ.- ၦဖိၪၥၪခွၫဆံၫဂၩလၧအဆိၬစ ယိအၭအစူၪဝဲၩနီၪ ဝၩ့ထၬဖ့ၬခွံၬစအၭဘစလၧၫ့တၭ, မၩၥံၫအဝ့ၫလီၫ.",
			"16": "<sup>16</sup> စယိအၭအူၪထၪ့ခွ့ၩတၭ, ၦခမျၧးဂဲၫထဲၩ့ထဲၩ့လၧ အလီၩ့ဆီး အံၫစရ့လၭနီၪလီၫ. အဂဲးဘဲၫယီၩ စယိ",
			"17": "<sup>17</sup> အၭပဒၩ့ၦခမျၧးလီၫ.- အဝ့ၫၥံၪမၩန့ စအၭဘစလၧၫ့ တၭ,ခွံၬလၩ့ခွံၬဝ့ၫလၧ ဆၧဖၧၩ့ဖၭဒိၪ လၧအအီၪဝ့ၫ လၧၥံၪ့လဝၩ့နီၪအကျၩတၭ, အီၪက့ၪကီၪ့လိးဖၭဒိၪလ ပိၩ့လၧအဖၫ့ခိၪတၭ, အံၫစရ့လၭထီးအလူၬစဲၪ့ဝ့ၫလ ဂၩလၧအတဲၩဒၪဝ့ၫ, လဂၩလၧအတဲၩဒၪဝ့ၫဆုၬဆုၬ လီၫ.",
			"18": "<sup>18</sup> တၭစအၭဘစလၧၫ့ လၧအမၧၫ့ဒံၭအဘိၩ့ဘၭနီၪ, မၩန့ထုၪ့ဖၭဒိၪလထုၪ့တၭ, အီၪက့ၪဝ့ၫထုၪ့လၧၫ့လၧ အဂးဒၪဝ့ၫ, လၧအအီၪဝ့ၫ လၧစဎွၩ အခိၪလီၩ့ဆူၭ လီၫ. အဂဲးဘဲၫယီၩ စံၭဝ့ၫ, ယဖိၪခွၫ လၧအမိဒုၭနၪ့ ထၪ့ထဲၩ့ယမံၩ့အီၪအ့ၬ. တၭဖျိၬထုၪ့နီၪအမံၩ့ လၧအ မံၩ့ဒၪဝ့ၫတၭ, ၦကိၭဝ့ၫလၧစအၭဘစလၧၫ့အစူၪခီးမု ဆၫလနံၩယီၩလီၫ.",
			"19": "<sup>19</sup> တၭစဇၫဒီၭအဖိၪခွၫ စအဟံမအၭစံၭဝ့ၫဒၪ,ဒုၭစဲၪ့ ယၧၩဘီၪး တၭယမိဆိၬန့ စဎွၩလၧအဆၧပရၧၫ့လၧ ယွၩစ့ၩရၫ့ဝ့ၫ လၧအဖီၩ့ဖျ့ၭ အဒုၪအဒၩ အစူၪဖၧၩ့",
			"20": "<sup>20</sup> လီၫ.- တၭစယိအၭစံၭဝ့ၫဒၪ, လၧမုဆၫလနံၩယီၩန ဆိၬဘၪဆၧပရၧၫ့အ့ၬ. အ့ၪမွဲမုနးနံၩဒီၭနီၪ နမိဆိၬဆၧ ပရၧၫ့လီၫ. အ့ၪမွဲမုဆၫလနံၩယီၩ နဆိၬဘၪဆၧပရၧၫ့",
			"21": "<sup>21</sup> အ့ၬ. အဂဲးဘဲၫယီၩစဎွၩအဖိၪခွၫၥံၫယူၭ.- တၭစယိ အၭစံၭစကုၡဲၫ, လ့ၩလီၩဘၪစဎွၩလၧဆၧလၧနဒၪဘၪ ဆံၭ,စကုၡဲၫၡီၫ့လၩ့အခိၪ လၧစယိအၭ အမ့ၬယၫ",
			"22": "<sup>22</sup> တၭ,စဲၪ့တလဲးဝ့ၫလီၫ.- ထီးနီၪလဖၧၫ့စဇၫဒီၭအဖိၪ ခွၫစအဟံမအၭ စံၭဒီၭစယိအၭ, မွဲလါနၫ့ထီးဒၪဆၧ မၩအၥၭနီၪ ဒုၭစဲၪ့လါယၧၩ လၧစကုၡဲၫ အၥိၭဆံၭ. တၭစယိအၭစံၭဝ့ၫဒၪ, ယဖိၪခွၫဧ့, နဆၧပရၧၫ့လအီၪ",
			"23": "<sup>23</sup> ဝဲၩဘၪနးမံၩ့တၭ, နမိလ့ၩစဲၪ့မွဲဘၪလဲၪ.- မွဲလါနၫ့ထီး ဒၪဆၧမၩအၥၭနီၪ, ဒုၭစဲၪ့လါယၧၩဆံၭ. တၭအဝ့ၫ ဒၪစံၭအဝ့ၫ, စဲၪ့ဘီၪ. ထီးနီၪလဖၧၫ့ စအဟံမအၭစဲၪ့ တလဲးဝ့ၫလၧဆၧပျၩ့ဖၧၩ့အဖၧၩ့ၥၭတၭ, လ့ၩဖီၩ့ခွံၬ စကုၡဲၫနီၪလီၫ.",
			"24": "<sup>24</sup> စဒၫဝံၭဆၧၫ့နၩ့ဝ့ၫ လၧတရၫ့နံၫဘံၪ့ အဘိၩ့ဆၧၩ့ တၭ,ၦခိၭဆၧဖိၪလ့ၩထၪ့လၧဆၧ အခိၪလၧတရၫ့အ ဖၫ့ခိၪလခီၫ ထီၩ့လၧဆၧအခိၪဒၧၩ့တၭ, ကျဲၪ့ထၪ့အ မ့ၬ,ယိဝ့ၫတၭ, ယိခွါ,ၦလဂၩစဲၪ့တလဲးဝ့ၫ လဂၩဎး",
			"25": "<sup>25</sup> လီၫ.- ၦခိၭဆၧနီၪကိၭထၪ့တၭ, လီၩဘၪစဎွၩတၭ,စ ဎွၩစံၭဝ့ၫဒၪ, အ့ၪအီၪလဂၩဎးတၭ, အီၪဝ့ၫလၧဆၧအ ပရၧၫ့လၧအနိၭဖၧၩ့လီၫ. ဂဲၫဝ့ၫတၭ, ၥုၭဘူၭအၥၭ",
			"26": "<sup>26</sup> လီၫ.- ၦခိၭဆၧဖိၪဒၪၦၡၩဂူၫဂၩလဂၩဒၪစဲၪ့တလဲးဝ့ၫ တၭ,ၦခိၭဆၧဖိၪကိၭစိၩၦပၧၩ့တရၫ့လဂၩတၭ, စံၭ ဝ့ၫဒၪ,ယိခွါ, ၦလဂၩစဲၪ့တလဲးလဂၩဎးလီၫ. တၭစ",
			"27": "<sup>27</sup> ဎွၩစံၭဝ့ၫဒၪ, အဝ့ၫဆိၬဆၧအပရၧၫ့ဆ့လီၫ.- တၭၦခိၭ ဆၧဖိၪစံၭဝ့ၫဒၪ, ယဒၪၦလၧအစဲၪ့လၧယၫလဂၩ,လၩ့ ဂၬဘဲၫစဇၫဒီၭအဖိၪခွၫစအဟံမအၭ စဲၪ့တလဲးအၥိၭ နီၪလီၫ.တၭစဎွၩစံၭဝ့ၫဒၪ, အဝ့ၫလဂၩနီၪ မွဲၦၡၩအ ဂ့ၩတၭ,ဂဲၫဝ့ၫလၧဆၧပရၧၫ့အဂ့ၩလီၫ.",
			"28": "<sup>28</sup> တၭစအဟံမအၭ ကိၭထၪ့, စံၭစဎွၩ, ဆၧအမုၬ လီၫ. ထွံၩလၩ့လၧစဎွၩအမ့ၬယၫတၭ, စံၭဝ့ၫဒၪ, ယ ဟိဝၩနယွၩလၧအဖ့ၪလၫ့ခွံၬ ၦလၧအယၩ့ထၪ့အစူၪ ထၫ့ဒၩယကဆါစဎွၩနီၪ, မွဲအဘၪဆၧစံၭထၪ့အၪ့အူၭ",
			"29": "<sup>29</sup> ဆံၭ.- စဎွၩစံၭဝ့ၫဒၪ, ၦဖိၪၥၪခွၫစအၭဘစလၧၫ့နီၪ,မွဲ အအီၪမုၬဆ့ဧၪ. တၭစအဟံမအၭစံၭဝ့ၫဒၪ, လၧစယိ အၭအၪ့မၧၫ့လၩ့စဎွၩအခ့ၫအၡၩ, ဒဲနခ့ၫနၡၩယၧၩ, ယဒၪဘၪဆၧတုၩ့ထၪ့တုၩ့လၩ့ဖၭဒိၪ လါနၫ့ဘိၩမွဲနီၫ",
			"30": "<sup>30</sup> လဲၪ, နီၫလဲၪနီၪယၥ့ၪယၫအ့ၬ.- စဎွၩစံၭဝ့ၫ,ကၠၪထဲၩ့န ၥၭတၭ, ဆၧၫ့ထုၪ့ထီးယီၩဘီၪ. တၭအဝ့ၫဒၪကၠၪစိၩ",
			"31": "<sup>31</sup> အၥၭတၭ, ဆၧၫ့ထုၪ့ဝ့ၫလီၫ.- တၭယိခွါ,စကုၡဲၫဂဲၫဝ့ၫတၭ စကုၡဲၫစံၭဝ့ၫဒၪ, ဆၧပရၧၫ့,ယကဆါစဎွၩဧ့ၬ အ ဂဲးဘဲၫယီၩလၧမုဆၫလနံၩယီၩ ယဟိဝၩစ့ၩရၫ့တီၩန့ နၧၩလၧကယဲၦလၧအဂဲထုၪ့ထၫ့ဒုၪဒၩနၧၩ ထီးအလူၬ",
			"32": "<sup>32</sup> အစူၪဖၧၩ့နီၪလီၫ.- တၭစဎွၩစံၭ စကုၡဲၫနီၪ, ၦဖိၪၥၪ ခွၫစအၭဘစလၧၫ့နီၪ, မွဲအအီၪမုၬဆ့ဧၪ. တၭစကုၡဲၫ စံၭဆၧၫ့ဝ့ၫ, ယကဆါစဎွၩအဒုၪအဒၩ, ဒဲကယဲၦလၧ အဂဲထုၪ့ထၫ့ဒုၪဒၩနၧၩ ဘဲၫၥိၭအမိမၩအၧၩ့နၧၩ ထီး",
			"33": "<sup>33</sup> အလူၬနီၪ, မွဲအအီၪဘဲၫဖိၪၥၪခွၫအၥိၭနီၪဆံၭ.- စဎွၩ အၥၭဘၪထံၭနၭမၬတၭ လ့ၩထၪ့ဝ့ၫလၧဒူၭဖၧၩ့လၧတ ရၫ့အဖၫ့ခိၪတၭ, ဂၪ့ဝ့ၫလီၫ. လ့ၩဆၧ အဘိၩ့ဘၭနီၪ တၭ,စံၭဝ့ၫဘဲၫယီၩ, ယဖိၪခွၫစအၭဘစလၧၫ့ဧ့, ယဖိၪ ခွၫဧ့, ယဖိၪခွၫ စအၭဘစလၧၫ့ဧ့ၬ ယအ့ၪၥံၫခ့ၬယူၭ လၧနလး မွဲအဂ့ၩဒၪဆၧဒံၭလီၫၬ စအၭဘစလၧၫ့ဧ့ၬ ယဖိၪခွၫဧ့ၬ ယဖိၪခွၫဧ့ၬ"
		},
		"19": {
			"1": "<sup>1</sup> ဆၧလီၩဘၪစယိအၭ, ယိခွါ,စဎွၩဂၪ့တၭ,အၥၭယူ",
			"2": "<sup>2</sup> မီၪ့ဘၪစအၭဘစလၧၫ့လီၫ.- တၭဆၧလၧမုလနံၩနီၪ အဆၧမၩနၧၩ့မၩစၪကဲၪထၪ့ဝ့ၫ လၧဆၧမီၪ့ဆၧမၭလၧ ၦထီးအလူၬအဂးလီၫ. အဂဲးဘဲၫယီၩ ၦခမျၧးနါဂၧၫ့ လၧမုဆၫလနံၩနီၪ လၧစဎွၩအၥုၪ့အုၭၥၭအုၭ လၧအ",
			"3": "<sup>3</sup> ဖိၪခွၫအကၠီၩ့နီၪလီၫ.- ၦခမျၧးနီၪဂဲၫၥူၪဝ့ၫလၧဒိၩ့ဖၧၩ့, ဘဲၫၦလၧအမ့ၬမဲ အီၪက့ၪၥူၪအၥၭ ထီးအစဲၪ့ဖျိၭဝ့ၫ",
			"4": "<sup>4</sup> လၧဆၧဒုၭၥုၭနီၪလီၫ.- စဎွၩချႃၬဘံၭအမ့ၬတၭ, စဎွၩ ကိၭၡၭထၪ့လၧအလူဖၭဒိၪ, ယဖိၪခွၫစအၭဘစလၧၫ့ ဧ့ၬ စအၭဘစလၧၫ့ဧ့ၬ ယဖိၪခွၫဧ့ၬ ယဖိၪခွၫဧ့ၬ",
			"5": "<sup>5</sup> စယိအၭဂဲၫနုၬလၧဂံၪ့ဖၧၩ့ လၧစဎွၩအအီၪတၭ,စံၭ ဝ့ၫဒၪ, ဆၧလၧမုဆၫလနံၩယီၩ, နဒုၭမ့ၬမဲနခ့ၫနၡၩထီး အလူၬလၧအမၩဖီၩ့မၩဖျ့ၭ နၥၭမၧၫ့လၧမုဆၫလနံၩ ယီၩ,ဒဲနဖိၪခွၫလဖၪ, ဒဲနဖိၪမုၪလဖၪအၥၭမၧၫ့, ဒဲနမၫ",
			"6": "<sup>6</sup> လဖၪအၥၭမၧၫ့, ဒဲနၥံၪမၫလဖၪအၥၭမၧၫ့း- လၧနအဲၪ နဒုၪနဒၩတၭ, မ့ၬလဲၩနထံၩနၥိၭအကၠီၩ့နီၪလီၫ. အဂဲး ဘဲၫယီၩ နဒုၭနဲၪလၧမုဆၫလနံၩယီၩ လၧၦဒိၪမွဲဂ့ၩ, ဆၧအခ့ၫအၡၩမွဲဂ့ၩ, မွဲဆၧလၧနမ့ၬယၫအ့ၬ. အဂဲး ဘဲၫယီၩယၥ့ၪယၫလၧမုဆၫလနံၩယီၩ လၧစအၭဘစ လၧၫ့အ့ၪမၧၫ့ဒံၭတၭ, ပအ့ၪၥံၫပဝ့ၫ လၧမုဆၫလနံၩ",
			"7": "<sup>7</sup> ယီၩကိၭဂၩဒ့ၭ, မွဲဆၧအဂ့ၩလၧနမ့ၬယၫလီၫ.- ဘိၩ့ နဲၪ့ယီၩဂဲထုၪ့တၭ, လ့ၩထၪ့ချဲၩ့မုၬဆၧလၧနခ့ၫနၡၩ လဖၪဆံၭ. အဂဲးဘဲၫယီၩ ယဆိၪလၩ့ယၥၭလၧယဟိ ဝၩအမ့ၬယၫ လၧနအ့ၪလလ့ၩထၪ့ဘၪတၭ, ကဲမုနၩ ခိၬယီၩၦမိအီၪလၧနၥိၭနးဂၩအ့ၬ. တၭဆၧအၧၩ့ယီၩ မိနၭနဲၪ့ကယဲဆၧအၧၩ့လၧအဘၪနၧၩ ခီၫလၧနဖိၪၥၪ",
			"8": "<sup>8</sup> ခွၫထၪ့ခီးဘိၩ့နဲၪ့ယီၩလီၫ.- ထီးနီၪလဖၧၫ့စဎွၩဂဲထုၪ့ တၭ,ဆၧၫ့နၩ့ဝ့ၫလၧတရၫ့ဖၧၩ့တၭ, ၦလဖၪလီၩဘၪၦ ခမျၧးထီးအလူၬ, စံၭဝ့ၫ,ယိခွါ, စဎွၩဆၧၫ့နၩ့ဝ့ၫလၧ တရၫ့ဖၧၩ့လီၫ. တၭၦထီးအလူၬ ဂဲၫဝ့ၫလၧစဎွၩအ မ့ၬယၫလီၫ. အဂဲးဘဲၫယီၩအံၫစရ့လၭထဲၩ့စဲၪ့ထၪ့ယူၭ လဂၩလၧအတဲၩဒၪဝ့ၫ, လဂၩလၧအတဲၩဒၪဝ့ၫလီၫ.",
			"9": "<sup>9</sup> လၧကယဲအံၫစရ့လၭ အဒီၪ့လဖၪအကျၩနီၪ, ၦ ခမျၧးထီးအလူၬဂဲးလိၬတ့ၭလိၬအၥၭတၭ, စံၭဝ့ၫဒၪ, စဎွၩမၩဖီၩ့မၩဖျ့ၭပၧၩ လၧပဒုၪပဒၩအစူၪဖၧၩ့, ဒဲမၩ ဂၭဖျ့ၭပၧၩလၧၦဖလံၡၫဖိၪအစူၪဖၧၩ့လီၫ. တၭဘိၩ့နဲၪ့ ယီၩမွဲအစဲၪ့ထၪ့ခွံၬ လၧခးဖၧၩ့လၧစအၭဘစလၧၫ့အ",
			"10": "<sup>10</sup> ကၠီၩ့လဲၪၬ- တၭစအၭဘစလၧၫ့ လၧပဂုၪဝ့ၫလၧပဖၫ့ ခိၪၥံၫယူၭလၧဆၧဒုၭၥုၭအဖၧၩ့ယူၭ. တၭဘိၩ့နဲၪ့ယီၩ ဂဲၫထဲၩ့ၥိၫ့ထဲၩ့ စဎွၩအဂဲးအကၠီၪ့နီၪ နၥံၪလချဲၩ့ဘၪ ဆၧနးထံၪ, မွဲဘၪလဲၪ.",
			"11": "<sup>11</sup> တၭစဎွၩဒၫဝံၭမၪလူၬၦလုဆၧလဖၪ, စဇၫဒီၭ,ဒဲစ အဘဲအၥၫတၭ,စံၭဝ့ၫဒၪ, ချဲၩ့ဆၧလၧယုဒၫအၥုၪ့က့ၭၥၭ ၡါၥံၪတၭ, စံၭ,နၥံၪမွဲၦလၧခဲၫ့ထုၬ လၧအမိဂဲၫထဲၩ့ၥိၫ့ စဎွၩလၧအဂံၪ့နီၪ,မွဲဘၪလဲၪ. တၭအံၫစရ့လၭအဆၧ ချဲၩ့ထီးအလူၬဂဲၫနုၬ လၧစဎွၩအအီၪ လၧအဂံၪ့ဖၧၩ့",
			"12": "<sup>12</sup> လီၫ.- နၥံၪမွဲယထၧၫ့ဖုဝဲ,နၥံၪမွဲယဎွံၪ, ဒဲယယၪလီၫ. တၭနၥံၪမွဲၦလၧခဲၫ့ထုၬ လၧအမိဂဲၫထဲၩ့ၥိၫ့စဎွၩနီၪ,",
			"13": "<sup>13</sup> မွဲဘၪလဲၪ.- တၭစံၭနၥံၪဝ့ၫလၧစအၫမစၫ, နမွဲယဎွံၪဒဲ ယယၪမွဲအ့ၬဧၪ. နအ့ၪလကဲၪထၪ့ဘၪၦၥုၭမုအခိၪလ ထံၪဎးလဘီၩ့ဎး လၧစယိအၭအလးတၭ, မွဲယွၩမၩ",
			"14": "<sup>14</sup> ယၧၩဘဲၫနီၪဒဲအၪနဲၪ့အနီၪဒံၭဆံၭ.- တၭအဝ့ၫဒၪဒုၭ ကူၭလၩ့ယုဒၫအၡၩအၥၭ ထီးအလူၬ ဘဲၫၦၡၩလဂၩ ဎးအၥိၭနီၪလီၫ. အခိးမွဲအဝ့ၫၥံၪအၪ့မၧၫ့လၩ့ဆၧလၧ စဎွၩတၭ,စံၭဝ့ၫဒၪ, ဂဲၫထဲၩ့ထဲၩ့နဝ့ၫ, ဒဲနခ့ၫနၡၩၥံၪ",
			"15": "<sup>15</sup> ထီးအလူၬဆံၭ.- အခိးမွဲစဎွၩဂဲၫထဲၩ့ထဲၩ့တၭ, ဂဲၫ ထီၩ့လၧယီၫဒၫ့အနဲၩ့လီၫ. တၭယုဒၫဂဲၫထီၩ့လၧဂံလ ဂၫလၭဘဲၫၥိၭအမိလ့ၩအၪ့ဂၬစဎွၩ, ဘဲၫၥိၭအမိၥိၫ့စ ဎွၩခၫ့ဂၬယီၫဒၫ့နီၪလီၫ.",
			"16": "<sup>16</sup> တၭၦဘံၪ့ယမံၫ့ဖိၪစဂံရၫအဖိၪခွၫ စၡံမအဲၫလၧအ ဘၪဆဲၫ့လၧဘဟုရံၫ့လဂၩ မၩဝ့ၫချဲၫ့ချဲၫ့တၭ, ဂဲၫလၩ့ လၧယုဒၫအၡၩၥံၪအၥိၭဘဲၫၥိၭအမိအၪ့ဂၬ စဎွၩဒၫဝံၭ",
			"17": "<sup>17</sup> လီၫ.- တၭစဘံၪ့ယမံၫ့အၡၩလထီၫ့, ဒဲစစီလူၫအၡၩ ဂံၪ့ဖိၪအခ့ၫအၡၩစဇဲဘၫ, ဒဲအဖိၪခွၫလဆံၫယဲဂၩ, ဒဲ အဎီးအၡၩနံၫဆံၫအီၪလၧအၥိၭတၭ, အဝ့ၫၥံၪနီၪခၫ့",
			"18": "<sup>18</sup> ဂၬယီၫဒၫ့လၧစဎွၩအမ့ၬယၫလီၫ.- ချံၫခၫ့ဆၧနီၪခၫ့ဝ့ၫ ဘဲၫၥိၭအမိဒုၭခၫ့ဂၬစဎွၩအၡၩဂံၪ့ဖိၪ, ဒဲဘဲၫၥိၭအမိ မၩထီးဒၪဆၧဂ့ၩ လၧစဎွၩအမ့ၬယၫလီၫ. လၧအခၫ့ ယီၫဒၫ့နီၪစဂံရၫအဖိၪခွၫ စၡံမအဲၫထိၪလၩ့ထံၩဖါအ ၥၭလၧစဎွၩအမ့ၬယၫတၭး",
			"19": "<sup>19</sup> စံၭစဎွၩ, မွဲယကဆါထီး အီၪက့ၪဆၧဒဲၩဘၭ လၧယလီၩ့လဂ့ၩ. တၭမွဲနထီးနၪ့ ထၪ့ထဲၩ့ဆၧလၧ နခ့ၫနၡၩ မၩဆၧအၧၩ့လၧမုလနံၩလၧ ယကဆါ စဎွၩစဲၪ့ထၪ့ခွံၬ လၧယရုစလံၫ့လဂ့ၩ, မွဲစဎွၩ",
			"20": "<sup>20</sup> ထီးအီၪက့ၪဆၧနီၪ လၧအၥၭလဂ့ၩ.- အဂဲးဘဲၫယီၩ နဎီးနၡၩၥ့ၪယၫဝ့ၫ လၧယမၩမၪဘၪယူၭ ဆၧယူၭ, တၭယိခွါ, လၧမုဆၫလနံၩယီၩ ယဂဲၫလၩ့ဝံလၧကယဲ စယိၥၭအၡၩဂံၪ့ဖိၪအကျၩ, ဘဲၫၥိၭယမိအၪ့ဂၬ ယက ဆါစဎွၩလီၫ.",
			"21": "<sup>21</sup> နးဇ့ၫရုၫအဲအၫအဖိၪခွၫ စအၭဘၡဲၫစံၭဆၧၫ့ဆၧ တၭ,စံၭဝ့ၫဒၪ, စၡံမအဲၫမိဘၪၥံၫဝ့ၫ လၧဆၧလမံၩ့ ယီၩအကၠီၩ့, မွဲအ့ၬဧၪ. အဂဲးဘဲၫယီၩ မွဲအဆိၪအၧၩ့",
			"22": "<sup>22</sup> ယွၩအၡၩဒိၭဂုၪအၥၭလီၫ.- တၭစဒၫဝံၭစံၭဝ့ၫဒၪ,ဘဲၫ ၥိၭနၥံၪမိကဲၪယဒုၪယဒၩ လၧမုဆၫလနံၩယီၩ, နးဇ့ၫ ရုၫအဲအၫအဖိၪခွၫၥံၪဧ့, ယၧၩဒဲနၥံၪမွဲဘဲၫၥ့ၪလဲၪ.ၦ လၧအမိဘၪဆၧမၩၥံၫဝ့ၫလဂၩဂၩ လၧမုဆၫလနံၩယီၩ အီၪလၧအံၫစရ့လၭအကျၩနီၪဆ့ဧၪ. ယမွဲစဎွၩလၧ အံၫစရ့လၭအဖၫ့ခိၪလၧမုဆၫလနံၩယီၩ, မွဲယၥ့ၪယၫ",
			"23": "<sup>23</sup> အ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, စဎွၩစံၭစၡံမအဲၫ, နၥံၫ ဘၪအ့ၬ. တၭစဎွၩဆိၪလၩ့အၥၭလၧအဝ့ၫလီၫ.",
			"24": "<sup>24</sup> စစီလူၫအဖိၪခွၫစမံၫဖံၭဘၡ့ၭ, ဂဲၫလၩ့အၪ့ဂၬစဎွၩ တၭ, လတဲၩ့ဝဲၩဘၪအခၪ့, လတဲၩ့ဝဲၩဘၪအခၪလၬ ဆီၪ့,ဒဲလအၪ့ဆူၫဝၭဘၪအကီၩ့အၥိၭ လၧမုလနံၩလၧ စဎွၩစဲၪ့ထၪ့ခွံၬ ထီၩ့လၩ့မုလနံၩ လၧအဂဲၫထဲၩ့ထဲၩ့",
			"25": "<sup>25</sup> မုၬမုၬနီၪလီၫ.- ထီးအထီၩ့လၧယရုစလံၫ့ ဘဲၫၥိၭအမိ အၪ့ဂၬစဎွၩတၭ, ဆၧမၩအၥၭလၧစဎွၩစံၭအဝ့ၫ, နလ",
			"26": "<sup>26</sup> လ့ၩဖိၬဘၪယခဲၫ့နီၪ, မွဲဘၪလဲၪ,စမံၫဖံၭဘၡ့ၭဧ့,- တၭ အဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ယကဆါ,စဎွၩဧ့, ယခ့ၫယၡၩ အၪ့လီၫန့ယၧၩလီၫ. အဂဲးဘဲၫယီၩနခ့ၫနၡၩစံၭ, ယမိ အီၪက့ၪထၪ့ပီၩ့လၧကၥ့ၪယီၩ့အလီၩ့နီၪ, ဘဲၫၥိၭယမိ ထူၬဝ့ၫတၭ, လ့ၩလၧစဎွၩအအီၪနီၪ, အဂဲးဘဲၫယီၩ,",
			"27": "<sup>27</sup> နခ့ၫနၡၩအခၪ့ဂၭဂီၩ့လီၫ.- တၭအဝ့ၫနီၪ ချဲၩ့ခဲၪနခ့ၫ နၡၩလၧယကဆါစဎွၩအမ့ၬယၫလီၫ. မွဲလါနၫ့ဘိၩ ယကဆါစဎွၩ မွဲယွၩအၥီၫ့လဂၩလီၫ. မၩအၥၭဘဲၫ",
			"28": "<sup>28</sup> နီၪတၭမၩဆၧလၧအဂ့ၩ လၧနမ့ၬယၫဆံၭ.- အဂဲးဘဲၫ ယီၩယဖါအၡၩဂံၪ့ဖိၪကိၭဂၩဒ့ၭ မွဲၦအၥံၫလၧယက ဆါစဎွၩအမ့ၬယၫလီၫ. မွဲလါနၫ့ဘိၩ နအီၪက့ၪနခ့ၫ နၡၩလၧၦလၧအအၪ့ဆၧလၧနစပွဲ ဒၪနဝ့ၫလဖၪအကျၩ လီၫ. တၭယမိကိၭထၪ့ဒံၭလၧစဎွၩနီၪ, မွဲအလးအီၪ",
			"29": "<sup>29</sup> ဒံၭဘဲၫၥ့ၪလဲၪ.- တၭစဎွၩစံၭအဝ့ၫ, နချဲၩ့ဒံၭလၧဆၧနီၪ အဂဲးအကၠီၪ့ဒံၭ,မွဲဘၪလဲၪ. ယစံၭယူၭ, နဝ့ၫဒၪဒဲစဇဲ ဘၫနီၪဘၪအၪ့နၩ့ဖၭဂၪ့ခိၪအဆၧၫ့လီၫ.",
			"30": "<sup>30</sup> တၭစမံၫဖံၭဘၡ့ၭစံၭစဎွၩ, မွဲလၧယကဆါစဎွၩဂဲၫ ထဲၩ့ထဲၩ့ယူၭ လၧအဂံၪ့ဒၪဝ့ၫမုၬမုၬယူၭအဂဲးနီၪမွဲအ ဝ့ၫဒၪမၩန့ဒၪဝ့ၫထီးအလူၬဆံၭ.",
			"31": "<sup>31</sup> တၭၦဂံလအၭဖိၪ စဘၫဇံလ့ၫဂဲၫလၩ့လၧရိၫဇံလံၫ့ လ့ၩခၫ့ဂၬယီၫဒၫ့ လၧစဎွၩအၥိၭဘဲၫၥိၭအမိၥိၫ့အဝ့ၫ",
			"32": "<sup>32</sup> ခၫ့ဂၬယီၫဒၫ့လီၫ.- စဘၫဇံလ့ၫ အၥၭၡါယူၭအနံၪ့ ဎိၭဆံၫတၭ, အဝ့ၫဒၪ တဲၩ့ဝဲၩ ဘၪယူၭ စဎွၩ အဆၧ အၪ့ဆၧအီၩ လၧအအီၪလၧမၫဟနၫအံၫ့ အဘိၩ့ဘၭ",
			"33": "<sup>33</sup> နီၪလီၫ. အဂဲးဘဲၫယီၩမွဲၦအကဲၪဒိၪဖၭဒိၪလီၫ.- တၭ စဎွၩစံၭစဘၫဇံလ့ၫလ့ၩခၫ့ဂၬ ဆၧလၧယၥိၭဆံၭ. တၭ ယမိဒုၭအၪ့ဒုၭအီၩနၧၩ လၧယၥိၭ လၧယရုစလံၫ့အ",
			"34": "<sup>34</sup> ဖၧၩ့နီၪလီၫ.- စဘၫဇံလ့ၫစံၭစဎွၩ, ဘဲၫၥိၭယမိလ့ၩထၪ့ လၧစဎွၩအၥိၭ လၧယရုစလံၫ့တၭ, ယမၧၫ့ဒံၭအနံၪ့ အလၩအမုနံၩလဖၪနီၪ, မွဲအအီၪဒံၭဆံၭအၪလဲၪ.",
			"35": "<sup>35</sup> ဆၧလၧမုဆၫလနံၩယီၩ ယၥၭၡါယူၭ အနံၪ့ဎိၭဆံၫ လီၫ. ယအၪ့နၩ့ဖၭဆၧဂ့ၩ ဒဲဆၧအၧၩ့ အဆၧၫ့နီၪဘၪ မိၥ့ၪဧၪ, ဆၧလၧယအၪ့ယအီၩနီၪ နခ့ၫနၡၩၥ့ၪယၫအ အွံၪဘၪမိၥ့ၪဧၪ. ၦမုၪၥံၪမၩထၭခိၪမွဲဂ့ၩ, ၦခွၫၥံၪမၩ ထၭခိၪမွဲဂ့ၩ,အလူနီၪယနါဂၧၫ့မိၥ့ၪဒံၭဧၪ, အခိးမွဲဘဲၫ နီၪတၭနခ့ၫနၡၩ မိကဲၪဒံၭလၧဆၧအွံၪဆၧယိၭအဎၧၫ့",
			"36": "<sup>36</sup> လၧယကဆါစဎွၩအဂးနီၪ, မွဲဘၪလဲၪ.- နခ့ၫနၡၩမိခၫ့ ဂၬယီၫဒၫ့လဆံၭဖိၪ လၧစဎွၩအၥိၭတၭ, စဎွၩမိဖ့ၪ လၫ့ကၪယၧၩလၧဆၧအလံၩ့အလဲၫယီၩ, မွဲဘၪလဲၪ.",
			"37": "<sup>37</sup> ဘဲၫၥိၭယမိၥံၫလၧယဒိၩ့ဒၪယဝ့ၫအဖၧၩ့ အီၪလၧယ မိယဖါအၥွၪခိၪနဲၩ့, ဒုၭထဲၩ့ထဲၩ့လါ နခ့ၫနၡၩဘီၪ. အ့ၪမွဲယိခွါ, နခ့ၫနၡၩစခံၫမဟၫ့လီၫ. အဝ့ၫဒၪအ့ၪခၫ့ ဂၬဒၪဝ့ၫလၧယကဆါစဎွၩအၥိၭတၭ, မၩအဝ့ၫလၧ",
			"38": "<sup>38</sup> ဆၧဂ့ၩလၧနမ့ၬယၫဆံၭ.- တၭစဎွၩစံၭဝ့ၫဒၪ, စခံၫမ ဟၫ့မိလ့ၩခၫ့ဂၬဘၪဆၧလၧယၥိၭတၭ, ယမိမၩအဝ့ၫ လၧဆၧလၧအဂ့ၩလၧနမ့ၬယၫတၭ, ထီးဒၪဆၧလၧနမိ န့ဘၪလၧယၧၩအလးအီၪလမံၩ့လါလါနီၪ, ယမိမၩ",
			"39": "<sup>39</sup> လၧနဂးလီၫ.- တၭၦခမျၧးထီးအလူၬလ့ၩခၫ့ဂၬယီၫဒၫ့ လီၫ. ထီးစဎွၩခၫ့ဂၬဂီၩ့တၭ, စဎွၩအဲၪဂါစဘၫဇံလ့ၫ တၭ,ဆိၪဂ့ၩဝ့ၫတၭ, အဝ့ၫဒၪထဲၩ့ထဲၩ့ဝ့ၫလၧအလးဒၪ ဝ့ၫနီၪလီၫ.",
			"40": "<sup>40</sup> ထီးနီၪလဖၧၫ့ စဎွၩလ့ၩဆၧလၧဂံလဂၫလၭတၭ, စခံၫမဟၫ့လ့ၩလၧအၥိၭတၭ, ယုဒၫအၡၩခမျၧးထီး အလူၬၥိၫ့စဎွၩနီၪ, ဒဲအံၫစရ့လၭအၡၩခမျၧး ဖိၭဖၫ့ ဆ့လီၫ.",
			"41": "<sup>41</sup> ယိခွါ,အံၫစရ့လၭအၡၩထီးအလူၬ ဂဲၫဝ့ၫလၧစဎွၩ အအီၪတၭ, စံၭစဎွၩ,ပထၧၫ့ဖုဝဲ, ယုဒၫအၡၩအၪ့ဂူၪန့ ခွံၬနၧၩတၭ,စဎွၩ, ဒဲအၡၩဂံၪ့ဖိၪ, ဒဲစဒၫဝံၭအၡၩအီၪ လၧအၥိၭထီးအလူၬနီၪ, ဂဲၫၥိၫ့ဝ့ၫခၫ့ဂၬယီၫဒၫ့မွဲဘၪ",
			"42": "<sup>42</sup> လဲၪး- တၭယုဒၫအၡၩထီးအလူၬ စံၭဆၧၫ့အံၫစရ့လၭ အၡၩ, အဂဲးဘဲၫယီၩစဎွၩမွဲပဘူၭပထံးလီၫ. နၥံၪၥၭ ထၪ့ပၧၩလၧဆၧယီၩအကၠီၩ့မွဲဘၪလဲၪ. မွဲပအၪ့စဎွၩ အဆၧဧၪ. တၭမွဲအဖ့ၪလၫ့ပၧၩ လၧဆၧလမံၩ့မံၩ့ဆ့",
			"43": "<sup>43</sup> ဧၪ.- တၭအံၫစရ့လၭအၡၩ စံၭဆၧၫ့ယုဒၫအၡၩတၭ, စံၭဝ့ၫဒၪ,လၧစဎွၩအဖၧၩ့နီၪ ပအီၪလၧပဂးဆံၫပိၩ့ တၭ,ပအီၪလၧဆၧဘၪဆဲၫ့လၧစဒၫဝံၭအၪနဲၪ့နၥံၪဒံၭ လီၫ. တၭနၥံၪအီၪက့ၪကြၩ့ထမးပၧၩ လၧနၥံၪလဒုၭ ချဲၩ့ဆိၫဘၪပၧၩလၧဆၧဒုၭဂဲၫထဲၩ့ပစဎွၩ အဂဲးအကၠီၪ့ နီၪမွဲဘၪလဲၪ. တၭယုဒၫအၡၩအဆၧချဲၩ့ၥံၪနီၪ, ဆီၪ့ နဲၪ့အံၫစရ့လၭအၡၩ အဆၧချဲၩ့လဖၪနီၪဒံၭလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> ဆၧမၩအၥၭလၧၦဘၫအလၭဖိၪ အီၪထီးနီၪလဂၩ တၭ,အမံၩ့မွဲစၡံဘၫၦဘံၪ့ယမံၫ့ဖိၪစဘံၭကြဲၫအဖိၪ ခွၫလီၫ. တၭအဝ့ၫနီၪအူၪထၪ့ခွ့ၩတၭ, စံၭဝ့ၫဒၪ,ပဂး လအီၪဘၪလၧစဒၫဝံၭအဖၧၩ့တၭ, ပန့ၥၫဆၧလအီၪ ဘၪလၧစယ့ၭစံၫအဖိၪခွၫအဖၧၩ့လီၫ. အံၫစရ့လၭဧ့, လဂၩလၧအတဲၩဒၪဝ့ၫ, လဂၩလၧအတဲၩဒၪဝ့ၫဆံၭ.",
			"2": "<sup>2</sup> အခိးမွဲဘဲၫနီၪအံၫစရ့လၭအၡၩထီးအလူၬ စဲၪ့ထၪ့ခွံၬ လၧအဖိၬစဒၫဝံၭအခဲၫ့တၭ, လ့ၩဖိၬစဘံၭကြဲၫအဖိၪခွၫ စၡံဘၫအခဲၫ့နီၪလီၫ. အ့ၪမွဲယုဒၫအၡၩ ဘုၭထၬလၧ အစဎွၩလၧယီၫဒၫ့ထီၩ့လၧယရုစလံၫ့လီၫ.",
			"3": "<sup>3</sup> စဒၫဝံၭဂဲၫထီၩ့လၧအဂံၪ့ လၧယရုစလံၫ့အဖၧၩ့ တၭ,စဎွၩမၩန့ အၥံၪမၫဆံၫဂၩ လၧအအီၪက့ၪလၩ့ ထးဝ့ၫဘဲၫၥိၭအမိခိၭဂံၪ့နီၪတၭ, အီၪက့ၪအဝ့ၫၥံၪလၧ ၦခိၭဆၧအလးတၭ, လုအၪ့အဝ့ၫၥံၪ, မွဲလါနၫ့လ့ၩနုၬ လၧအအီၪအ့ၬ. အဝ့ၫၥံၪဘၪဆၧကၭထံၭထၬဝ့ၫဘဲၫ နီၪအီၪမဲၫဝ့ၫထီးမုလနံၩလၧအၥံၫလီၫ.",
			"4": "<sup>4</sup> ထီးနီၪလဖၧၫ့စဎွၩစံၭစအၫမစၫ, ဒုၭအီၪကီၪ့န့ ယၧၩလၧယုဒၫအၡၩ လၧၥၧၫ့နံၩအထးဖၧၩ့တၭ, အီၪနဝ့ၫ",
			"5": "<sup>5</sup> ထီးယီၩဆ့ဆံၭ.- မၩအၥၭဘဲၫနီၪတၭစအၫမစၫလ့ၩ ဒုၭအီၪကီၪ့ယုဒၫအၡၩလါနၫ့တၭ, မွဲအအီၪဒံၭယံၬ",
			"6": "<sup>6</sup> နဲၪ့အဖၭနံၩဖၭၥၫ့ လၧအဂးဒံၭလီၫ.- တၭစဒၫဝံၭစံၭ စအၭဘၡဲၫ, ဘိၩ့နဲၪ့ယီၩ စဘံၭကြဲၫအဖိၪခွၫစၡံဘၫ နီၪမိမၩအၧၩ့ပၧၩနၭနဲၪ့စအၭဘစလၧၫ့ဒံၭလီၫ. မၩန့ နကဆါအခ့ၫအၡၩတၭ, လီၩ့ဆီးဆံၭ. မိလ့ၩနုၬဘၪ ခိၬလၧဒိၩ့အီၪလၧအခိၪဒၧၩ့တၭ, မိဖီၩ့ဖျ့ၭခွံၬဝ့ၫလၧ",
			"7": "<sup>7</sup> ပၧၩလီၫ.- စယိအၭအၡၩလဖၪ, ဒဲၦခ့ရ့ၭဖိၪ, ဒဲၦပံလ့ၭ ဖိၪ,ဒဲၦအဆီၪ့ထီးအလူၬလီၩ့ဆီးအဝ့ၫး အဝ့ၫၥံၪစဲၪ့ ထၪ့ခွံၬလၧယရုစလံၫ့ဘဲၫၥိၭအမိလီၩ့ဆီး စဘံၭကြဲၫ အဖိၪခွၫစၡံဘၫနီၪလီၫ.",
			"8": "<sup>8</sup> ထီးအဝ့ၫၥံၪအီၪလၧလိးဖၭဒိၪ လၧအအီၪဝ့ၫလၧ ဂံဘအၧၫ့နီၪ, စအၫမစၫဂဲၫအၪ့ဂၬအဝ့ၫၥံၪလီၫ. တၭ စယိအၭအဆဲၫ့လၧအၥိၭဝ့ၫခဲးထူၬအၥၭ ဒဲနၭလဘံၪ့ ခဲးထၬအၥၭလၧအခၧၩ့ယး လၧအကၠိၭဖၧၩ့နီၪလ့ၩဝ့ၫ",
			"9": "<sup>9</sup> အဘိၩ့ဘၭတၭလၩ့ထ့ၬခွံၬဝ့ၫလီၫ.- တၭစယိအၭစံၭ စအၫမစၫ, နအီၪမုၬဆ့ဧၪ, ယထၧၫ့ဖုဝဲဧ့,တၭစယိအၭ ဖီၪ့စအၫမစၫအခၪလၬဆီၪ့လၧအစူၪထွ့ၪ ဘဲၫၥိၭအမိ",
			"10": "<sup>10</sup> အဲၪဂါဝ့ၫလီၫ.- တၭစအၫမစၫချႃၭယိနၭလဘံၪ့လၧ အအီၪလၧစယိအၭအစူၪဖၧၩ့နီၪအ့ၬ. အခိးမွဲအဝ့ၫဒၪ ဆ့ၭအဝ့ၫနီၪအဂူၭဖိၫ့ဖၧၩ့တၭ, အဎွံၬဂဲၫလၩ့လၬလၧ ဂၪ့ခိၪတၭ, လဆ့ၭလၧၩ့ဘၪဒီၭတၭ, မွဲအၥံၫဝ့ၫလီၫ. တၭစယိအၭ ဒဲအထၧၫ့ဖုဝဲစအၭဘၡဲၫလီၩ့ဆီးစဘံၭ",
			"11": "<sup>11</sup> ကြဲၫအဖိၪခွၫစၡံဘၫနီၪလီၫ.- စယိအၭအၡၩလဂၩ ဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭတၭ, စံၭဝ့ၫဒၪ,ၦလၧအဘၪအ ၥၭလၧစယိအၭ ဒဲၦလၧအအီၪဝ့ၫလၧစဒၫဝံၭအဂးနီၪ,",
			"12": "<sup>12</sup> မွဲအဖိၬစယိအၭအခဲၫ့ဆံၭ.- တၭစအၫမစၫလွၫအၥၭ လၧဆၧၥွံၪဖၧၩ့လၧဖၧၩ့ၥၭမုနီၪလီၫ. ထီးၦလဂၩနီၪ ဒၪဘၪဝ့ၫလၧၦခမျၧးထီးအလူၬ အီၪပထုၬဝ့ၫတၭ,အ ဝ့ၫဒၪၥုၭခွံၬစအၫမစၫ လၧဖၧၩ့ၥၭမုဖၧၩ့ လၧမံၩ့လၬ ကျၩတၭ, ချႃၬဘံၭဝ့ၫလၧဖၬဘဲၩ့လဘံၪ့တၭ, မွဲလၧ အဒၪဘၪဝ့ၫလၧကယဲၦလၧအဂဲၫ လၧအအီၪလဂၩ",
			"13": "<sup>13</sup> လါလါအီၪထီဝ့ၫအကၠီၩ့နီၪလီၫ.- ထီးအဘၪဆၧၥုၭ ခွံၬဝ့ၫလၧဖၧၩ့ၥၭမုအဖၧၩ့တၭ, ၦခမျၧးဖိၬစယိအၭ အခဲၫ့ဘဲၫၥိၭ အမိလီၩ့ဆီးစဘံၭကြဲၫအဖိၪခွၫစၡံဘၫ နီၪလီၫ.",
			"14": "<sup>14</sup> ထီးအလ့ၩခၫ့ဂၬအံၫစရ့လၭ အဒီၪ့ၥံၪထီးအလူၬဖိး လၧအၫဘလၭဒဲဘ့ၭၥမၫအခၫ ဒဲကယဲၦဘံရဲဖိၪတၭ,",
			"15": "<sup>15</sup> အဝ့ၫၥံၪအီၪကိၩ့အီၪကီၪ့, လ့ၩဖိၬအခဲၫ့ဆ့လီၫ.- တၭ အဝ့ၫၥံၪဂဲၫဝၩ့ထၬ အဝ့ၫဒၪလၧအၫဘလၭ ဘၪဆဲၫ့ လၧဘ့ၭၥမၫအခၫအဖၧၩ့တၭ, မၩပိၩ့ထၪ့ဂၪ့ခိၪထၫ့ဒုၪ ဒၩဒိၩ့တၭ, ဆၧနီၪအီၪဝ့ၫလၧအကၠီၪ့ဖၧၩ့တၭ, ၦခမျၧး ထီးအလူၬလၧအအီၪ လၧစယိအၭအၥိၭနီၪခွံၬဆၧ",
			"16": "<sup>16</sup> လၧဒိၩ့ခိၪဒၧၩ့ဘဲၫၥိၭအမိမၩလၩ့ဎီးဝ့ၫဒၪလီၫ.- ထီး နီၪလဖၧၫ့ၦမုၪ လၧအကိၪ့ဆၧၥ့ၪ လၧဒိၩ့ဖၧၩ့လဂၩ ကိၭထၪ့, ခိၭနၪၬ ခိၭနၪဘီၪၬ စံၭလါစယိအၭ, ဂဲၫၥုၭ ဘူၭနၥၭလၧယီၩဘဲၫၥိၭ ယမိချဲၩ့ဆၧလၧနၧၩဘီၪ.",
			"17": "<sup>17</sup> ထီးအဝ့ၫဒၪဂဲၫဘူၭလၧအဝ့ၫတၭ, ၦမုၪနီၪစံၭဝ့ၫဒၪ, နမွဲစယိအၭနီၪဧၪ. တၭအဆၧစံၭဝ့ၫဒၪ, ယၧၩလီၫ. တၭၦမုၪစံၭအဝ့ၫ, ခိၭနၪနဎီးမုၪအဆၧချဲၩ့ဘီၪ. တၭ",
			"18": "<sup>18</sup> အဝ့ၫဒၪစံၭဝ့ၫ, ယနါဂၧၫ့ယူၭ.- ထီးနီၪလဖၧၫ့မွဲအချဲၩ့ ဝ့ၫတၭ,စံၭဝ့ၫဒၪ, လၧဖျိၩ့ၦချဲၩ့ဆၧချဲၩ့လထံၪ, စံၭဝ့ၫ ဒၪ,အဝ့ၫၥံၪမိအၪ့စၪ့ဆၧလၧအၫဘလၭ တၡါတၭး",
			"19": "<sup>19</sup> အဝ့ၫၥံၪမၩဂီၩ့ဝ့ၫဘဲၫနီၪလီၫ.- ယဝ့ၫဒၪယီၩ ယမွဲၦ အီၪဘၪလိၬအိၭလိၬ, ဒဲၦအမွဲအတီၩ လၧအံၫစရ့လၭ အကျၩလီၫ. နအၪ့ဎၬ မၩဂၭဂီၩ့ဒိၩ့လဖျိၪ့ ဒဲမိလဂၩ လၧအံၫစရ့လၭအကျၩလီၫ. နမိအၪ့ယုလၩ့ခွံၬယဟိ",
			"20": "<sup>20</sup> ဝၩအဆၧန့ၥၫနီၪ, မွဲဘၪလဲၪ.- စယိအၭချဲၩ့ဆၧၫ့ဆၧ တၭစံၭဝ့ၫဒၪ, ယအၪ့ယုလၩ့ခွံၬဆၧမွဲဂ့ၩ, ယမၩဂၭ",
			"21": "<sup>21</sup> ဂီၩ့ခွံၬဆၧမွဲဂ့ၩမွဲယထီးမၩလဂ့ၩ,- ဆၧလမံၩ့နီၪမွဲဘဲၫ နီၪအ့ၬ. မွဲၦဘၪဆဲၫ့လၧခိၪလီၩ့အံဖြံၫ့, စဘံၭကြဲၫအ ဖိၪခွၫအမံၩ့စၡံဘၫယၩ့ထၪ့အစူၪ ထၫ့ဒုၪဒၩစဎွၩဒၫဝံၭ လီၫ.ဖ့ၪလၫ့ခွံၬန့အဝ့ၫဒၪတၭး ယမိစဲၪ့ထၪ့ခွံၬ လၧ ဒိၩ့လီၫ.တၭၦမုၪနီၪ စံၭစယိအၭ,ယိခွါ, ဆၧမိခွံၬစိၩ",
			"22": "<sup>22</sup> အခိၪဎွံၪလၧနအီၪလၧဒိၩ့ခိၪဒၧၩ့ဝါလခီၫလီၫ.- ထီးနီၪ လဖၧၫ့ၦမုၪနီၪလ့ၩဝ့ၫလၧ အဆၧကိၪ့ၥ့ၪလၧၦခမျၧးထီး အလူၬအအီၪတၭး အဝ့ၫၥံၪဖ့ၬထ့ၬခွံၬ စဘံၭကြဲၫအဖိၪ ခွၫစၡံဘၫအခိၪဎွံၪတၭ, ခွံၬထၪ့ခွံၬဝ့ၫလၧစယိအၭအ အီၪလီၫ. အဝ့ၫဒၪအူၪထၪ့ခွ့ၩတၭ, ၦစဲၪ့ထၪ့ခွံၬဝ့ၫလၧ ဒိၩ့နီၪ,လဂၩလၧအတဲၩဒၪဝ့ၫ, လဂၩလၧအတဲၩဒၪဝ့ၫ နီၪလီၫ. တၭစယိအၭထဲၩ့ထဲၩ့ဝ့ၫ လၧယရုစလံၫ့လၧ စဎွၩအအီၪလီၫ.",
			"23": "<sup>23</sup> တၭစယိအၭအီၪဝ့ၫ လၧအံၫစရ့လၭအၡၩၥုၭမုထီး အလူၬအဖၫ့ခိၪ စယဟီအဒၫအဖိၪခွၫ စဘံၫ့နအဲအၫ အီၪဝ့ၫလၧၦခ့ၫရ့ၭဖိၪအဖၫ့ခိၪ, ဒဲလၧၦပံလ့ၭဖိၪအဖၫ့",
			"24": "<sup>24</sup> ခိၪလီၫ.- တၭစအဒိရၫ့အီၪဝ့ၫလၧဆၧဖ့ၪလၫ့အခီၫ့အ ဖၫ့ခိၪ, ဒဲစအဟဲလၧၭအဖိၪခွၫစယဟီၡဖၭမွဲၦကွ့ၭနဲၪ့",
			"25": "<sup>25</sup> ဆၧလီၫ.- တၭစၡံဝၫမွဲၦကွ့ၭလံၬ, ဒဲစဇၫဒီၭ, ဒဲစအဘဲ",
			"26": "<sup>26</sup> အၥၫမွဲၦလုဆၧလဖၪလီၫ. တၭၦယၫအၧၫဖိၪစအဲရၫ မွဲၦပၧၩ့ဆၧအခိၪလၧ စဒၫဝံၭအဂးလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> တၭလၧစဒၫဝံၭအမုနံၩလဖၪအကျၩနီၪ ဆၧၥၭဝံ လၩ့ဒိၩအီၪ, လနံၪ့ဘၪလနံၪ့ၥၧၫ့နံၪ့လီၫ. တၭစဒၫဝံၭ အၪ့စၪ့ဆၧလၧယဟိဝၩတၭ, ယဟိဝၩလီၩဆၧၫ့ဝ့ၫဒၪ, မွဲလၧစစီလူၫအကၠီၩ့, ဒဲလၧအၡၩဂံၪ့ဖိၪဘၪဆဲၫ့လၧ ဆၧၥွံၪအကၠီၩ့လၧအမၩၥံၫ ၦဂံဘအၧၫ့ဖိၪအကၠီၩ့လီၫ.",
			"2": "<sup>2</sup> တၭစဎွၩကိၭန့ၦဂံဘအၧၫ့ဖိၪတၭ, စံၭအဝ့ၫၥံၪ (တၭ ၦဂံဘအၧၫ့ဖိၪနီၪ ဘၪဆဲၫ့လၧၦအံၫစရ့လၭဖိၪမွဲအ့ၬ. မွဲအဘၪဆဲၫ့လၧဆၧအီၪလၩ့ထး လၧၦအၫမိၫဖိၪ,လၧ ၦအံၫစရ့လၭဖိၪဆိၪလၩ့အၥၭလၧအဝ့ၫၥံၪလီၫ. တၭ စစီလူၫအၪ့ဎၬမၩၥံၫအဝ့ၫၥံၪ လၧအၥၭဆီၪ့ လၧၦအံၫ",
			"3": "<sup>3</sup> စရ့လၭဖိၪဒဲလၧၦယုဒၫဖိၪအဂးလီၫ.)- အခိးမွဲစဒၫ ဝံၭစံၭၦဂံဘအၧၫ့ဖိၪၥံၪ, ယမိဘၪမၩလၧနၥံၪအဂးနီၪ မွဲဆၧနီၪလမံၩ့လဲၪ. တၭယမိမၩဆၧဖီၩ့ဖျ့ၭ ဘဲၫၥိၭန ၥံၪမိဆိၪဂ့ၩယဟိဝၩအဆၧန့ၥၫနီၪ လၧဆၧနီၪလမံၩ့",
			"4": "<sup>4</sup> လဲၪ.- တၭၦဂံဘအၧၫ့ဖိၪစံၭအဝ့ၫ, လၧစစီလူၫမွဲဂ့ၩ, အၡၩဂံၪ့ဖိၪမွဲဂ့ၩ, အကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫၥံၪပမိ မၩအ့ၬ. တၭနမၩၥံၫဘၪၦၡၩလၧအံၫစရ့လၭအကျၩ လၧပဂးနးဂၩအ့ၬ. တၭအဝ့ၫဒၪစံၭဝ့ၫ, ဆၧလၧနၥံၪမိ",
			"5": "<sup>5</sup> စံၭနီၪ, ယမိမၩလၧနၥံၪအဂးလီၫ.- တၭအဝ့ၫၥံၪစံၭ စဎွၩ, ၦလၧအမၩလူၬခွံၬပၧၩ, ဒဲကိၪ့မၩဂၭဂီၩ့ပၧၩ, ဘဲၫၥိၭပထီးအီၪထးဘၪလၧ အံၫစရ့လၭအခးနဲၩ့ထံၭ",
			"6": "<sup>6</sup> လစီၪ့လါလါနီၪ,- မွဲဆၧဖ့ၪလၫ့ခွံၬ အဝ့ၫဒၪအဖိၪခွၫ နွ့ၫဂၩလၧပစူၪဖၧၩ့ဆံၭ. တၭပမိစၧၩ့လၩ့ၥံၫအဝ့ၫၥံၪ လၧယဟိဝၩအဂး လၧဂံဘအၫ ဘၪဆဲၫ့လၧစစီလူၫ လၧယဟိဝၩရွံန့ဝ့ၫလီၫ. တၭစဎွၩစံၭဝ့ၫဒၪ, ယမိဖ့ၪ လၫ့အဝ့ၫၥံၪလီၫ.",
			"7": "<sup>7</sup> မွဲလါနၫ့ဘိၩ, စဎွၩလီၫ့ကီၩ့ စစီလူၫအဖိၪခွၫစစၪ့ နၥၧၫ့အဖိၪခွၫစမံၫဖံၭဘၡ့ၭ လၧယဟိဝၩ အဆၧဆိၪ လၩ့အၥၭလၧအအီၪဝ့ၫလၧ အဝ့ၫၥံၪအကၠီၩ့, လၧစဒၫ",
			"8": "<sup>8</sup> ဝံၭ,ဒဲစစီလူၫအဖိၪခွၫစစၪ့နၥၧၫ့နီၪလီၫ.- တၭစဎွၩမၩ န့စအဲအၫအဖိၪမုၪ နးရံဇဖၫအဖိၪခွၫနံၫဂၩလၧအအီၪ ဖျဲၪန့ဝ့ၫလၧစစီလူၫအဂး စအၫမိၫနဲၫ ဒဲစမံၫဖံၭဘၡ့ၭ, ဒဲစစီလူၫအဖိၪမုၪနးမံရၭအဖိၪခွၫယဲဂၩ လၧအအီၪဖျဲၪ န့ၦမံၫဟိလၭဖိၪ စဘၫဇံလ့ၫအဖိၪခွၫ စအ့ဒံၫအ့လၭ",
			"9": "<sup>9</sup> အဂးလီၫ.- အဝ့ၫဒၪဖ့ၪလၫ့ခွံၬအဝ့ၫၥံၪလၧၦဂံဘအၧၫ့ ဖိၪအစူၪဖၧၩ့တၭ, အဝ့ၫၥံၪစၧၩ့လၩ့ၥံၫဝ့ၫလၧခိၪလီၩ့ ခိၪလၧယဟိဝၩအမ့ၬယၫတၭ, အဝ့ၫၥံၪလၩ့ထံၩဖါဝ့ၫ နွ့ၫဂၩလစီၪ့ဎးတၭ, ဘၪဆၧမၩၥံၫဝ့ၫလၧဆၧကူၭဘုၪ အမုနံၩလဖၪ အဘိၩ့ဘၭ လၧဆၧကူၭဘုၪဆိၫ ဘုၪမု",
			"10": "<sup>10</sup> ယီၩအခၪ့ထံၭနီၪလီၫ.- တၭစအဲအၫအဖိၪမုၪနးရံဇဖၫ မၩန့ရၧၬအဆၧကဲၩ့ယၬတၭ, ဒၩလၩ့ဝ့ၫလၧလိးလီၩ့ လၧအဂး, လၧဆၧကူၭဆိၫဘုၪထီးထံၫလၩ့ဘၪလၧမူၭ ခိၪလၧအဝ့ၫၥံၪအလီၩ့တၭ, လၧမုဆၫလခီၫထိၪၥံၪလံၪ ၥံၪလၧဆၧဖိၭဖၫ့မိဆီးလၩ့ လၧအဝ့ၫၥံၪအလီၩ့မွဲဂ့ၩ, လၧမုနၩလခီၫဆၧဖိၪဆၧဎါ လၧမံၩ့လၬကျၩမွဲဂ့ၩ,ဒုၭ ဂဲၫဝ့ၫဒၪအ့ၬ.",
			"11": "<sup>11</sup> တၭၦလီၩဘၪစဒၫဝံၭလၧဆၧ လၧစစီလူၫအၥံၪမၫ",
			"12": "<sup>12</sup> စအဲအၫအဖိၪမုၪနးရံဇဖၫမၩဝ့ၫနီၪလီၫ.- တၭစဒၫဝံၭ လ့ၩမၩန့စစီလူၫအဎွံၪ, ဒဲအဖိၪခွၫစစၪ့နၥၧၫ့အဎွံၪလၧ ယၫဘ့ၭဂံလအၭအၡၩလဖၪအအီၪ, ၦလၧအအၪ့ဂူၪ န့ဝ့ၫလၧဘ့ၭၥၡၫ့အဖၧၩ့ၥၭ, ထီးအလးၦဖလံၡၫဖိၪဒုၭ လၩ့ဆဲၩဝ့ၫလၧၦဖလံၡၫဖိၪ မၩၥံၫစစီလူၫလၧဂံလဘိ",
			"13": "<sup>13</sup> အၫအဖၧၩ့ အလးခဲၫ့နီၪလီၫ.- တၭအဝ့ၫဂဲၫဆိၬထၪ့ စစီလူၫအဎွံၪဒဲအဖိၪခွၫစစၪ့နၥၧၫ့အဎွံၪထီးနီၪ, ဒဲအၪ့ ထုၫ့ကီၪ့ၦလၧအဘၪ စၧၩ့လၩ့ၥံၫအၥၭလဖၪ အဎွံၪ",
			"14": "<sup>14</sup> လီၫ.- တၭၦခုၪ့လၩ့ဘၧၩ့ခွံၬ စစီလူၫ ဒဲအဖိၪခွၫစစၪ့ နၥၧၫ့အဎွံၪလၧဘံၪ့ယမံၫ့အခးဖၧၩ့ လၧဇံလၫအဖၧၩ့, လၧအဖါစကံၭအၥွၪခိၪဖၧၩ့လီၫ. တၭၦၡၩၥံၪမၩက ယဲဆၧလၧစဎွၩမၪလူၬဝ့ၫ ထီးအလူၬလီၫ. လၧခဲၫ့ထဲၩ့ တၭယွၩခိၭနၪ ဆၧအၪ့ကံၩ့အၪ့ယၫလၧခးအဂးနီၪ လီၫ.",
			"15": "<sup>15</sup> ၦဖလံၡၫဖိၪ ဒုၭဒံၭဆၧထၫ့ဒုၪဒၩ ဒီၭအံၫစရ့လၭ တၭ,စဒၫဝံၭလ့ၩလၩ့ဒဲအခ့ၫအၡၩအီၪလၧအၥိၭတၭ, ဒုၭၥုၭထၫ့ဒၩ ၦဖလံၡၫဖိၪတၭ, စဒၫဝံၭလၩ့ဘဲၩဝ့ၫ",
			"16": "<sup>16</sup> လီၫ.- တၭစအံၭၡဘ့ၫဘံနီၭ လၧအအီၪလၧၦဆီၪ့အ ဖိၪခွၫအကျၩ, အဖၩ့အလယၧးမွဲထီးဘၩ့ၥၧၫ့ယၩ, ခဲးထၬအၥၭလၧဆၧအၥၫ့တၭ, မိမၩၥံၫစဒၫဝံၭလီၫ.",
			"17": "<sup>17</sup> မွဲလါနၫ့တၭ နးဇ့ၫရုၫအဲအၫအဖိၪခွၫ စအၭဘၡဲၫမၩ ဆၧၩ့စဒၫဝံၭတၭ, ဖ့ၬခွံၬၦဖလံၡၫဖိၪတၭ, မၩၥံၫအဝ့ၫ ဒၪလီၫ. ထီးနီၪလဖၧၫ့စဒၫဝံၭအၡၩၥံၪ ဆိၪလၩ့အၥၭ လၧအဝ့ၫၥံၪအၥိၭစံၭဝ့ၫဒၪ, နလ့ၩထၪ့ဘၪလၧၩ့နဝ့ၫ လၧပၥိၭလၧဆၧဒုၭၥုၭအဖၧၩ့အ့ၬ, မွဲဘဲၫၥိၭနထီးမၩ ခံၭလၩ့အံၫစရ့လၭအဆၧဖၩ့နီၪလဂ့ၩလီၫ.",
			"18": "<sup>18</sup> တၭလၧဆၧလဖၪနီၪအလးခဲၫ့ ဆၧမၩအၥၭလၧ ဆၧဒုၭဒီၭၥုၭလၧၦဖလံၡၫဖိၪလၧဂီၭအဖၧၩ့လီၫ. ထီးနီၪ လဖၧၫ့ၦဟုၡၫဖိၪ စစံဘခ့ၫဖ့ၬခွံၬ စစၭဖၭလၧအအီၪ",
			"19": "<sup>19</sup> လၧၦဆီၪ့အဖိၪခွၫအကျၩလီၫ.- တၭမၩဒီၭလဖၧၫ့ဆၧ ဒုၭဒီၭၥုၭလၧၦဖလံၡၫဖိၪလၧဂီၭအဖၧၩ့တၭ, ၦဘ့ၭၥ လံၫဟံၫ့ဖိၪ စယၫရံၫအီရဂံၫ့အဖိၪခွၫ စအ့ၫလဟၫနၫ့ နီၪဖ့ၬခွံၬၦဘၪဆဲၫ့ လၧဂံတံၭဖိၪစဂိၫလဲအၫတၭ, အ ဖၩ့ဘီၩ့မၩအၥၭ ဘဲၫၦထၭထၪအထၪခိၪအၥိၭနီၪလီၫ.",
			"20": "<sup>20</sup> မၩဒီၭလဖၧၫ့ဆၧဒုၭၥုၭလၧဂၫၥၭအဖၧၩ့တၭ, ၦအဂၩ့ ဒိၪအီၪဝ့ၫလဂၩလၧအစူၪနိၩ့ လၧအစူၪဎူၫဘီၩ့,ဒဲအခၪ့ နိၩ့အီၪလၧအခၪ့ဎူၫဘီၩ့, ထီးအလူၬမွဲနံၫဆံၫလံဘီၩ့ လီၫ. တၭအဝ့ၫဒၪအီၪဖျဲၪဝ့ၫလၧၦဆီၪ့အဂးဆ့လီၫ.",
			"21": "<sup>21</sup> တၭထီးအမၩကြၩ့ထမးအံၫစရ့လၭတၭ, စဒၫဝံၭအ ထၧၫ့ဖုဝဲစၡံမအဲၫအဖိၪခွၫ စစၪ့နၥၧၫ့ဖ့ၬခွံၬဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> အဝ့ၫၥံၪလံဂၩနီၪအီၪဖျဲၪ လၧၦဆီၪ့လၧဂၫၥၭအဖၧၩ့ အဂးတၭ, လၩ့ထံၩဖါဝ့ၫလၧစဒၫဝံၭအစူၪဖၧၩ့,ဒဲလၧ အခ့ၫအၡၩလဖၪနီၪ အစူၪဖၧၩ့လီၫ."
		},
		"22": {
			"1": "<sup>1</sup> မုလနံၩလၧယဟိဝၩမၩဖီၩ့ဖျ့ၭအဝ့ၫ လၧအဒုၪအ ဒၩထီးအလူၬအစူၪဖၧၩ့, ဒဲလၧစစီလူၫအစူၪဖၧၩ့နီၪ, စဒၫဝံၭချဲၩ့ဆၧလၧယဟိဝၩ လၧထၭခိၪယီၩ အဆၧ ချဲၩ့တၭ, စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ယဟိဝၩမွဲယလဲၫ့, ဒဲယထိၬ, ဒဲဆၧမၩဖီၩ့မၩဖျ့ၭယၧၩ,",
			"3": "<sup>3</sup> ယလိးမုအယွၩ, ယမိဒိၭနဲၩ့ယၥၭလၧအဝ့ၫ, ယထၩ့ဖံၭလဘံၪ့, ယဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩအ နိၩ့, ယတၨၭထၪ့ထီၫ, ယဖလ့ၬယၥၭအလး, ဆၧထိးထဲၩ့တၩ့ထဲၩ့ယၧၩ, နထိးထဲၩ့တၩ့ထဲၩ့ယၧၩလၧဆၧမၩဆီၪ့လီၫ.",
			"4": "<sup>4</sup> ယမိကိၭထၪ့ယဟိဝၩ လၧအကြၨၭဘၪဆၧစံၭထၪ့ အၪ့အူၭ, ယမိဘၪဆၧမၩဖီၩ့မၩဖျ့ၭယၧၩ လၧယဒုၪယဒၩလီၫ.",
			"5": "<sup>5</sup> ဆၧၥံၫအလပီၩဘွၩခိၪအီၪဝၬဖီၩ့ယၧၩ, ၦၡၩလတီၩဘၪအၪဘဲၫထံၫလုၬဘံၭဆၧအၥိၭ, မၩၥၭ မဲၪယၧၩ,",
			"6": "<sup>6</sup> ဖျႃဖၧၩ့အဖျံၩလဖၪအီၪဝၬဖီၩ့ယၧၩ, ဆၧၥံၫအဖျံၩခွၩ့လဖၪပဒၩ့ထၬယၧၩလီၫ.",
			"7": "<sup>7</sup> ထီးယဘၪဆၧခိဆၧဝီၩတၭ, ယကိၭထၪ့ယဟိဝၩ, တၭယမိအၪ့ယၫဆၧလၧယယွၩလီၫ. တၭမွဲအခိၭနၪဝ့ၫယလူလၧအနီးဖၧၩ့, တၭယအၪ့ယၫဆၧလ့ၩနုၬလၧအနါဖၧၩ့လီၫ.",
			"8": "<sup>8</sup> တၭဂၪ့ခိၪၡိၩ့ၡိၬ, ဒဲဝၭထိၬဝ့ၫ, မူၭခိၪအခၪ့ထံၭလဖၪၥုၭအၥၭ, ဒဲၡိၩ့ၡိၬအၥၭ, အဂဲးဘဲၫယီၩအဝ့ၫဒၪၥၭထၪ့ဝ့ၫလီၫ.",
			"9": "<sup>9</sup> မ့ၪခူၪစဲၪ့ထၪ့လၧအနၫဖၧၩ့, တၭမ့ၪလၧအနိၭအၪ့ဆၧ, မ့ၪအၧၩ့ဘၪဆၧဒုၭခဲၩထၪ့လၧအဝ့ၫလီၫ.",
			"10": "<sup>10</sup> အဝ့ၫဒၪမၩကူၭလၩ့မူၭခိၪဆ့တၭ, ဂဲၫလၩ့, တၭဆၧခံၭၥၧၫ့အီၪဝ့ၫလၧအခၪ့ယၫၥၭဖၫ့လၬလီၫ.",
			"11": "<sup>11</sup> အဝ့ၫထူၬခ့ၫရူၬလဂၩတၭ, ယူၩဝ့ၫ, တၭဆၧဒၪဘၪအဝ့ၫလၧလံၩအဒံၭၥံၪအဖၫ့ခိၪလီၫ.",
			"12": "<sup>12</sup> ဆၧခံၭနီၪဒုၭကဲၪဝ့ၫလၧတဲၩအီၪဝၬဖီၩ့အဝ့ၫ, ထံၫၥၧၫ့, လၧမူၭဖိၭဖၫ့အဆၧအုၪ့တၪ့လီၫ.",
			"13": "<sup>13</sup> လၧဆၧယုၩ့ယဲလၧအမ့ၬယၫအကၠီၩ့နီၪ, မ့ၪအၧၩ့ခဲၩထၪ့ဝ့ၫလီၫ.",
			"14": "<sup>14</sup> တၭယဟိဝၩအၪ့မၧၫ့လၫ့ဎွံၩ့လၧမူၭခိၪ, တၭဆၧထၪ့ထီၫထုၬဒုၭၥီၫထၪ့အလူ,",
			"15": "<sup>15</sup> အၪ့မၧၫ့လၩ့ဖျါလဖၪတၭ, မၩလၩ့ပြံၩပၩအဝ့ၫၥံၪး လၫ့ဝဲအဒံၭတၭ, မၩစၪအဝ့ၫၥံၪလီၫ.",
			"16": "<sup>16</sup> တၭမၫဆမံၭအကၠီၪ့လဖၪနီၪဖျီၪထၪ့ဝ့ၫ, ဂၪ့ခိၪအခၪ့ထံၭလဖၪနီၪဘၪဆၧဒၪန့ဝ့ၫ, လၧယဟိဝၩအၪ့ၥီၪ့ဆၧအကၠီၩ့, အနၫဖၧၩ့ၥၪၡိၫဆၧလဖၧၫ့အကၠီၩ့လီၫ.",
			"17": "<sup>17</sup> အဝ့ၫအၪ့မၧၫ့လၩ့ဆၧလၧထၭလခီၫ မၩန့ထၪ့ယၧၩ, ထုၭထၪ့ခွံၬယၧၩလၧထံၫအၪအကျၩ,",
			"18": "<sup>18</sup> အဝ့ၫမၩဖီၩ့ဖျ့ၭယၧၩလၧယဒုၪယဒၩအဆီၪ့လဂၩ, ဒဲလၧၦအမ့ၬလဲၩယၧၩလဖၪလီၫ. အဂဲးဘဲၫယီၩအဝ့ၫၥံၪဆီၪ့လၨၪလၧယဂးလီၫ.",
			"19": "<sup>19</sup> လၧယဆၧနၭဆၧၡၪ့အမုနံၩနီၪ အဝ့ၫၥံၪပဒၩ့ထၬ ယၧၩလီၫ. မွဲလါနၫ့ယဟိဝၩမွဲဆၧဒိၭနဲၩ့အလးလၧယဂး,",
			"20": "<sup>20</sup> အဝ့ၫဒၪၥိၫ့ထၪ့ယၧၩဆ့ ထီၩ့လၧအလးဖၭလဲလီၫ. အဝ့ၫဒၪမၩဖီၩ့မၩဖျ့ၭယၧၩ, အဂဲးဘဲၫယီၩဘၪအဝ့ၫ ဒၪအၥၭလၧယၧၩလီၫ.",
			"21": "<sup>21</sup> ယဟိဝၩဖ့ၪလၫ့ကၪယၧၩ ဘဲၫဆၧတီၩဆၧလီၩ့အ ၥိၭ, တၭဘဲၫယစူၪဆံၫ့အၥိၭနီၪ မွဲအဖ့ၪဆၧၫ့ယၧၩလီၫ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ ယထီးန့ယူၭ ယဟိဝၩအဖၧၩ့ၥၭလ ဖၪယူၭ, ယမၩမၪယယွၩစဲၪ့ဒၪဝ့ၫအ့ၬ.",
			"23": "<sup>23</sup> မွဲအဆၧစ့ၩရၫ့ထီးအလူၬ အီၪလၧယမ့ၬယၫအကၠီၩ့ တၭ,အဆၧမၪလူၬလဖၪနီၪယလလၨၪခၫ့ဖၬဘၪး",
			"24": "<sup>24</sup> တၭယတီၩဆ့လၧအမ့ၬယၫ, ဒဲယထီးလၩ့ယၥၭလၧယဆၧအၧၩ့လီၫ.",
			"25": "<sup>25</sup> အခိးမွဲဘဲၫနီၪတၭ, ယဟိဝၩဖ့ၪလၫ့ယၧၩ, ဘဲၫယ ဆၧတီၩဆၧလီၩ့အၥိၭဘဲၫယစူၪဆံၫ့ဎံၪလၧအမ့ၬယၫ အၥိၭနီၪလီၫ.",
			"26": "<sup>26</sup> နမိယၫ့ၥၭၦလၧအယၫ့ၥၭဆၧလဖၪနီၪ, လၧၦအတီၩအလီၩ့အမ့ၬယၫနီၪ နမိအီၪက့ၪတီၩအီၪ က့ၪလီၩ့နၥၭ.",
			"27": "<sup>27</sup> လၧၦအဆံၫ့အမ့ၬယၫနီၪနအီၪက့ၪဆံၫ့နၥၭ, လၧၦအကၪအမ့ၬယၫနီၪနအီၪက့ၪကၪနၥၭလီၫ.",
			"28": "<sup>28</sup> တၭနမိမၩဖီၩ့မၩဖျ့ၭၦခမျၧးလၧအဘၪၡၪ့ဘၪနၭ, အ့ၪမွဲနမ့ၬၥၪအီၪလၧၦထၪ့ထီၫအလီၩ့တၭနမိဆၪ့လၩ့ ဝ့ၫလီၫ.",
			"29": "<sup>29</sup> အဂဲးဘဲၫယီၩနမွဲယမ့ၪဒိၩ့ယဟိဝၩဧ့, တၭယဟိဝၩမိမၩဖၩ့ထၪ့ယဆၧခံၭလီၫ.",
			"30": "<sup>30</sup> အဂဲးဘဲၫယီၩ မွဲလၧနၧၩနီၪ, ယစဲၪ့နုၬဖျီၫ့ၦၥုၭဖိၪ လဒီၪ့ယူၭ, လၧယယွၩလဂၩယဖုၫဖၬယူၭဆၧခိၪဒၧၩ့လီၫ.",
			"31": "<sup>31</sup> ဆၧလၧယွၩနီၪအဖၧၩ့ၥၭလၧၫ့ထၪ့ဎွ့ၩထၪ့လီၫ. ယဟိဝၩအလူနီၪဘၪဆၧမၩဆံၫ့ဝ့ၫလီၫ. မွဲဝ့ၫလၧထၩ့ဖံၭလဘံၪ့လၧကယဲၦလၧအဒိၭနဲၩ့အၥၭ လၧအဝ့ၫလီၫ.",
			"32": "<sup>32</sup> တၭအ့ၪလမွဲဘၪယဟိဝၩနီၪ မွဲပလၫကဲၪယွၩလဂၩ လဲၪ. လၧပယွၩအဖၫ့ခိၪနီၪ, လဲၫ့မွဲပလၫလဂၩလဲၪ.",
			"33": "<sup>33</sup> ယွၩမွဲယဂဲးယဘၭ, ဒဲယစီၩ့ယမၩ့တၭ, အဝ့ၫဒၪ မၩဎွ့ၩယဖၧၩ့ၥၭလီၫ.",
			"34": "<sup>34</sup> အဝ့ၫဒုၭကဲၪယခၪ့ဘဲၫခံၫဘၩ့မိအခၪ့အၥိၭ, တၭဒုၭဆၧၫ့ထုၪ့ယၧၩလၧယလးထၪ့ထီၫၥံၪ,",
			"35": "<sup>35</sup> အဝ့ၫၥီၪ့လိၪယစူၪလၧယမိဒုၭဆၧ, ဘဲၫၥိၭချံၪထီးဘၩ့မိခါခွံၬဝ့ၫလၧယစူၪလီၫ.",
			"36": "<sup>36</sup> တၭနဖ့ၪလၫ့ယၧၩလၧဆၧမၩဖီၩ့မၩဖျ့ၭအထၩ့ဖံၭ, တၭနၥၭဆၧၩ့နီၪမၩဒိၪထၪ့ယၧၩလီၫ.",
			"37": "<sup>37</sup> နမၩလဲထၪ့ယခၫထၪ့ဆၧလဖၪ, တၭယခၪ့ဖျၬဘၪအ့ၬ.",
			"38": "<sup>38</sup> ယလီၩ့ဆီးယဒုၪယဒၩတၭ, မၩဂၭဂီၩ့အဝ့ၫၥံၪ, ယလချႃၭမၩလူၬခွံၬဒံၭဘၪအဝ့ၫၥံၪတၭ, ယဂဲၫထဲၩ့ ထဲၩ့အ့ၬ.",
			"39": "<sup>39</sup> ယမၩလူၬခွံၬယူၭအဝ့ၫၥံၪတၭ, ယဆ့ၭဘၪဝ့ၫ,ထီး အဝ့ၫၥံၪဂဲထုၪ့ၥ့ၪအ့ၬ. မွဲမၬ,လၩ့ထံၩဖါဝ့ၫလၧယခၪ့ ဖၫ့လၬလီၫ.",
			"40": "<sup>40</sup> အဂဲးဘဲၫယီၩ နခဲးထူၬယယးဒံၩ့ လၧဆၧဂဲးဆၧ ဘၭလၧဒုၭၥုၭအဂး, နဒုၭခိၬလၩ့ၦလၧအဆၧၫ့ထုၪ့ထၫ့ဒၩယၧၩ လၧယဖၫ့ လၬ.",
			"41": "<sup>41</sup> နဖ့ၪလၫ့ယၧၩလၧယဒုၪယဒၩအခိၬ, ဘဲၫၥိၭၦလၧအၥၭဂဲၫ့ယၧၩနီၪ ယမိမၩဂၭဂီၩ့ခွံၬအဝ့ၫ ၥံၪလီၫ.",
			"42": "<sup>42</sup> အဝ့ၫၥံၪယိဝ့ၫလါနၫ့ ဆၧမၩဖီၩ့ မၩဖျ့ၭအီၪနးဂၩ အ့ၬ, လၧယဟိဝၩလါနၫ့ဘိၩ, မွဲအစံၭဆၧၫ့အဝ့ၫၥံၪအ့ၬ.",
			"43": "<sup>43</sup> ထီးနီၪလဖၧၫ့ ယမၩလၩ့ဘျ့ၭအဝ့ၫၥံၪ ဘဲၫဂၪ့ခိၪ မုၬအၥိၭနီၪ, ဘဲၫဖၧၩ့ၥၭအကဖံၬအၥိၭယယဲးထဲးဝ့ၫနီၪ, ယဎွံၪပၩ အဝ့ၫၥံၪလီၫ.",
			"44": "<sup>44</sup> နမၩဖီၩ့မၩဖျ့ၭယၧၩ, လၧယၡၩခမျၧးအဆၧအဲၪ့ လိၬၥံၪ, နအီၪက့ၪယူၭယၧၩလၧၦဆၨၩလဖၪအခိၪ, ၦခမျၧးလၧယလၥ့ၪယၫ ဝဲၩဘၪဝ့ၫနီၪ မိမၩယဆၧ လီၫ.",
			"45": "<sup>45</sup> ၦလခီၫဘၩ့မုးဖိၪ မိကျဲၩ့မၩဆၪ့လၩ့အၥၭလၧယ ဖၫ့လၬ, ထီးအနါဂၧၫ့ဆၧလၧအနါတၭ, မိခိၭနၪယလူလီၫ.",
			"46": "<sup>46</sup> ၦလခီၫဘၩ့မုးဖိၪမိလၩ့ယံၭခွံၬ, တၭမိၥၭမဲၪဆၧလၧအလးကထံၬအဖၧၩ့လီၫ.",
			"47": "<sup>47</sup> ယဟိဝၩမၧၫ့ဝ့ၫတၭး မွဲယလဲၫ့ဘၪဆၧစံၭထၪ့အၪ့ အူၭဆံၭ. တၭယဆၧမၩဖီၩ့မၩဖျ့ၭအလဲၫ့အယွၩနီၪ, မွဲအဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫဆံၭ.",
			"48": "<sup>48</sup> ၦလၧအမၩဆၧၫ့ဆၧအၧၩ့လၧယဂးနီၪမွဲယွၩ, တၭမၩနၧၩ့မၩစၪၦခမျးလၧယဖၫ့လၬ,",
			"49": "<sup>49</sup> တၭၥိၫ့ထၪ့ခွံၬယၧၩ လၧယဒုၪယဒၩအစူၪဖၧၩ့, နအီၪက့ၪထၪ့ယၧၩ ထီၫနဲၪ့ၦလၧအဂဲထုၪ့ထၫ့ဒုၪဒၩ ယၧၩး နမၩဖီၩ့ဖျ့ၭယၧၩ လၧၦမၩဆီၪ့ဆၧလဂၩနီၪလီၫ.",
			"50": "<sup>50</sup> မၩအၥၭဘဲၫနီၪတၭ, ယမိစံၭထၪ့အၪ့အူၭနၧၩ, လၧၦဆၨၩလဖၪအကျၩ, ယဟိဝၩဧ့, တၭယမိၥံၫကျံၩအၪ့အူၭထၪ့နမံၩ့လီၫ.",
			"51": "<sup>51</sup> မွဲဆၧမၩဖီၩ့မၩဖျ့ၭအတၨၭထီၫလၧအစဎွၩအဂး, ဒဲမၩဆၧအခိးအတၩ လၧအၡၩ ဒိၭဂုၪအၥၭလဂၩ, စဒၫဝံၭဒဲအချံၫအၥၪ လၩ့ဆိၩလၩ့ကၠၪလီၫ."
		},
		"23": {
			"1": "<sup>1</sup> အယီၩမွဲစဒၫဝံၭအဆၧချဲၩ့ၥံၪလၧခဲၫ့ထုၬလီၫ. စယ့ၭစံၫအဖိၪခွၫစဒၫဝံၭစံၭဝ့ၫဒၪ, ၦလၧဆၧအီၪက့ၪဝ့ၫလၧဆၧထၪ့ထီၫ, ၦလၧအဒိၭဂုၪအၥၭလၧစယၫကူၭအယွၩ. ဒဲအံၫစရ့လၭအၡၩၥံၫကျံၩဆၧမုၬမုၬလဂၩ, စံၭဝ့ၫဒၪ,",
			"2": "<sup>2</sup> ယဟိဝၩအၥၭချဲၩ့ဆၧလၧယၧၩ, တၭအလူအီၪဝ့ၫလၧယဖျ့ၩလီၩ့လီၫ.",
			"3": "<sup>3</sup> အံၫစရ့လၭအယွၩစံၭဝ့ၫဒၪ, အံၫစရ့လၭအလဲၫ့စံၭယၧၩ, ၦအတီၩအလီၩ့လဂၩမိပၧၩ့ၦၡၩ, ပၧၩ့ဝ့ၫလၧဆၧၥၭမဲၪယွၩအဖၧၩ့နီၪး",
			"4": "<sup>4</sup> မွဲဘဲၫဆၧဖၩ့လၧမုဂီၩ, ထီးမုဂဲၫထၪ့အၥိၭ, မုဂီၩလၧဆၧအုၪ့လအီၪဘၪ, ဖၩ့ထၪ့ဝ့ၫယုၩ့ယဲ, ဘဲၫနၪ့ၥံၪမံၩ့ၥံၪလၧဂၪ့ခိၪအဆၧဂဲၫဆၧၩ့အလးခဲၫ့အ ဆၧယုၩ့ယဲအၥိၭနီၪလီၫ.",
			"5": "<sup>5</sup> ယဂံၪ့လမွဲဘၪဘဲၫနီၪအၥိၭ လၧယွၩလါနၫ့တၭ, အဝ့ၫမၩဆၧအုၩ့လၩ့အဆိၩအကၠၪ, တၭတဲၩ့ဝဲၩအၥၭ လၧဆၧထီးအလူၬတၭ, ဂုးခၧၫ့ဝ့ၫ လီၫ. လဒုၭဒိၪထၪ့ဘၪဝ့ၫလါနၫ့နီၪ, မွဲယဆၧမၩဖီၩ့မၩဖျ့ၭ ထီးအလူၬ, ဒဲကယဲဆၧဆိၫ့လမံၩ့လါလါနီၪလီၫ.",
			"6": "<sup>6</sup> တၭၦဘၫအလၭဖိၪၥံၪထီးအလူၬ, မိမၩအၥၭဘဲၫ ဆၧဆူၪဆၧခဲၩ့, လၧဆၧၥုၭခွံၬဝ့ၫအၥိၭနီၪ, အဂဲးဘဲၫယီၩၦဖီၪ့အဝ့ၫၥံၪလၧစူၪၥ့ၪအ့ၬ.",
			"7": "<sup>7</sup> ၦလၧအထိၭအဝ့ၫၥံၪဘၪအီၪဎွ့ၩဝ့ၫလၧထၭ ဒဲလၧ ဖၩ့အဘီၩ့, ဒဲမိဘၪဆၧဆူၭထၪ့ခွံၬဝ့ၫ လၧမ့ၪ လူၬထူၬဆံၫ့ဘၩ့, ထီးအလးနီၪလီၫ.",
			"8": "<sup>8</sup> အယီၩမွဲၦအဆီၪ့ လၧအအီၪလၧစဒၫဝံၭအၥိၭလ ဖၪအမံၩ့း ၦတၭမိၫဖိၪ လၧအဆၧၫ့နၩ့ လၧလးဆၧၫ့နၩ့ ဖၧၩ့ၦဒိၪထုၬလၧၥုၭခိၪၥံၪအကျၩး အဝ့ၫဒၪမွဲၦအ့ဇ နဲၭဖိၪစအဒဲနီၫနီၪလီၫ. အဝ့ၫဒၪဆိၬထၪ့အဖၩ့တၭ,",
			"9": "<sup>9</sup> ထၫ့ဒၩၦဎိၭယၩနီၪမၩၥံၫဝ့ၫလဖၧၫ့ဎးလီၫ.- လၧအ ဝ့ၫဒၪအလးခဲၫ့ၦအဟိဟဲၭဖိၪ စဒိဒိၫအဖိၪခွၫစအံၫလ အ့ဇၧၫ, လၧစဒၫဝံၭအၡၩအဆီၪ့ ၥၧၫ့ဂၩအကျၩနီၪ, ထီးအဝ့ၫၥံၪအၪ့ထၩၦဖလံၡၫဖိၪၥံၪ လၧအဝ့ၫၥံၪအီၪ ကီၪ့ဒုၭၥုၭအဂးတၭ, ၦအံၫစရ့လၭဖိၪလဖၪ စဲၪ့ထၪ့",
			"10": "<sup>10</sup> ခွံၬယူၭ.- အဝ့ၫဒၪဂဲထုၪ့ကျီၪ့ၥံၫခွံၬၦဖလံၡၫဖိၪၥံၪထီး အစူၪၡၫတၭ, အစူၪနီၪဖီၪ့ထၬ အနၭတၭ, လၧမုလ နံၩနီၪယဟိဝၩဒုၭကဲၪထၪ့ ဆၧမၩနၧၩ့မၩစၪဖၭဒိၪဆ့ လီၫ.တၭၦခမျၧးၥံၪထဲၩ့ဖိၬအခဲၫ့န့ၫ လၧအမိအၪ့ဂူၬန့ ဆၧဖိၪဆၧလံၩလီၫ.",
			"11": "<sup>11</sup> လၧအဝ့ၫဒၪအလးခဲၫ့ မွဲၦဟၫရၫဖိၪ စအ့ၫဂံၫအဖိၪ ခွၫစၡၫ့မၫနီၪလီၫ. တၭၦဖလံၡၫဖိၪအီၪကီၪ့လၧဂၪ့ခိၪ အဝၩ့ဎွ့ၩဝ့ၫလၧပထိၭၥၪၥံၪ, ၦခမျၧးၥံၪစဲၪ့လၧၦဖလံ",
			"12": "<sup>12</sup> ၡၫဖိၪလဖၪအမ့ၬယၫလီၫ.- မွဲလါနၫ့ဘိၩအဝ့ၫဒၪအီၪ ဆၧၫ့ထုၪ့လၧဂၪ့ခိၪနီၪအၥၭကျၩတၭ, မၩဖီၩ့မၩဖျ့ၭ ဝ့ၫ,ဒဲကျီၪ့ၥံၫခွံၬၦဖလံၡၫဖိၪလဖၪနီၪလီၫ. တၭယဟိ ဝၩဒုၭကဲၪထၪ့ဆၧမၩနၧၩ့မၩစၪဖၭဒိၪဆ့လီၫ.",
			"13": "<sup>13</sup> တၭလၧၦအခိၪၥၧၫ့ဆံၫအကျၩနီၪ, ၦၥၧၫ့ဂၩလ့ၩ လၩ့ဝ့ၫတၭ, ထီၩ့လၧစဒၫဝံၭအအီၪလၧ ဆၧကူၭဘုၪ အခၫနီၪ ထီၩ့လၧအဒၧလၫ့အအိၩဖၧၩ့လီၫ. တၭၦဖ လံၡၫၥုၭဖိၪ အီၪကီၪ့တဲၩ့ဝဲၩဆၧလၧခိၪလီၩ့ ရ့ဖအံၫ့",
			"14": "<sup>14</sup> အဆူၭဖၧၩ့လီၫ.- တၭအထီထီးနီၪစဒၫဝံၭအီၪဝ့ၫလၧ ထိၬဖၧၩ့တၭ, ၦဖလံၡၫဖိၪအၡၩခိၭဆၧလဒီၪ့အီၪဝ့ၫ",
			"15": "<sup>15</sup> လၧဘ့ၭၥလံၫဟံၫ့အဖၧၩ့လီၫ.- တၭစဒၫဝံၭၥူၫအီၩအ ၥၭတၭ, ချဲၩ့ဆၧၫ့ဆၧတၭစံၭဝ့ၫဒၪ, မွဲပလၫမိဒုၭအီၩ ယၧၩထံၫလၧဘ့ၭၥလံၫဟံၫ့ အထံၫဖၧၩ့ လၧအအီၪ",
			"16": "<sup>16</sup> လၧတရၫ့အနဲၩ့နီၪလဂၩလဲၪ.- ၦအဆီၪ့ၥၧၫ့ဂၩနီၪနုၬ ဆီၪ့လၧၦဖလံၡၫဖိၪ အၥုၭမုအကျၩတၭ ဒုၪ့ထံၫလၧ ဘ့ၭၥလံၫဟံၫ့အထံၫဖၧၩ့ လၧအအီၪလၧတရၫ့နဲၩ့တၭ, မၩန့ဝ့ၫတၭ ဂဲၫထဲၩ့ဆိၬဝ့ၫလၧစဒၫဝံၭအအီၪလီၫ. မွဲ လါနၫ့ဘိၩစဒၫဝံၭအီၩဝ့ၫအ့ၬ. လူၫလၩ့ခွံၬဝ့ၫလၧယ",
			"17": "<sup>17</sup> ဟိဝၩအဂးလီၫ.- စံၭဝ့ၫဒၪ, မွဲယထီးမၩဘဲၫယီၩလ ဂ့ၩ,ယဟိဝၩဧ့, ဆၧယီၩမွဲၦလၧအလ့ၩဝ့ၫလၧလလီၫ့ ကီၩ့ဘၪအၥၭမၧၫ့အၥွံၪ လမွဲဘၪဧၪ. တၭအီၩဝ့ၫဒၪ အ့ၬ.ၦအဆီၪ့ၥၧၫ့ဂၩနီၪ မၩဆၧနီၪလဖၪလီၫ.",
			"18": "<sup>18</sup> နးဇ့ၫရုၫအဲအၫအဖိၪခွၫ စယိအၭအထၧၫ့ဖုဝဲစအၭ ဘၡဲၫမွဲဆၧအခိၪလၧၥၧၫ့ဂၩအကျၩတၭ, ယၩ့ထၪ့အ ဖၩ့ထၫ့ဒုၪဒၩၦၥၧၫ့ယၩတၭ, မၩၥံၫဝ့ၫနီၪအမံၩ့အီၪဝ့ၫ",
			"19": "<sup>19</sup> လၧၦၥၧၫ့ဂၩအကျၩလီၫ.- တၭၦၥၧၫ့ဂၩအကျၩနီၪအ ဝ့ၫဒၪအလၩအဖၩ့ဒိၪထုၬလမွဲဘၪဧၪ. အခိးမွဲဘဲၫနီၪ တၭ,ကဲၪထၪ့လၧအဝ့ၫၥံၪအခိၪလီၫ. မွဲလါနၫ့ဘိၩဖိၫ ဒံၭၦလၧအဝံခိၪၥၧၫ့ဂၩနီၪအ့ၬ.",
			"20": "<sup>20</sup> တၭၦအဆီၪ့ၦကၭဘဇံၫအ့လၭဖိၪ, ၦၥထံၫအဖိၪ ခွၫစယဟီအဒၫအဖိၪခွၫ စဘံၫ့နအဲအၫနီၪမၩယူၭဆၧ ဖၭဒိၪအၪမံၩ့, မၩၥံၫၦၡၩလၩ့ဂၬဆၬလၥၧၫ့နံၫဂၩဘၪ ဆဲၫ့လၧမိအၭလီၫ. အဝ့ၫဒၪလ့ၩလၩ့တၭ, ဖ့ၬခွံၬဆ့ ဆၬလၥၧၫ့လဒုၩ လၧဆၧဖၧၩ့အၥၭကျၩ လၧဆၧဂဲၫ",
			"21": "<sup>21</sup> ဆၧၩ့လၩ့မူၭခိၪဖီၫအခၫနီၪလီၫ.- အဝ့ၫဒၪနီၪဖ့ၬခွံၬ ၦအံဇံၭဖိၪလၧအခံးအဂၩ့ဂ့ၩ လဂၩတၭ, ဖၩ့အီၪဝ့ၫ လၧၦအံဇံၭဖိၪအစူၪဖၧၩ့ လဘံၪ့တၭ, အဝ့ၫဒၪလ့ၩ လၩ့ဝ့ၫလၧအအီၪ, အီၪလၧအနိၪထး လၧအစူၪဖၧၩ့ တၭ,ဖျဲးန့ခွံၬဖၩ့လဘံၪ့ လၧၦအံဇံၭဖိၪအစူၪဖၧၩ့တၭ, မၩၥံၫဝ့ၫလၧအဖၩ့ဒၪဝ့ၫနီၪလီၫ.",
			"22": "<sup>22</sup> စယဟီအဒၫအဖိၪခွၫ စဘံၫ့နအဲအၫလဂၩမၩဆၧ နီၪလဖၪတၭ, အမံၩ့အီၪဝ့ၫလၧၦအဆီၪ့ၥၧၫ့ဂၩအကျၩ",
			"23": "<sup>23</sup> လီၫ.- တၭအလၩအဖၩ့ဒိၪနဲၪ့ၦၥၧၫ့ဆံၫဒံၭလါနၫ့တၭ, ဖိၫဒံၭၦလၧအဝံခိၪ ၥၧၫ့ဂၩနီၪအ့ၬ. တၭစဒၫဝံၭ အီၪ က့ၪဝ့ၫလၧအၡၩခိၭဆၧအဖၫ့ခိၪလီၫ.",
			"24": "<sup>24</sup> စယိအၭအထၧၫ့ဖုဝဲစအၫစဟ့လၭလဂၩ အီၪဝ့ၫလၧ ၦၥၧၫ့ဆံၫနီၪအကျၩး ၦဘ့ၭၥလံၫဟံၫ့ဖိၪ စဒိဒိၫအဖိၪ",
			"25": "<sup>25</sup> ခွၫစအ့လဟၫနၫ့.- ၦဟၫရိၫဒဲၭဖိၪစၡၫ့မၫ, ၦဟၫရိၫ ဒဲၭဖိၪစအံၫလဲကၫ, ၦပၫလတဲၭဖိၪစဟ့လ့ၭ, ၦဟံကိ",
			"26": "<sup>26</sup> ဖိၪစအံၭက့ၭအဖိၪခွၫစအဲရၫ,- ၦအန့ၭတၥဲၭဖိၪစအၭ",
			"27": "<sup>27</sup> ဘအံဇၧၫ, ၦဟုၡ့ၫဖိၪစမဘုနဲၫ,- ၦအ့ၫဟိဟဲၭဖိၪစဇၫ",
			"28": "<sup>28</sup> လမၧၫ့, ၦန့တိၫဖၫၥဲၭဖိၪစမဟၫရဲၫ,- ၦန့တိၫဖၫၥဲၭ ဖိၪစဘၫအနၫအဖိၪခွၫစဟ့လ့ၭ, ၦဘၪဆဲၫ့လၧၦဘံၪ့ ယမံၫ့ဖိၪၥံၪဂဲၫထၪ့လၧဂံဘအၫနီၪ, စရံဘဲၫအဖိၪခွၫ",
			"29": "<sup>29</sup> စအံတဲၫ,- ၦပံၫရၥၧၫ့ဖိၪစဘံၫ့နအဲအၫ, ၦဂ့အၭခိၪ",
			"30": "<sup>30</sup> လီၩ့ဆူၭဖိၪစဟံၭဒဲၫ,- ၦအၫဘၫဖိၪစအၭဘဲၫအၪလ",
			"31": "<sup>31</sup> ဘၧၫ့,ၦဘၫဟမဲၭဖိၪစအၭဇမၫၥ့ၭ,- ၦၡၩအၫလဘၫ နဲၭဖိၪစအံၫလဲအဘၫ, ဘၪဆဲၫ့လၧစယၫၡံၫ့အဖိၪခွၫ",
			"32": "<sup>32</sup> လဖၪ,စစၪ့နၥၧၫ့,- ၦဟၫရၫဖိၪစၡၫ့မၫ ၦဟၫရၫဖိၪ",
			"33": "<sup>33</sup> စၡ့ရၫအဖိၪခွၫ စအဟဲအၫ့,- စအဟၭဘဲၫအဖိၪခွၫ စအံၫလံၭဖလ့ၭ, လၧအဘၪဆဲၫ့လၧမ့ၫအကၭ, ၦဂဲလိၫ",
			"34": "<sup>34</sup> ဖိၪစအဟံၭၥိၫဖ့လၭ အဖိၪခွၫစအံၫလဲအၫ့,- ၦကၫမ",
			"35": "<sup>35</sup> လၭဖိၪစဟ့ဇရဲၫ, ၦအၫဘဲၭဖိၪစပၫအရ့ၫ, ၦဇိဘၫဖိၪ",
			"36": "<sup>36</sup> စနၫၥၫ့အဖိၪခွၫစအဲၫဂလၭ ၦဂၭဖိၪစဘၫနဲၫ,- ၦအၫ မၧၫ့ဖိၪစဇံလ့ၭ, ၦဘအံရီၭဖိၪစနဟၫရဲၫ, နးဇ့ၫရုၫအဲ အၫအဖိၪခွၫ,",
			"37": "<sup>37</sup> ၦဆိၬစယိအၭအစူၪဝဲၩ,- ၦအံ",
			"39": "<sup>39</sup> ၥရဲၭဖိၪစအဲရၫ, ၦအံၭၥရဲၭဖိၪစဂၫရ့ၭ,- ၦဟံၥၭဖိၪ စယုၫရဲအၫၥံၪ, ထီးအလူၬလဖၪနီၪမွဲၦၥၧၫ့ဆံၫနွ့ၫဂၩ လီၫ."
		},
		"24": {
			"1": "<sup>1</sup> ယဟိဝၩအၥၭထၪ့ဘၪဒီၭ အံၫစရ့လၭတၭ, မွဲအ ထိၪဂဲၩစဒၫဝံၭထၫ့ဒုၪဒၩအဝ့ၫၥံၪ ဘဲၫၥိၭအမိစံၭ,လ့ၩ ဘီၪ,ဝံထၪ့နၬထၪ့အံၫစရ့လၭဖိၪ, ဒဲၦယုဒၫဖိၪနီၪဆံၭ.",
			"2": "<sup>2</sup> တၭစဎွၩစံၭၦၥုၭမုအခိၪလၧအအီၪဝ့ၫ လၧအၥိၭစယိ အၭ, လ့ၩလၧအံၫစရ့လၭအဒီၪ့လဖၪအကျၩ လၧဒၫ့ ဖိးလၧဘံအၧၫၡံၫဘၫတၭ, ဝံထၪ့ၦခမျၧးဘဲၫၥိၭယမိ",
			"3": "<sup>3</sup> ၥ့ၪယၫၦခမျၧးအဆၧဝံဆၧနၬဆံၭ.- စယိအၭစံၭၦခ မျၧးအ့ၪအီၪဎွ့ၩအံၩဎွ့ၩအိၩနီၪတၭ, မွဲယဟိဝၩနယွၩ ဒုၭအၪထၪ့အၪနဲၪ့အလးအစၩ လယၩတၭ,မွဲယကဆါ စဎွၩမိဒၪဘၪဝ့ၫဆံၭ. ဘၪစဎွၩအၥၭလၧဆၧလမံၩ့နီၪ,",
			"4": "<sup>4</sup> မွဲဘၪလဲၪ.- မွဲလါနၫ့ဘိၩစဎွၩအဆၧချဲၩ့ဆီၪ့နဲၪ့စယိ အၭ,ဒဲၦၥုၭမုလဖၪအဆၧချဲၩ့တၭ, စယိအၭဒဲအၡၩ ၥုၭမုအခိၪၥံၪစဲၪ့ထၪ့ခွံၬလၧစဎွၩအအီၪ, ဘဲၫၥိၭအမိ ဝံထၪ့နၬထၪ့အံၫစရ့လၭလီၫ.",
			"5": "<sup>5</sup> အဝ့ၫၥံၪလ့ၩခၫ့ဂၬ ယီၫဒၫ့တၭ, ၥုၪ့တဲၩလၧအရိ အၧၫလၧဒိၩ့အစူၪထွ့ၪလခီၫလၧအအီၪဝ့ၫ လၧဂၭအ ခိၪလီၩ့ဆူၭအၥၭကျၩ, ဒဲတီၩလၧယၫဇၧၫနီၪဆ့လီၫ.",
			"6": "<sup>6</sup> အဝ့ၫၥံၪဂဲၫဝ့ၫလၧဂံလအၭ, ဒဲလၧခးတၫတံၫ့ဟီၭဒၡဲၫ တၭ,ဂဲၫဝ့ၫလၧဒၫ့ယၫအၫ့တၭ, လ့ၩဎဲၪ့ဝ့ၫလၧဇဲဒၧၫ့,",
			"7": "<sup>7</sup> တၭဂဲၫဝ့ၫလၧတဲအၫအထိၬ, ဒဲလၧၦဟံဝဲၫဖိၪအဒိၩ့ လဖၪထီးအလူၬ, ဒဲလၧၦကၫနအၫ့ဖိၪအအီၪတၭ,စဲၪ့ ထၪ့ဝ့ၫလၧယုဒၫအမုခံၫ့လခီၫလၧဘံအၧၫၡံၫဘၫလီၫ.",
			"8": "<sup>8</sup> ထီးအဝ့ၫၥံၪလ့ၩဖျီၫ့ခးထၧၫ့ဘံၪ့ယၫဂီၩ့တၭ, အလၩ ခွံၫဘံၪ့ဒဲအနံၩနံၫဆံၫ အထုၬနီၪဂဲၫထဲၩ့ဝ့ၫထီၩ့လၧယ",
			"9": "<sup>9</sup> ရုစလံၫ့လီၫ.- စယိအၭဖ့ၪလၫ့စဎွၩလၧၦခမျၧးအဆၧ ဝံဆၧနၬတၭ, ၦအဆီၪ့လၧအထုၭထၪ့နၭလၧအံၫစရ့ လၭအကျၩ အီၪဎိၭကုၬတၭ, ယုဒၫအၡၩ အီၪဝ့ၫယဲ ကုၬလီၫ.",
			"10": "<sup>10</sup> လၧအဝံထၪ့နၬထၪ့ၦခမျၧးအလးခဲၫ့နီၪ, စဒၫဝံၭနီၫ့ ယါလၩ့ထဲၩ့အၥၭတၭ, စဒၫဝံၭစံၭယဟိဝၩ,ယမၩဆၧ နီၪတၭ,ယမၩမၪယူၭဖၭဒိၪယူၭတၭ, ဘိၩ့နဲၪ့ယီၩဖျါ လါနခ့ၫနၡၩအဆၧဒဲၩဘၭဆံၭ, ယဟိဝၩဧ့, အဂဲးဘဲၫ",
			"11": "<sup>11</sup> ယီၩ,ယမၩယူၭဆၧဂီၩ့ဆၧစၪနၭနၭလ့ၬယူၭ.- ထီး စဒၫဝံၭဂဲထုၪ့ လၧမုဂီၩလခီၫတၭ, ယဟိဝၩအလူဘၪ မီၪစဂၭ, စဒၫဝံၭအၡၩဒၪဆၧလၧယၫလဂၩတၭ, စံၭ",
			"12": "<sup>12</sup> ဝ့ၫဒၪ,- လ့ၩလီၩဘၪစဒၫဝံၭဆံၭ. ယဟိဝၩစံၭဘဲၫယီၩ, ယအီၪက့ၪဆၧၥၧၫ့မံၩ့လၧနမ့ၬယၫလီၫ. ရွံန့နးမံၩ့လၧ အကျၩဆံၭ. တၭယမိအီၪက့ၪဆၧနီၪလမံၩ့ လၧနဂး",
			"13": "<sup>13</sup> လီၫ.- စဂၭဂဲၫလၧစဒၫဝံၭအအီၪတၭ, ဒုၭနဲၪဝ့ၫတၭ, စံၭအဝ့ၫ, ဆၧၥၭဝံလၩ့ဒိၩနွ့ၫနံၪ့မိဂဲၫနုၬလၧနခးဖၧၩ့ ဆ့ဧၪးအ့ၪလမွဲဘၪ နမိစဲၪ့ဖျိၭလၩၥၧၫ့ဘံၪ့ လၧနဒုၪန ဒၩအမ့ၬယၫထီးအဝ့ၫၥံၪလီၩ့ဆီးနၧၩဆ့ဧၪး အ့ၪလ မွဲဘၪဆၧဆၫအဖျဲၪမိအီၪလၧနခးဖၧၩ့ ၥၧၫ့နံၩဆ့ဧၪး တၭဘိၩ့နဲၪ့ယီၩၥ့ၪယၫဒဲယိဘီၪ, ယမိဘၪစံၭဆၧၫ့ထဲၩ့",
			"14": "<sup>14</sup> ၦလၧအအၪ့မၧၫ့လၩ့န့ယၧၩလဂၩဘဲၫၥ့ၪလဲၪ.- တၭ စဒၫဝံၭစံၭစဂၭနီၪ, ယအီၪလၧဆၧအလး ကထံၬနၭ နၭလ့ၬအဖၧၩ့လီၫ. မွဲပလၩ့ဘၪၡီၩ့ လၧယဟိဝၩအ စူၪဖၧၩ့ဆံၭ, အဂဲးဘဲၫယီၩအဝ့ၫဒၪအဆၧယၫ့ၥၭအီၪ အၪအၪလ့ၬၥၭအီၪပၧၩ ဒိၪမၬလီၫ. တၭမွဲယထီးလၩ့ ဘၪလၧၦၡၩအစူၪဖၧၩ့လဂ့ၩ.",
			"15": "<sup>15</sup> အခိးမွဲယဟိဝၩအၪ့မၧၫ့လၩ့ ဆၧဆၫအဖျဲၪလၧ အံၫစရ့လၭအဖၫ့ခိၪလၧမုဂီၩ ထီးအထီလၧအဖၭဝဲၩဝ့ၫ နီၪ,ၦၥံၫဝ့ၫလၧၦခမျၧးအကျၩ လၧဒၫ့ဖိးလၧဘံအၧၫ",
			"16": "<sup>16</sup> ၡံၫဘၫနွ့ၫလၬလီၫ.- ထီးအၥီၫ့ယၩ့ထၪ့အစူၪလၧယရု စလံၫ့အဖၫ့ခိၪဘဲၫၥိၭအမိမၩဂၭဂီၩ့ဝ့ၫတၭ, ယဟိဝၩ နီၫ့ယါလၩ့ထဲၩ့အၥၭ, လၧဆၧအၧၩ့နီၪတၭ, စံၭအၥီၫ့ လၧအမၩဂၭဂီၩ့ၦခမျၧးလဂၩနီၪ, အၪယူၭ,ထုၭလၩ့ ထဲၩ့နစူၪဆံၭ. တၭယဟိဝၩအၥီၫ့နီၪအီၪဝ့ၫလၧ ၦယ့",
			"17": "<sup>17</sup> ဘုၫဖိၪစအရီနၫအခရဲးဖၧၩ့နီၪလီၫ.- ထီးအဒၪဘၪဝ့ၫ လၧအၥီၫ့ဖ့ၬခွံၬ ၦခမျၧးတၭ, စဒၫဝံၭ ချဲၩ့ဆၧလၧယ ဟိဝၩ,စံၭဝ့ၫဒၪ, ယိခွါ,ယမၩမၪယူၭဆၧယူၭ, ဒဲမၩ အၧၩ့ဆ့း အ့ၪမွဲၥိၪလဖၪယီၩမွဲအဝ့ၫၥံၪမၩဘၪဆၧနီၪ လမံၩ့လဲၪ, မွဲနစူၪအီၪလါလၧယလီၩ့ဒဲယဖါအၡၩဂံၪ့ ဖိၪအလီၩ့နီၪဆံၭ.",
			"18": "<sup>18</sup> ဆၧလၧမုလနံၩနီၪ စဂၭဂဲၫလၧစဒၫဝံၭအအီၪတၭ စံၭအဝ့ၫ,လ့ၩထၪ့ဘီၪ, မၩထၪ့ဆၧလုအလးလၧယဟိ ဝၩအဂးလၧၦယ့ဘုၫဖိၪစအရီနၫအခရဲးဖၧၩ့နီၪဆံၭ.",
			"19": "<sup>19</sup> စဒၫဝံၭမၩဝ့ၫဘဲၫစဂၭအလူအၥိၭနီၪတၭ, လ့ၩထၪ့",
			"20": "<sup>20</sup> ဝ့ၫဘဲၫယဟိဝၩ မၪလူၬဆၧအၥိၭနီၪလီၫ.- စအရီနၫ ယိဝ့ၫနီၪ,ဒၪဘၪစဎွၩ ဒဲအခ့ၫအၡၩၥံၪဂဲၫလၧအအီၪ တၭ,ထွံၩလၩ့တၭ ချႃၬလၩ့အမ့ၬလၧဂၪ့ခိၪလၧစဎွၩ",
			"21": "<sup>21</sup> အမ့ၬယၫလီၫ.- တၭစအရီနၫစံၭအဝ့ၫဒၪ, ယကဆါစ ဎွၩဂဲၫလၧအခ့ၫအၡၩအအီၪ, မွဲအဘၪဆၧနီၪလမံၩ့ လဲၪ. တၭစဒၫဝံၭစံၭဝ့ၫဒၪ, ဘဲၫၥိၭယမိဎွ့ၩန့ခရဲးလၧ နအီၪဘဲၫၥိၭယမိမၩထၪ့ဆၧလုအလး လၧယဟိဝၩ အဂးလၧဆၧမိပဒၩ့ဆၧဆၫအဖျဲၪ လၧၦခမျၧးနီၪလီၫ.",
			"22": "<sup>22</sup> စအရီနၫစံၭစဒၫဝံၭ, မွဲယကဆါစဎွၩမၩန့ဆၧတၭ,လု ထၪ့ဆၧလၧအဂ့ၩလၧအမ့ၬယၫဆံၭ. ယိခွါ,ချီဖၫလၧ ဆၧလုမ့ၪအဂး, ဒဲနိၪထးၥံၪလၧပထးဘုၪ, ချီအဎၧၩ့ အဎီလဖၪ, လၧၥံၪ့မုအဂးနီၪအီၪဝ့ၫလီၫ.",
			"23": "<sup>23</sup> ဆၧထီးအလူၬနီၪ စအရီနၫဖ့ၪလၫ့ဘဲၫစဎွၩအၥိၭ, လၧစဎွၩအစူၪဖၧၩ့လီၫ. စအရီနၫစံၭစဎွၩ, မွဲယဟိ ဝၩနယွၩထိးဆၧၫ့နၧၩဆံၭ.",
			"24": "<sup>24</sup> တၭစဎွၩစံၭစအရီနၫ,မွဲအ့ၬ. ယမိဎွ့ၩဆၧလၧနၧၩ လၧအဎွ့ၩတၡါလီၫ. တၭလၧဆၧ လၧယန့ဘၪပျီၩ ပျီၩနီၪ,ယလုထၪ့ဆၧလုမ့ၪ လၧယဟိဝၩယယွၩအဂး အ့ၬ. အခိးမွဲစဒၫဝံၭဎွ့ၩခရဲးနီၪ, ဒဲချီလဖၪလၧစ့ၩၡ",
			"25": "<sup>25</sup> က့လၭယဲဆံၫလီၫ.- စဒၫဝံၭမၩထၪ့ ဆၧလုအလးထီး နီၪလၧယဟိဝၩအဂးတၭ, လုထၪ့ဆၧလုမ့ၪ ဒဲဆၧလု မၩဘၪလိၬအိၭလိၬလီၫ. တၭယဟိဝၩခိၭနၪအဆၧ ဘၩဆိၪဖၪလၧခးအဂးနီၪတၭ, ဆၧဆၫအဖျဲၪလၩ့မါ လၧအံၫစရ့လၭအကျၩနီၪလီၫ."
		}
	}
};
module.exports = book;